(CeDRI) - Polytechnic Institute of Bragança - and member of Algorithm Research Centre – Minho University - in the Systems Engineering and Operational Research (SEOR) R&amp;D group. She is also Coordinator Member of Bragança “Ciência Viva” Science Centre.\nAna I. Pereira got her PhD from Minho University (2006) in ‘Numerical Optimization’ area. She is the author, or co-author, of more than eighty journal papers, book chapters and conference proceedings. She participated in more than ten research projects in the areas of robotics, optimization and innovating tools in teaching.','Instituto Politécnico de Bragança','Department of Mathematics - ESTiG-IPB','50','','Bragança','Campus de Sta Apolónia; Gab 54. 5300-253 Bragança - Portugal','+351 273303106','ipb@ipb.pt','ipb.pt','','','Portugal'),(11,78,42,'Kauno technologijos universitetas','Renata Burbaitė','renata.burbaite@ktu.lt','https://if.ktu.edu (personal website: http://medziaga.puslapiai.lt)','Informatics Engineering','Programming &amp; IT courses (secondary school level)\nObject Oriented Programming (university level)','22 as IT teacher and 7 years as lecturer at the University','Dr. Renata Burbaitė is currently an associated professor at the Software Engineering Department of Faculty of Informatics at Kaunas University of Technology and Informatics teacher at the High School (Panevėžys Juozas Balčikonis gymnasium). She holds a PhD degree in Computer Science since 2014. \nHer research interests include CS educational domain modelling and STEM-oriented robot-based CS education methodologies, as well smart learning environments, personalised education, including assessment which guides to learning personalisation. She is a co-author of two chapters of the monograph “Smart Learning Objects for Smart Education in Computer Science” (2015) and co-author of monograph “Smart STEM-Driven Computer Science Education: Theory, Methodology and Robot-Based Practices” (2018).','Kaunas University of Technology','Faculty of Informatics','12000','','Kaunas','Studentų 50, Kaunas','+370 (37) 30 03 51','Projects related questions: vida.drasute@ktu.lt','https://ktu.edu','','','Lithuania'),(12,78,42,'Kauno technologijos universitetas','Sigitas Drąsutis','Sigitas.drasutis@ktu.lt','https://if.ktu.edu','Informatics Engineering','Interactive web technologies\nCommunication technologies','17','Working as associated professor in the Faculty of Informatics, Software Engineering Department, KTU. Also programmer at Lithuanian Higher Education Association to organize general admission. He is experienced in software systems development, management, as well in the research area, lecturing. \nHe is specialized at analysis processes, assessment systems and tools development, specification and development of different information systems, databases, platforms. He has Science of Doctor Degree in Informatics Engineering since 2006. His work is also concerned with different national and international projects related with e. learning and e. platforms, internet based multimedia websites for the learning material presentation, visual material creation for educational purposes, testing systems and other specific systems which require high level of knowledge and practice. \nHe is providing online courses for higher education students, as well lecturing in national and international seminars. He is an author and creator of the Platform for e. testing (platform is widely used by Universities, schools), various web-portals for enterprises, education institutions creator and manager, developer of different information systems for the companies and customers in Germany, Belgium, France, United Kingdom.','Kaunas University of Technology','Faculty of Informatics','12000','','Kaunas','Studentų 50, Kaunas','+370 (37) 30 03 51','Projects related questions: vida.drasute@ktu.lt','https://ktu.edu','','','Lithuania'),(13,78,42,'Kauno technologijos universitetas','Žvironienė Aušra','ausra.zvironiene@ktu.lt','https://mgmf.ktu.edu ; http