to Politécnico de Bragança','Escola Superior de Tecnologia e Gestão','','','','','','','','','','Portugal'),(36,81,50,'Instituto Politécnico de Bragança','Flora Silva','flora@ipb.pt','','Water efficiency and reuse. Pedagogical practices in higher education.','Linear Algebra and Analytic Geometry; Algebra; Mathematical Analysis II; Statistics; Data Analysis in Social Service; Quantitative Methods.','14','PhD in Civil Engineering;\nProfessor of course units of Civil Engineering;\nShe has also been teaching course units of the Mathematics Departments of ESTiG and ESE, Informatics and Communications, Applied Mechanics and Industrial Management of ESTiG.','Instituto Politécnico de Bragança','Escola Superior de Tecnologia e Gestão','','','','','','','','','','Portugal'),(37,81,50,'Instituto Politécnico de Bragança','Inês Barbedo','inesb@ipb.pt','','Spectral graph theory and combinatorics','Discrete Mathematics, Fundamentals of Mathematics and Mathematics for Games','20','ACADEMIC DEGREES\n• Phd in Mathematics and Applications, thesis on Spectral Graph Theory - University of Aveiro, July 2015\n• Master in Mathematics, Fundamentals and Applications,  dissertation on RSA cryptographic system - Faculty of Sciences of the University of Porto, February 2004\n• Degree in Mathematics (Educational field) - Faculty of Sciences of the University of Porto, September 1998\n\nWORK EXPERIENCE\n• Adjunct Teacher in School of Public Management, Communication and Tourism (EsACT) - Polytechnic Institute of Bragança, since August 2015\n• Assistant in Polytechnic Institute of Bragança, from December 1998 to July 2015\n• Cooperation Program CRUP/FUP with University of Timor Lorosae - Dili, Timor Leste - Faculty of Economics, 2006 and Faculty of Engineering, 2003\n• Intern Teacher at High School Rodrigues de Freitas in Oporto, Academic Year 1997/1998\n\nSCIENTIFIC ACTIVITY\n• Research interests in Spectral Graph Theory and in Game and Decision Theory\n• Collaborator in Center for Research &amp; Development in Mathematics and Applications (CIDMA) in the Department of Mathematics in University of Aveiro\n• Publication\n- Barbedo, D. M. Cardoso, D. Cvetkovic, P. Rama, S.K. Simic, “A Recursive Construction of the Regular Exceptional Graphs with Least Eigenvalue -2\'\', Portugaliae Mathematica\n71(2) (2014):79-96.\n• Participation in several conferences with oral communications about Spectral Graph Theory, Combinatorics and 0-1 matrices\n• Communications in Poster:\n- Teixeira, B e Barbedo, I., \'\'Proposta de dinamização do geoturismo no concelho de Mirandela.\'\', II Encontro de\nJovens Investigadores- Bragança, from 12 to 14 November, 2014\n- Barbedo, I, Cardoso, D. M. e Rama, P., “In search of a poset structure to the regular exceptional graphs.\'\', Research Day University of Aveiro, 19th June 2013\n- Pacheco, M.F. e Barbedo, I., “Teoria de grafos na resolução de um problema.\'\', V Congresso Iberoamericano de Educação Matemática- Porto, from 17 to 22 July, 2005\n• Participation in projects\n- “Inovação Educacional e Pedagogia Experimental no Ensino da Matemática”, 1998\nThe aim of the project was to explore applications, modelling and software such as Geometer’s Sketchpad in\nmathematics learning in high school \n- “Matemática sem fronteiras“, Programa Ciência Viva, 1996\nThe project consists in an exhibition and activities developed within the scope of the Methodology of the\nMathematics course of the Faculty of Sciences-University of Porto, for high school students\n\nPEDAGOGICAL ACTIVITY\n• Lectures in several Bachelor programs\n- Public Management and Administration \no Mathematics\n- Informatics and Communications:\no Calculus, Linear Algebra and Discrete Mathematics\n- Multimedia:\no Mathematics, Linear Algebra and Analytic Geometry,\n- Game Design\no Mathematics for Games, Game and Decision Theory\n• Supervision of final course projects (selection)\n\nORGANIZATIONAL ACTIVITY\n• Expert for AduLet Project- Advanced Use of Learning Technologies in Hi