INSERT INTO `activities` VALUES (5,'',8,8,'Pixel',20140101,20141231,'WP 1','The aim of the workpackage is to involve school teachers and students in a joint effort to share information about their experiences regarding the main obstacles that affect the performance of students studying scientific issues and the everyday solutions adopted and that demonstrated to be effective in answering to those barriers.\nEach partner should involve at least 5 schools, 10 scientific teachers and 200 students uploading the information on the project portal.\nEach partner should collect 50 teachers\\\' experiences and 100 students\\\' experiences in order to describe difficulties and successes in teaching and learning scientific subjects.','','Pixel, in cooperation with the project promoter, developed the following forms:\n- WP1.A - School Participation Form\n- WP1.B - School Participation Letter\n- WP1.C - Role of the School\n- WP1.C - Ruolo delle scuole\n- WP1.D - Teachers experience form\n- WP1.E - Students experience form\n- WP1.F - Methodological Report Guidelines\n\nThe forms have been presented during the kick off meeting and the partners are using them.\n\nPixel has promoted the Goerudio project in all the schools of Tuscany region.\nThe common forms have been translated in Italian in order to help the teachers and the school directors to become familiar with the project contents and aims.\nThe material has been sent via email and the schools have been contacted by telephone.\n\nPixel also contacted the Regional Branch of the Ministry of Education (USR Toscana). This institution appreciated the project idea and promoted it among all schools in Tuscany.\n\nA total number of 10 schools, 10 school directors, 18 teachers and 308 students have been involved in the project.\n\nPixel organised the first workshop with the teachers on 16 April 2014. 15 teachers participated in the workshop sharing ideas and teaching methodologies.\n\nA total number of 55 teachers\\\' experiences and 124 students\\\' experiences have been collected and uploaded on the project portal both in English and in Italian.','A total number of 10 schools, 10 school directors, 18 teachers and 308 students have been involved in the project.\n\nA total number of 55 teachers\\\' experiences and 124 students\\\' experiences have been collected and uploaded on the project portal both in English and in Italian.','The activities carried out exceeded the expectations.\nThe USR TOSCANA (Regional Branch of the Ministry of Education) had an important role for the dissemination and the exploitation of the project.'),(6,'',8,8,'Pixel',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','Pixel, in cooperation with the project promoter, developed the following forms:\n- WP2.A - Identification Form for Initiatives\n- WP2.B - Review Form for Initiatives\n\nThe forms have been presented during the kick off meeting and will be used by the partners.\n\nPixel identified a total number of 36 initiatives and the description is available in in English and in Italian on the project portal.\n\nPixel organised a workshop with the Italian teachers in order to present and assign them the initiatives.\n\nPixel has already started to upload the review of the initiatives and projects. Teachers are currently testing them with their students.','The forms are available on the project portal\nPixel has already identified 36 initiatives which has been assigned to the teachers for the review.','The activities have been carried out according to the project planning with good results.'),(9,'',8,8,'Pixel',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','Pixel, in cooperation with the project promoter, developed the following forms:\n- WP4.A - Seminar programme form\n- WP4.B - Seminar signature form\n- WP4.C - Seminar minutes form\n\nThe forms have been presented during the kick off meeting and will be used by the partners.','The forms are available on the project portal','The project activities have not been started yet and it is too early to provide an evaluation.'),(8,'',8,8,'Pixel',20140101,20141231,'WP 3','The aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an enquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','Pixel, in cooperation with the project promoter, developed the following forms:\n- WP3.A - Comment form for experiences\n- WP3.B - Comment form for initiatives\n- WP3.C - Virtual Meeting Participation Form\n- WP3.D - Virtual Meeting Contribution Form\n- WP3.E - Forum Post Form\n\nThe forms have been presented during the kick off meeting and are currently used by the partners.\n\nThe Italian teachers have already started commenting on the experiences of their colleagues from the other partner countries and a total number of 50 comments is available on the project portal.\n\nPixel took care of the organisation of the virtual meeting and participated in it with 3 teachers.','The forms are available on the project portal.\n\nItalian teachers posted 50 comments on their colleagues experiences.\n\nParticipation in the virtual meeting.','The activities have been carried out according to the project planning with good results.'),(10,'',8,8,'Pixel',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners.','','Pixel, in cooperation with he project promoter, defined the structure of the project portal and of the section dedicated to the project management.\n\nPixel coordinated the work of the technical partner and checked the functionality of the portal.\n\nPixel constantly updates the information on both the portal and the web site.\n\nPixel created the following guideline:\n\n- WP5A - Portal Text Translations','The project portal is available at: http://goerudio.pixel-online.org/.\nThe section dedicated to the project management is available at: http://goerudio.pixel-online.org/MNG-information.php.','The project portal and the section dedicated to the project management were available according to the time schedule and the partners are using them.'),(11,'',8,8,'Pixel',20140101,20141231,'WP 6','The objective of this Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.\n\nIn the framework of WP6 each partner has to:\n\n- Upload In progress Project Activities Report Forms on the project\\\'s website\n- Produce 1 Progress and 1 Final Project Financial Report\n\nIn addition to the tasks assigned to each partner, Pixel has to carry out the following activities:\n\n- Transnational Project\\\'s coordination in the management of the project activities (in cooperation with the project promoter)\n- Creation of management forms models\n- Transnational co-ordination and supervision\n- Production of all the material for the meetings\n- Creation of Meeting Folders\n- Organization and management of partners meetings\n- Production of forms to be used for tri-monthly activity reports\n- Production of guidelines for writing the Yearly activity reports\n- Collection of all partners\\\' activities reports and production of transnational activity report.\n\nAt national level Pixel is also in charge of the coordination of the schools.','','Pixel produced all the material for the kick off meeting. Pixel organized and managed, in cooperation with the promoter of the project, the kick off partners\\\' meeting.\n\nPixel organised in cooperation with the Polish partners the second partners\\\' meeting held in Warsaw on 7 - 8 June 2014.\n\nIn details for the meeting Pixel took care of the following activities:\n\n1. The venue of the partner meeting has been prepared\n2. An accommodation was given to all the partners attending the meeting\n3. Information was given about the meeting practicalities and the city by preparing documentation.\n4. The meeting folder was developed and the folder was then printed and distributed to the partners.\n5. The project presentation was created using MS PowerPoint and was introduced during the meeting.\n6. Inside the meeting folder was added a Calendar of Activities, an instrument for all partners to have a complete and resumed view over the activities of the project in all its length.\n7. After the meeting, in cooperation with the promoter of the project, detailed minutes were prepared about what has been said and decided. A full list of annexes was also produced, some updating the drafts presented during the meeting while others were started from scratch.\n8. The minutes and the annexes were then sent to the partners via email and uploaded on the web site.\n\nPixel took care of the transnational co-ordination and supervision of each activity to be carried by the partners, by creating a calendar of activities with established deadlines and mailing lists to manage each time period. Pixel produced and contributed to the production of forms to be used for the project activities and project management. For every activity Pixel sent the project partners the needed material, reminded the deadlines, answered the questions over any kind of issue, collected the produced material and sent it to technical partner.\n\nPixel also participated in the monitoring visit in Brussels which took place on 14 November 2014.','1. Organisation of kick off and second partners\\\' meeting\n2. Meeting Folders and Partners book\n3. Project presentations\n4. Calendar of Activities\n5. Calendar of Deadlines\n6. Partners\\\' role\n7. Forms to be used for the dissemination\n8. Form to be used for tri-monthly activity reports\n9. Guidelines for writing of Yearly activity reports\n10.Form to be used for tri-monthly dissemination report\n11.Guidelines for writing of Yearly dissemination report\n12.Guidelines for writing of Yearly exploitation report\n13.Organisation and coordination of the work of all partners, reminders of deadlines','The work carried out so far has been satisfactory.\nThe reasons that allow a positive evaluation are the results of the questionnaire for the evaluation of the meeting and of the project that was filled in by the partners after the meeting.\nThe analysis of questionnaire could measure the satisfaction of all partners for the results achieved during the project lifetime, during the meeting and for the informal meeting opportunities during the social events\nThe activities have been carried out by all the partners respecting the deadlines.'),(12,'',8,8,'Pixel',20140101,20141231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens\n\nIn the framwork of this WP Pixel has to carry out the following activities:\n\n- Creation of the forms to be used by the partnerhips\n- Creation of the Project brochure in English, to be translated by partners in National languages\n- Dissemination activities\n- Creation of the dissemination reports\n- Creation of the transnational dissemination report','','Pixel created the dissemination form and organized several dissemination events.\nPixel prepared the project’s brochure in English and translated the contents in Italian\nThe partners translated the brochure in their own languages.\n\nPixel presented the Goerudio project in the framework of the New Perspectives in Science Education International Conference held in Florence on 13 - 14 March 2014.\n\nPixel published an article about the Goerudio project in the conference proceedings of the New Perspectives in Science Education International Conference.\n\nA total number of 37 dissemination events have been carried out so far.','The project activities and outcomes are disseminated by all the partners.\n\nThe following forms have been created and are available on project website:\n\nWP7.A – Dissemination event form \nWP7.B - Guidelines for writing the Best Practice Dissemination Report\nWP7.C - Publication form\nWP7.D - Conference Participation Form','The project activities and outcomes are disseminated by all the partners according to the deadlines.'),(13,'',8,8,'Pixel',20140101,20141231,'WP 8','The aim of WP 8 is the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period. \n\nEach partner have to provide:\n\n10 links made to the project Portal from relevant web sites\n10 letters of participation in the project as associate partners \n10 Associate Partners form filled in \n1 progress and 1 final exploitation report','','Pixel created the templates and forms to be used by the partners for carrying out the exploitation activities.\nPixel is also in charge of the collection of the exploitation material produced by the partners.\nThe partners are currently involving the associated partners.\n\nPixel posted the information related to the Goerudio project on several web site related to education and more specific scientific education.\n\nPixel involved a total number of 5 associated partners and published the information of the Goerudio project on 8 web sites dealing with scientific education.','The following forms have been produced:\n\n- WP8.A - Exploitation links form\n- WP8.B - Associated Partner Letter\n- WP8.C - Associated Partner Form\n- WP8.D - Guidelines for Writing the Exploitation Report\n\n8 links to the Goerudio portal have been posted from educational web site.','The results of the exploitation activity are available on the project portal at:\n- links: http://goerudio.pixel-online.org/d-links.php\n- associated partners: http://goerudio.pixel-online.org/partnership-ass.php'),(14,'',8,8,'Pixel',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n\n- A total of 10 testimonials from the project end users\n- 1 progress and 1 final evaluation questionnaire filled in\n- 1 progress and 1 final national evaluation report','','The internal evaluation of the project’s activities is carried out according to an evaluation model developed by Pixel.\nAccording to the evaluation model adopted, for every single project stage, an ad hoc “Evaluation Questionnaire” has been created, to be filled in by the project’s partners as far as the management activities; information systems; meeting organization etc. are concerned.\n\nPixel produced the forms and the guidelines for carrying out the activity of the workpackage. \n\nPixel collected all partners’ evaluation questionnaires related to the first and second partners\\\' meeting.\n\nPixel elaborated the transnational evaluation report.','During the kick off meeting all partners have been asked to fill in a questionnaire in order to evaluate the organization and management of the meeting.\n\nThe following forms have been created:\n\n-WP9.A - Format for the collection of testimonials\n-WP9.B - Guidelines for writing the Progress and Final Partners’ Evaluation Report','The internal evaluation activity has been carried out according to the time schedule.'),(15,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 1','- To select and recruit schools\n- To involve schools, teachers and students in project activities\n\nThe target is to involve at least 5 schools, 10 scientific teachers and 200 students uploading the information on the project portal.\nThe target to collect 50 teachers\\\' experiences and 100 students\\\' experiences in order to describe difficulties and successes in teaching and learning scientific subjects.','','For the purpose of recruitment and implementattion forms were translated into Polish:\n- WP1.A - School Participation Form\n- WP1.C - Role of the School\n- WP1.D - Teachers experience form\n- WP1.E - Students experience form\n\n36,6 CC has promoted the Goerudio project in the schools in Lodzkie region. E-mail campaign and face to face meetings with schools:\n5 Primary Schools \n35 Lower Secondary Schools\n25 Upper Secondary Schools\n\nThe materials have been sent via email and the schools have been contacted by telephone. Project brochures were handed-in to the teachers and headmasters.','36,6 CC involved in the project: 5 schools, 10 teachers and around 200 students. Learning experience of teachers and students were collected. In total we collected 50 teachers\\\' experience from the following subjects (maths, ICT, technology, biology, chemistry, science). \n\nCollection of teachers\\\' and students experience report in Poland was drafted to present the main findings from the collection of the experience.\n\nAfter completion of experience teachers started to comment on the experience of their colleagues and connect through the platform (WP3)','Satisfactory. Outcomes achieved'),(16,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','31 initiatives from the field of science have been identified. Most of the initiatives (25 projects) are financed from European Social Fund and are innovative educational projects implemented in Poland. We also identified five initiatives implemented within Lifelong Learning Programme. Thanks to the process of identification contacts were established to relevant stakeholders in Poland. Some of the organizations became associated partners of Goerudio. \n\nTeachers participating in the projects (that presented the experience) were given access details to Goerudio portal and instructed how to submit the comments.\nFrom the start of the schoolyear 36,6 CC, teachers and students started to review the initiatives. \n\nFor better understanding workshops for teachers were organized on the 19th September in Lodz. The teachers that were not able to attend were contacted by phones.\n\nUntil early December 2014 the initiatives were reviewed by 36,6 CC as partner, teachers and students. Most of the reviews were in Polish. They were gradually translated and uploaded on portal.','31 European and national initiatives were identified so far. Projects described in Polish and English.\n\n30 reviews by Partner, teachers and students (each initiative was reviewed)','Saisfactory,results achieved.'),(17,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 1','The aim of the WP is to involve school teachers and students in a joint effort to share information about their experiences regarding the main obstacles that affect the performance of students studying scientific issues and the everyday solutions adopted and that demonstrated to be effective in answering to those barriers.\nEach partner should involve at least 5 schools, 10 scientific teachers and 200 students uploading the information on the project portal.\nEach partner should collect 50 teachers\\\' experiences and 100 students\\\' experiences in order to describe difficulties and successes in teaching and learning scientific subjects','','Under this WP ZAT has conducted the following activities:\n- translated all management forms for the implementation of the activities under this WP in order to work with the schools in the national language;\n- translated information about the project, its aims, expected results in Bulgarian too;\n- contacted various Bulgarian schools with information about the project for the purposes of involving them in the project activities. The contacts were made by the project manager and the project coordinator, appointed from ZAT. The contacts were made in several ways: conducting face to face meetings with headmasters and teachers; publishing information about the project and invitation for the schools to participate in the project in targeted online directories and bulletins; sending informative mailings to schools.\n- translated the forms of describing teachers\\\' and students\\\' experiences in Bulgarian and in English and will upload them on the project portal by 8 July.','Under WP 1 so far ZAT has achieved the following results:\n- 5 schools involved in the project;\n- 11 teachers involved;\n- 226 students involved;','So far the work is evaluated as satisfactory. Despite the little delay of getting the documents filled in, from some of the schools (due to leave of the headmaster or vacation) now everything is uploaded in the project portal as envisaged by the partnership. Teachers and students are quite interested in the project idea and are eager to start working. We had a delay also in collecting teachers\\\' and students\\\' experiences due to various reasons, but after all all necessary documents are collected and will be uploaded on the project portal.'),(18,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','Under this WP ZAT has conducted the following activities:\n- searched for project initiatives over the internet;\n- research of project compendiums from  EU funded different programmes;\n- contact with project promoters and coordinators;\n- work with teachers and students for the review of initiatives.','Under this WP ZAT has achieved the following results so far:\n\n- 30 initiatives have been identified and forms of description are filled in and uploaded in the project portal.','The work under this WP is so far evaluated as satisfactory.'),(19,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 3','The aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity to discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an inquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','In the framework of this activity ZAT has conducted the following activities:\n- organized meetings with the headmasters and teachers to present the portal and to explain what is behind the idea of \\\"discuss and share knowledge and experiences\\\" among the community of teachers involved;\n- ZAT has prepared presentation of the teachers\\\' experiences so far and translated some of the foreign experiences, Bulgarian teachers found most interesting in order to ease the understanding and the process of receiving feedback;\n- together with the schools, plan future workshops with teachers and students to discuss the work under the project and gather comments and feedback for the activities carried out;\n- together with one teacher a representative of ZAT took part in the first virtual meeting organized under the project.','- translated 30 teachers experiences in Bulgarian and sent to Bulgarian teachers for comments;\n- 30 teachers\\\' comments posted on the project portal;\n-participation in the first virtual meeting organized under the project.','The work will be evaluated at a later stage.'),(20,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars, during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','No work started yet under this WP.','No outcomes yet available.','Evaluation will be done at a later stage.'),(22,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners.','','Under this WP ZAT has conducted the following activities:\n- translated the information that was currently available in the different sections of the portal;\n- uploaded school participation forms on the portal;\n- uploaded information about the teachers, involved in the project;\n- uploaded teachers\\\' and students\\\' experiences forms;\n- uploaded project initiatives forms;\n- uploaded comments on teachers\\\' experiences;\n- uploaded partner, teacher and student reviews on relevant initiatives.','So far the following outcomes are achieved:\n- portal, available in Bulgarian;\n- uploaded school participation forms for all the schools, involved in the project;\n- uploaded teachers\\\' and students\\\' forms;\n- uploaded 50 teachers\\\' and 200 students\\\' experiences forms;\n- uploaded 30 project initiatives forms with the review from the partner teacher and student;\n- uploaded 30 comments from Bulgarian teachers on experiences of their colleagues from the partner countries.','So far the work under this WP is considered satisfactory - done with the necessary quality in the set deadlines.'),(23,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 6','The objective of this Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.\nIn the framework of WP6 each partner has to:\n- Upload  Project Activities Report Forms in progress on the project\\\'s website;\n- Produce 1 Progress and 1 Final Project Financial Report.','','Under WP 5 ZAT has conducted the following activities:\n- participated in the first partnership meeting in Florence, Italy; \n- developed the necessary presentations for the first partnership meeting;\n- worked on administrative and contractual issues, with regard to signing the contract with the leading organization on behalf of ZAT;\n- developed the necessary presentation for the second partnership meeting and participated in the meeting;\n- filled in progress activity reports for the first 12 months of the project implementation;\n- dissemination, evaluation and financial progress are prepared and sent to the project promoter;','The following outcomes were reached:\n- a representative of ZAT participated in the two project partnership meetings;\n- contract signed;\n- activity reports filled in for the first 12 months of the project.','So far the work under this WP is considered satisfactory. No deviation from deadlines. Management is an ongoing process for ZAT and quality assurance is provided for each activity.'),(24,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens.','','Under this WP ZAT has conducted the following activities:\n- 38 dissemination events:  11 international meetings; 13 national meetings; 3 training seminars; 2 newsletters; 2 articles on websites; 2 informative mailings; 5 attendances of international and national conferences and events;\n- uploading information about the dissemination events on the portal.','The outcomes under this WP are as follows:\n- 38 various dissemination events conducted;\n- 38 dissemination report forms uploaded on the portal as of 31 December 2014.','So far the work under this workpackage is considered very satisfactory.'),(25,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 8','The aim of WP 8 is the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period.\n\nEach partner have to provide:\n10 links made to the project Portal from relevant web sites;\n10 letters of participation in the project as associate partners;\n10 Associate Partners form filled in;\n1 progress and 1 final exploitation report.','','Under this WP ZAT has started implementing particular activities in the mid of 2014. ZAT made contacts with organizations that are interested in the project ideas and results.','So far ZAT managed to attract 5 associated partners of the project. The associated partners are NGOs, training institutions and one web directory focused on education. 5 links to the project portal were published in other websites.','So far the work under this WP is considered satisfactory.'),(26,'',63,44,'Zinev Art Technologies',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n- A total of 10 testimonials from the project end users.\n- 1 progress and 1 final evaluation questionnaire filled in.\n- 1 progress and 1 final national evaluation report.','','Under this WP ZAT has conducted the following activities:\n- participated in the evaluation process during the partnership meetings;\n- set internal quality assurance procedures for the work, implemented under the project.','So far the results achieved under this WP are the following:\n- evaluation questionnaires for the partnership meetings filled in;\n- internal quality assurance procedures set for all people, working under the project in ZAT;\n-interim evaluation report written and submitted to the project promoter.','So far the work is considered satisfactory.'),(27,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 3','- Creating learning community of scientific teachers and students in Poland\n- Integration of schools and exchange of best practice among beneficiaries\nThe aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an enquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','While recruitment process of schools they were informed about their role and involvement in creating learning community. The focus on the WP3 activities will be put on later stage.\n\nTeachers were given access details to the portal so they can comment on the other teachers experience and on the initiatives identified by the Project partners. Teachers contated by email. Also encouraged to comment and contribute by telephones. Some attended \n\n30 comments on teachers\\\' experience collected and posted on th eportal. Some of the teachers declared they are willing to take adventage of others experience (e.g. lesson plans/ lesson ideas)','Integration of five Polish schools. Involvement of 10 teachers and more than 200 Polish students\n\nCollection of more than 30 comments by teachers on other teachers\\\' experience in teaching science subjects.','Satisfactory. Teachers started to use the portal and online communication. Comments were submitted to other teachers experience.'),(28,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars, during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','During recruitment process, collection of experience and workshops teachers were informed about the actions within WP4 that will take place in next school year 2014/2015.\nAssociated partners and organizations contacted during the process of identification of relevant initiatives will be invited to take part in th eworkshops.','No outcomes produced so far','Satisfactory'),(29,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners.','','36,6 CC translated the related content and uploaded relevant information on website:\n- Translations of contents into Polish\n- Uploading participating schools and teachers\n- Updating dissemination and reporting tables\n\nTranslations uploaded on regular basis if required.','- Website translations into PL\n- Schools and teachers\n- Reporting tables\n- 100 students and 50 teachers experience in science education from Poland\n- teachers comments\n- 30 relevant scientific initiatives uploaded on portal\n- 30 reviews of initiatives by partner, teachers and students from Poland','Satisfactory, work in constant progress'),(30,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 6','The objective of this Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.','','36,6 CC undertakes activities under supervision of coordinator. \n36,6 CC coordinates project related activities in Poland.','Production of work progress tables\nMeetings of the management team on national level to control the progress \nRegular contacts to teachers and schools\nParticipation in Partners Meeting in Florence\nOrganization of Partners Meeting in Poland\nFinancial and Work-Progress management\nFinancial documentation, recording the expenditures, timesheets to document staff involvement\nProduction of Interim Report','Satisfactory'),(31,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens.','','36,6 undertaken series of actions to promote the project to target groups and Goerudio portal:\n- website: information published at 36,6 CC website (www.36and6.pl) - basic information and link to project portal\n- Social media: information about project at Facebook profile of 36,6 CC \n- Intenational Meetings: dissemination to relevant stakeholdrs from European organizations during partners meetings of SHAREIT in Zurich, Switzerland (13-14.01.14), AMORES Athens, Greece (6-7.03.2014), ECOLAV, Warsaw, Poland (13-14.03.2014), EVAT, Venice, Italy (27-28.03.14), Jobs on Trial, Florence, Italy (28-29.04.2014), CHEMICAL MOVETECH, Bilbao, Spain (29-30.05.14); ShareIT in Glasgow, UK (2-3.06.2014); ECOLAV, Final Conference in Zagreb, Croatia, (12-13.06.2014) EVAT, Warsaw, Poland (26-27-06.2014); AMORES, Silkeborg, Denmark (6-7.10.2014); ShareIT, Warsaw, Poland (3-4.11.2014); CHEMICAL MOVETECH, Kaunas, Lithuania, (19.11.2014); C-95 Challenge, Pesaro, Italy, (15-17.12.2014) \n- National conferences and seminars: Erasmus + Academy, Warsaw (25.02.14) - official inauguration of Erasmus + in Poland; Inauguration of ERASMUS+ projects in Warsaw, meetings for beneficiaries of the proejcts (08.09.2014); Meeting with students of University of Computer Science and Skills (28.10.2014); Horizon 2020 - workshops organized by National Contact Point in Warsaw (18.12.2014)\n- Project Brochure, translated into Polish, promotional material handed in during meetings\n- 36,6 CC Booklet, Presentation of all ongoing projects implemented by our institution. Printed document available in Polish and English. Distributed during trainings, seminars, workshops and conferences \n- Posts at Goerudio Facebook profile','- Polish version of Goerudio brochure\n- Events uploaded at Goerudio portal on regular basis','Progress satisfactory. Several channels used to disseminate.'),(32,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 8','The aim of WP 8 is the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period.\n\nEach partner have to provide:\n10 links made to the project Portal from relevant web sites;\n10 letters of participation in the project as associate partners;\n10 Associate Partners form filled in;\n1 progress and 1 final exploitation report.','','Activities were undertaken to spread the information in the internet and made links to the portal. \n5 Associated partners were selected. Letters were collected','7 exploitation links on external websites. \n5 letters from associated partners.\n5 partners form filled in.\n1 progress explotation report.','Satisfactory. Constant progress.'),(33,'',65,42,'36,6 Competence Centre',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n- A total of 10 testimonials from the project end users.\n- 1 progress and 1 final evaluation questionnaire filled in.\n- 1 progress and 1 final national evaluation report.','','- Participation in Partners Meeting \n- Establishing internal documents to monitor the quality and progress of project\n- Collecting testimonials of end users','- Evaluation questionnaires during Partners meetings\n- Interim Evaluation Report PL\n- Collection of 5 testimonials','Satisfactory, work in progress'),(35,'',62,45,'Riga State Technical School',20140101,20141231,'WP 6','The objective of Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.','','1. Preparation of partnership contracts in cooperation with PIXEL.\n2. Preparation of all information for first kick off partner\\\'s meeting.\n3. Participation in kick off partner\\\'s meeting.\n4. Coordination of project activities in Latvia.\n5. Working on financial issues, communication with Ministry of Education and the Ministry of Finance in order to open project account.\n6. Preparation of information for partners meeting in Warshaw.\n7. Organisation of the seminars and training for teachers.\n8. Organisations of informative seminars for interests in Goerudio project.\n9. Managing information for Virtual meeding and Skype meeting.\n10. Managing work of trainers on Goerudio project.','1. Partnership contracts were prepared and singed with all partners during kick off meeting.\n2. RSTS as project promoter were presented during kick off meeting as well as schools involved in the project.\n3. On the national level there were organized seminars for teachers involved in the project.\n4. Solved financial issues, opened project account and made first payment for all partners.\n5. Project coordinators\\\' and trainers\\\' participation on the second partners meetind.\n6. Held 5 training seminars for teachers in Riga.\n7. Held 2 National meetings.\n8. Participation in Virtual meeting and Skype meeting.\n9. Produced reports: Coolection of Students\\\'and Teachers\\\' experiences in Latvija, Dissemination report, Evaluation report.','The work carried out has been satisfactory.'),(36,'',62,45,'Riga State Technical School',20140101,20141231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens','','1. Translation of project brochure in national Language.\n2. Inserted a link of Goerudio project on website of RSTS (http://www.rvt.lv/index.php/par-mums).\n3. Created an article about project and published on portal www.e-skola.lv (http://www.e-skola.lv/public/58976.html) and on RSTS website (http://www.rvt.lv/index.php/sabiedriba/projekti/899-goerudio-projekts)\n4. Created an article about first teachers meeting and published on RSTS website www.rvt.lv (http://www.rvt.lv/index.php/jaunumu-lapa/jaunumu-arhivs/933-goerudio-projekta-dalibnieku-pirma-sanaksme-rvt)\n5. Article http://izglitibasfonds.lv/lv/jaunumi/279-eiropas-projekts\n6. Article http://www.rvt.lv/macibas/metodiskie-pasakumi/1099-goerudio-projekts-asociativo-telu-modelu-izmantosana-izpratnes-veidosanai-dabaszinatnes\n7. Article on websyte http://www.e-skola.lv/public/63041.html\n8. Link to the project website https://www.facebook.com/pikc.rvt?fref=ts\n9. Link to the project website http://izglitibasfonds.lv/lv/jaunumi/279-eiropas-projekts\n10. Link to the project website http://www.rag.lv/noderigas-saites','1. Translated and printed project brochure in national language.\n2. Published articles of project on social networks.\n3. Published article in the Magazine.','So far the work has been considered as satisfactory'),(37,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 1','The aim of the workpackage is to involve school teachers and students in a joint effort to share information about their experiences regarding the main obstacles that affect the performance of students studying scientific issues and the everyday solutions adopted and that demonstrated to be effective in answering to those barriers.\n\nPlanned activities for this period:\n\nAction 1 – Creation of school network\n-	Setting the school network (at least 5 schools, 10 scientific teachers, 200 students)\n-	Fill in the WP1.A - School Participation Form for each school involved  - providing main information that will be uploaded onto the project Portal\n-	Signing in the WP1.B - School Participation Letter with each school\n\nAction 2 – Teacher and students Experiences\n-	Presentation and discussions with the teachers on this activity role and impact','','Action 1 – Creation of school network\n-	Translation of the WP1.C - Role of the School and of the WP1.A, WP1.B, into Romanian \n-	Establishing contacts with the school principals and scientific teachers\n-	Presentation of the project, aims, activities, educational materials from the previous project, discussions about the teachers/students role.\n-	Filling in the WP1.A, WP1.B forms\n\nDetailed activities held:\n-	Discussions with the team members on the target groups to be involved in the project, setting a system of contacting potential schools and teachers.\n-	Collecting information on the WP 1 responsibilities on Action 1 – Creation of school network, discussing with the team members and setting the steps in creation of school network in Romania. \n-	Checking the content of the School involvement forms, and discussions with the team members that for the schools contact we should translate the form into Romanian and that we should prepare an additional document (agreement between EuroEd and schools) requested by each school.\n-	Preparing the package for the schools and making contacts (by telephone, emails and direct meetings) with school principals ot teachers, presenting and discussing about the project idea and activities and inviting them to be part of the research and development of resources teams.\n-	Sending invitations to the potential schools principals and teachers presenting the project and inviting them to join the project.\n-	Monitoring the process of involving teachers in the project and the process of collecting all the official forms for their agreement.\n-	Permanent collaboration with the schools, approving the agreements and discussing with the school principals and teachers on their roles and activities in which will be involved.\n-	Archiving the documents sent by the schools, verifying the missing information, reporting them to the contact person and preparing information to be uploaded on the project website.\n\nAction 2 – Teacher and students Experiences\n-	Presentation and discussions with the teachers on this activity role and impact, setting a basic process of involving students in collecting their experiences.\n- Translation of the Annex 09 - WP1.D - Teachers experience form &amp; Annex 10 - WP1.E - Students experience form, into Romanian \n- Announcements to the teachers involved presenting the Action 2 of the project, including the presentation of the aims of the experiences sharing, discussions on the type of experiences to be presented and introduction to the forms to be filled in.\n- Participation in meetings with the teachers, working and supporting them to fill in the forms and discussions among the teachers on their experiences. \n- Participation in activities with the students, presenting the project and working with them on sharing their experiences. \n- Email support to the teachers and students in filling in the forms.\n- Collecting the forms from the teachers (electronic and on paper versions)\n- Working on checking the experiences received, especially those from the students – proper and adequate content\n- Translation on the content – from RO to EN and those received in EN were translated also in RO\n- Working on editing the content, uploading the experiences on the portal','Action 1:\n-School network – 8 schools involved\n\nPrimary Schools: EuroEd Primary School, Ion Creanga Primary School, Vasile Alecsandri Primary School\n\nLower Secondary School: Nicolae Iorga Lower Secondary School, Ion Creanga Lower Secondary School, Constantin Păunescu School for Students with Special Needs, \n\nUpper Secondary School: Nicolina Technical Highschool, Cuza Voda National College, Dimitrie Cantemir Theoretical High School, Vasile Alecsandri Upper Secondary School.    \n\n-	Geographical areas: 2 cities - Iasi and Husi, 2 counties – Iasi and Vaslui\n-	Teachers involved – 35 \n\nPrimary school teachers: 4 (Math, Nature studies, English - CLIL)\n\nLower secondary school teachers: 13 (Physics, Chemistry, Biology, Math, Informatics, English) + 1 school counsellor\n\nUpper secondary school teachers: 18 (Technical disciplines, Geography, Physics, Chemistry, Biology, Math, Social Sciences – Logic, History, English - CLIL)\n\n-	Students involved – 363 \n\nPrimary school: 86\n\nLower secondary school: 105\n\nUpper secondary school: 172\n\n\nAction 2:\nResults – obtained in Romania\n56 teachers experiences \n116 students experiences','The activities under WP1 are carried out smoothly and in line with the milestone foreseen by the project workplan.\nThe forms have been updated on the web site'),(38,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.\n\nPlanned activities:\nAction 1 – Identification of the projects\nAction 2 – Review of projects','','To support the implementation of this WP the following activities has been caried out:\n\n- Participation in the internal meeting with the focus on the Goerudio project, discussing with the team the progress of implementation of the activities on the collaboration with the schools and teachers and planning the WP2 Action 1_Identification of the projects. \n- Support on implementation activities, preparing the process of contacting teachers in providing information on the science project initiatives developed. \n- Contacting teachers in providing information on the science project initiatives developed. Creation of emails with the aim of this WP and invitation for the respondents to provide information related to their projects on science.\n- Research on European science projects. \n- Research on the project Compendia, the database ADAM or among National projects to identify project initiatives with references to the aim of the Goerudio project.\n- Working on filling in the WP2.A - Identification Form for Initiatives, with the information collected on the research activity. \n- Research activities, discutions with projects coordinators, collecting information, processing information and filling in forms under WP2 Action 1_Identification of the projects. \n- Maintain the collaboration with the team members, planning the progress of the project, discussing on the problems encountered during the implementation, finding solutions and setting the responsabilities of each member and tasks to be done.\n- Updates on the website with the initiatives collected.\n- Translation of the initiatives collected from EN to RO or RO to EN.','- WP2.A - Identification Form for Initiatives / Projects Form in Romanian\n- Announcements on emails and posts on Facebook\n\nList of initaitives:\n1.	Archi - Let’s Soft IT!\n2.	Arguing for multilingual motivation in web 2.0\n3.	Computerised laboratory in science and technology teaching - ComLab-1 and ComLab-2\n4.	E-training microsystems technologies - mSysTech\n5.	Educational robotics for students with learning disabilities\n6.	ESTABLISH (European science and technology in action building links with industry, schools and home)\n7.	EuroGIS-GPS: Testing a competency framework for biodiversity data collection\n8.	European researchers\\\' night\n9.	GeoCapabilities 2: Teachers as curriculum leaders\n10.	Hands-on approach to analytical chemistry for vocational schools II\n11.	Implementation of international guidelines for welded structural designer training\n12.	Ins and outs of the magic Möbius strip\n13.	Inspiring new scientists through investigations, challenge and teamwork\n14.	Let’s explore, discover and make friends with science\n15.	Maths and science for better understanding the world we live in\n16.	Mechatronics in energy saving applications\n17.	MeRLab - Innovative remote laboratory in the E-training of mechatronics\n18.	Mobile E-Novative Use of E- learning Technologies (MENUET)\n19.	No other world CPR\n20.	Preparing science educators for everyday science\n21.	Robotics and Automation Careers in Engineering – RACE\n22.	Science investigations\n23.	Science: the great escape\n24.	Scintillating science - learning through discovery\n25.	SEED – Science by Experiments through European Dialog\n26.	The 21 st Century Hazards\n27.	Together again - developing links between schools and industry through science and technology\n28.	Training teachers to use mobile (hand held) technologies within mainstream school education\n29.	Unlocking the Universe\n30.	Zambia schools project',''),(39,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 3','The aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an enquiry based learning approach so to enhance pupils autonomy in managing their learning process.\n\nPlanned activities:\nAction 1 – Transnational discussion\nAction 2 – Peer to peer reviews\nAction 3 – Exploitation','','At this stage of the project the learning community has been created by the involved target groups in the school network.\n\nAlso there were discussions to plan the Romanian team participation in the transnational discussions - scheduling the data, setting the roles.\n\nTeachers were involved in preparing the content for the first transnational virtual meeting - Presentation of the Comments on Teachers’ Experiences:\n- extracting from the website the comments of the Romanian teachers\n- discussions on the comments\n- extracting issues and solutions raised by the teachers\n\nPreparation for and participation in the first virtual meeting on 27.11.2014','- List with extracts of the comments offered by the Romanian teachers\n- List of participants in the first virtual meeting\n- Interventions for the first virtual meeting',''),(40,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars during which they will present the results of the Goerudio project.\n\nPlanned activity: \nOrganization of national seminars','','This WP is still in progress. \n\nThe Romanian team organized a first workshop on Science Education in the framework of the European Project Goerudio in Romania, on 15th of October 2014.\n\nParticipants invited: teachers, parents and students. \n\nThe aim of the workshop was to discuss about the lack of motivation of students in studying scientific related topics, and the related insufficient results that they achieve during their school curricula and about the lack of capacity of teachers and trainers in updating their teaching methods in order to promote the interest of their students toward scientific issues.','1 Seminar\npresentations and dissemination materials on the Goerudio project\nAgenda\nList of participants\nPhotos',''),(41,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 5','The aim of the Workpackage is to create a project Website to be used within the partnership as a centre of reference for the circulation of the information and of the Goerudio Portal that will collect and make accessible all the project results','','- Offering feedback for development of the website and platform\n- Visualization of the project website, familiarization with the sections and content.\n- Translation of the content into Romanian\n- Permanent upload of the reporting information and materials (Dissemination and Work in progress sections)\n- All the schools have been uploaded on the portal\n- All the experiences have been uploaded on the portal\n- 30 the initiatives collected were uploaded on the portal\n- support for the teachers in posting comments\n- posts on the comments and reviews on the experiences and initiatives','- Translation of the main section of the website and portal into Romanian\n- 8 schools uploaded\n- 56 teachers experiences uploaded\n- 116 students experiences uploaded\n- 30 initiatives uploaded\n- 30 teachers’ comments on the collected experiences\n- 30 reviews in cooperation with teachers and students of the 30 project initiatives identified','The activities under WP5 are carried out smoothly and in line with the milestone foreseen by the project workplan.'),(42,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 6','The aim of the Management Work package is to fully and effectively involve each project partners in the project activities in order to achieving the project’s expected results.\nPartners role\n-	Participation to steering committees\n-	Coordination and management of project activities at National level\n-	Filling in, each three months, of own activity report forms onto the project website \n-	Preparation of own financial reports','','-	Review of the project application form and the documents sent by the coordinator, checking the objectives and roles of the Romanian team within the each work package.\n-	Checking the content of the previous Goerudio project, tasks and type of products created within it.\n-	Participation in the internal meeting with the view to discuss and plan the project activities to be developed, verifying the content of the application and the tasks and results needed under each WP, setting responsibilities for each member of EuroEd team and scheduling the further steps.\n-	Working on the project application, creating the project Gant chart, understanding the workflow and the implementation steps.\n-	Research on the previous Goerudio project implemented, verifying the process, objectives, activities developed, checking the results, visualization of the educational products. Extracting examples of products for the teachers motivation to get involved in the project.\n-	Verifying the documents and preparing for the partners meeting, discussions with the other team member participant about the tasks under each wp, about the implementation of the trainings, budget and results to be obtained.\n-	Participation in the first international partners meeting in Florence, Italy\n-	Checking the management files (meeting minutes, caledars of activities and deadlines) sent by the coordinator with the view of the decisions taken during the partrners meeting.\n-	Revison of the document Authorization to use the data and Partners info, with regards of the EuroEd involvement.\n-	Checking the project workflow, the documents with tasks and deadlines, planning the activities and working for the reporting process, maintaining the collaboration with the partners.\n-	Verifying the project budget on each costs category, making plans according to the tasks to be covered by EuroEd within the project.\n-	Checking the content of the Contract signed with the coordinator and the Annexes 1 and 2, filling in with requested information and verifying the correctness of the EuroEd data.\n-	Managing communication with the international project team\n-	Reviewing financial documents from the internal reporting at the level of the national project team.','-	Activity Reports – constantly updated\n-	Materials (e.g. ppt. presentations) prepared for participation in the international project meetings\n-	Technical and financial reports and documentation\n-	Internal project meeting minutes\n-	Staff Time cards\n-	Financial documentation','The activities under WP6 are carried out smoothly and in line with the milestone foreseen by the project workplan.'),(43,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 7','Each partner will have to carry out at least 2 dissemination actions during each month of the project. These actions will be registered onto the project Internet Website in order to share among the partnership the most successful initiatives. \n\nPartners role\n-	Carrying out of dissemination activities (at least 2 each month)\n-	Creation and upload onto the website of the dissemination forms describing each activity','','-	Involvement in dissemination activities with the aims to raise the awareness to teachers on the aims of the project to create innovative and attractive materials for teaching scientific disciplines.\n-	Creation of the Goerudio project page on the EuroEd institutional website, including project presentation and link to the official websites.\n-	Working on preparing and making a registration for the Future of Education_Pixel_12-13.06.2014 Conference, elaborating the abstract and the title of the article which will present the Goerudio project.\n-	Elaboration of the article \\\"Goerudio: an innovative solution to enhance motivation to teach and learn science\\\", for the Conf_Future of Education_Pixel_12-13.06.2014','- Dissemination of the project on the institutional web site and on the Facebook Page - posts with updates on the Goerudio activities\n- Permanent posts on the project Facebook Page - updates on the project activities, and useful educational resources\n- Participation in over 27 dissemination events (national and international)\n- Distribution of flyers and brochures on the project \n\n- Participation in over 6 national and international conferences with formal and direct promotion of the project\n1. Conf_Future of Education_Pixel_12-13.06.2014\n2. TakeCare_Workshop_29.03.2014\n3. Conf_EAQUALS_25-26.04.2014, Budapest, HU\n4. International Scientific Congress - Life Sciences, a challenge for the future, 23-25.10.2014, RO\n5. The 7th edition of the ICT for Language Learning Conference, 13-14.11.2014, IT\n6. Network Intelligence The 1st Conference of the NORD events (Networking, Observing, Rethinking &amp; Disrupt) ”SEA – Practical application of science”,28-29.11.2014, RO\n\n- 3 articles published:\n1. Goerudio: an innovative solution to enhance motivation to teach and learn science\n2. Goerudio Method And Tool To Achieve Necessary Level Of Comprehension\n3. Stimulating students’ motivation to learn science',''),(44,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 8','The aim of the exploitation activity is to support the project sustainability. \nEach partner will have to involve in the project at least 5 associate partners (who will join the project with letters of support) and will have to activate at least 10  links from relevant web sites to the Chemistry Is All Around Network Portal.\n\nPartners role\n-	Contacts with public and private key decision makers of the National school system for Portal recognition\n-	Research of at least 5 Exchange links\n-	Research of 6 Associated partners\n-	Creation of own Exploitation report','','- EuroEd team was involved in creating PROJECT PORTAL LINKs\n- EuroEd was involved in sending invitations for various potential associated partners to join the project\n- Up to now EuroED set up 8 connections/links between the project and various scientific communities, educational websites, other projects related, etc.\n- WP8.A – PROJECT PORTAL LINK FORM has been filled in and sent to the coordinator\n- EuroEd participated in meetings for promoting the Goerudio project and inviting potential interested associated partners to join the project and support its activities.\n- Sending and offering support for filling in the WP8.B - Associated Partner Letter and of the WP8.C - Associated Partner Form\n- Uploading the information on the associated partners on the project portal and preparing the package with all the forms to be sent to the coordinator. \n- EuroEd team collected all the information related to the exploitation activities and filled in the WP8.D - Guidelines for Writing the Exploitation Report','- 8 links created up to now:\n 1. Link with EuroEd institutional website\n 2. Link with EuroEd institutional Facebook page\n 3. Link with the Future of Education International Conference website\n 4. Link with the Didactic.ro Community\n 5. Link with the Glottodrama project website\n 6. Link with the Scientix Facebook Community\n 7. Link with the Fiesta project website\n 8. Link with the Association of Life Science Teachers Facebook Community\n\n- 6 associated partners (6 WP8.B - Associated Partner Letter and 6 WP8.C - Associated Partner Form)\n 1. Alecart Association\n 2. Enable Foundation Romania\n 3. EuroEd Parents Association\n 4. Faculty of Veterinary Medicine\n 5. The Romanian Association for Quality Language Services QUEST Romania\n 6. University of Medicine and Pharmacy \\\"Grigore T. Popa\\\" Iaşi\n\n- WP8.D - Guidelines for Writing the Exploitation Report','The activities under WP5 are carried out smoothly and in line with the milestone foreseen by the project workplan.'),(45,'',66,46,'Fundația EuroEd',20140101,20141231,'WP 9','The evaluation process will  include both an internal and an external evaluation.\nThe internal evaluation of the project’s activities will be carried out by each of the project partners who will produce, once every 12 months, a National Evaluation Report. The report will be written created according to a common format that will be provided by Pixel.\nThe external evaluation will be carried out by an expert in the field of educational and training policies. \n\nPartners role\n-	Discuss and adopt the proposed evaluation strategy\n-	Carry out the evaluation tasks contained in the jointly approved Evaluation Guidelines\n-	Distribute evaluation questionnaires to the target groups at national level\n-	Collect filled in evaluation questionnaires and production of yearly national evaluation report','','Evaluation done during the project meetings. During each project meeting, EuroEd staff members participants filled in the evaluation questionnaire, offering information related to the evaluation of the meetings activities.\n\nEuroEd contacted teachers, students, professionals working in education and staff members, providing them information on the project, presenting the project portal and inviting them to provide feedback related to the points of strength of the methods and results available on the project portal\n(http://goerudio.pixel-online.org/index.php).\nUp to now 5 testimonials have been filled in.\n\nEuroEd collected information and worked for filling in the WP9.B - Guidelines for Writing the Evaluation Report form. \n\nEvaluation preparation for the interim report.','- 5 WP9.A - Testimonials forms filled in \n- WP9.B - Guidelines for Writing the Evaluation Report form','The activities under WP5 are carried out smoothly and in line with the milestone foreseen by the project workplan.'),(46,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 6','The objective of this Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.\nIn the framework of WP6 each partner has to:\n- Upload Project Activities Report Forms in progress on the project\\\'s website;\n- Produce 1 Progress and 1 Final Project Financial Report.','','Under WP 5 TRANSFER Slovensko has conducted the following activities:\n- participated in the first partnership meeting in Florence, Italy; \n- developed the necessary presentations for the first partnership meeting;\n- worked on administrative and contractual issues, with regard to signing the contract with the leading organization \n- filled in progress activity reports for the first 3 months of the project implementation\n- developed the necessary presentations for the second partnership meeting;\n- filled in progress activity reports for the first 9 months of the project implementation.\n\n- participated in the seconf partnership meeting in Warshav - Poland \n- developed the necessary presentations for the second partnership meeting;\n- worked on administrative and contractual issues, with regard to signing the contract with the leading organization \n- filled in progress activity reports for the first 6 months of the project implementation\n- developed the necessary presentations for the second partnership meeting;\n- filled in progress activity reports for the first 9 months of the project implementation.\n- preparing Interim financial report','The following outcomes were reached:\n- representative of TRANSFER Slovensko Juraj Dubrava and Vlasta Dubravova participated in the first meeting in Florence and got acquainted with the partnership;\n- contract signed;\n- activity reports filled in for the first 9 months of the project.\n\n participated in the seconf partnership meeting in Warshav - Poland \n- developed the necessary presentations for the second partnership meeting;\n- worked on administrative and contractual issues, with regard to signing the contract with the leading organization \n- filled in progress activity reports for the first 6 months of the project implementation\n- developed the necessary presentations for the second partnership meeting;\n- filled in progress activity reports for the first 9 months of the project implementation.\n- preparing Interim financial report','So far the work under this WP is considered satisfactory. No deviation from deadlines. Management is an ongoing process  and quality assurance is provided for each activity.'),(47,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 1','- To select and recruit schools\n- To involve schools, teachers and students in project activities\n\nThe target is to involve at least 5 schools, 10 scientific teachers and 200 students uploading the information on the project portal.\nThe target to collect 50 teachers\\\' experiences and 100 students\\\' experiences in order to describe difficulties and successes in teaching and learning scientific subjects.\n\nAction 1 – Creation of school network\n- Setting the school network (at least 5 schools, 10 scientific teachers, 200 students)\n- Fill in the WP1.A - School Participation Form for each school involved - providing main information that will be uploaded onto the project Portal\n- Signing in the WP1.B - School Participation Letter with each school\n\nAction 2 – Teacher and students Experiences\n- Presentation and discussions with the teachers on this activity role and impact','','For the purpose of recruitment and implementattion forms were translated into slovak:\n- WP1.A - School Participation Form\n- WP1.C - Role of the School\n- WP1.D - Teachers experience form\n- WP1.E - Students experience form\n\nTRANSFER  has promoted the Goerudio project in the schools in all Slovak Republic. Face to face meetings with mostly vocational econdary schools and with grammar schools.\n5 Vocational secondary schools \n5 Grammar schools\n\nAction 1\nAfter involving 5 schools TRANSFER organised on 2.5.2014 the first national workshop about Goerudio project, activities and aims awith teachers and about methodolgy how to wtite teachers  and students exprience\n\nA total number of 10 teachers\\\' experiences and 100 students\\\' experiences have been collected and uploaded on the project portal.\n\nAction 2\nTeacher and students Experiences\n- Presentation and discussions with the teachers on this activity role and impact, setting a basic process of involving students in collecting their experiences.\n- Translation of the - WP1.D - Teachers experience form and WP1.E - Students experience form, into slovak language \n- Announcements to the teachers involved presenting the Action 2 of the project, including the presentation of the aims of the experiences sharing, discussions on the type of experiences to be presented and introduction to the forms to be filled in.\n- Participation in meetings with the teachers, working and supporting them to fill in the forms and discussions among the teachers on their experiences. \n- Participation in activities with the students, presenting the project and working with them on sharing their experiences. \n- Email support to the teachers and students in filling in the forms.\n- Collecting the forms from the teachers (electronic and on paper versions)\n- Working on checking the experiences received, especially those from the students – proper and adequate content\n- Translation on the content – from SK to EN and those received in EN were translated also in SK\n- Working on editing the content, uploading the experiences on the portal','TRANSFER Slovensko involved in the project: 5 schools, 10 teachers and around 200 students. Learning experience of teachers and students are being collected.\n1. Five schools were involved in the project.\n2. Ten teachers were involved in the project activities by signing the agreement.\n3. 200 students were involved in the project.\n\nA total number of 63 teachers\\\' experiences and 100 students\\\' experiences have been collected and uploaded on the project portal.','The activities under WP1 are carried out smoothly and in line with the milestone foreseen by the project workplan.'),(48,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','Under this WP TRANSFER has conducted the following activities:\n- started with the search and identification of interesting practices.\n- TRANSFER identified a total number 30 initiatives and the description is available in in English and in Slovak on the project portal.\n\nTRANSFER organised meetings with the slovak teachers in order to present and assign them the initiatives.','Under this WP TRANSFER has achieved the following results so far:\nduring this first natiopnal workshop in Bratislava all teachers which participated on the workshop together identifed some interesting slovak national platforms, teaching materials and Jozef Strakos expelain the new didactic and methodological apporoaches in science education.ň\n\n-The forms are available on the project portal\nTRANSFER has already identified 30 initiatives which has been assigned to the teachers for the review.','The activities have been carried out according to the project planning with good results.'),(49,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 3','- Creating learning community of scientific teachers and students in Slovakia\n- Integration of schools and exchange of best practice among beneficiaries\nThe aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an enquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','The first step to create learning community was done on this first national teachers workshop in Bratislava on 2.5.2014. We create this community in this stage from directly participated teachers but we crete a special communication tool with google goup email as tool to exchange your expriences, opinions and feed backs.  \nWhile recruitment process of schools they were informed about their role and involvement in creating learning community.\nWe cooperate during the last 3 month period with comunity about project next aims a nd goals.','The first step to create this community was done.After the workshop some teachers coomunicate about your experiences and about methodology how ro write studens experiences. All community members  are working during the last 3 month on the next aims and goals.\nOutputs:\n- List with extracts of the comments offered by the slovak teachers\n- List of participants in the first virtual meeting\n- Interventions for the first virtual meeting','Preparatory activities for future activities have been done.'),(50,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars, during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','TRANSFER organised the first national seminar or workshop on 2.5.2014 with involving teachers in Bratislava as a preparation for the next cooperation during the project a nd ingorm all teacghers about the next 2 national seminars.\nTRANSFER communicate continuously with teachers about the next aims and with other institutions about the project.','The firt national workshop 2.5.2014. TRANSFER inform about the project teachers and  other education managers and institutions','satisfactory'),(51,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners.','','Under this WP TRANSFER has realised the following activities:\n- translated the information that was currently available in the different sections of the portal;\n- uploaded school participation forms on the portal;\n- uploaded information about the teachers, involved in the project.\n- uploaded teachers and students experiences\n- uploaded 30 initiatives\n- uploaded teachers comments to other experiencesi\n- uploaded partners ,teachers and students rewiev to iniciatives','So far the following outcomes are achieved:\n- portal, available in slovak language;\n- uploaded school participation forms for all the schools, involved in the project.\n- Translation of the main section of the website and portal into Slovak\n- 5 schools uploaded\n- 60 teachers experiences uploaded\n- 100 students experiences uploaded\n- uploaded 30 initiatives - portals\n- uploaded teachers comments to other experiences\n- uploaded partners ,teachers and students rewiev to iniciatives','So far the work under this WP is considered satisfactory - done with the necessary quality in the set deadlines.'),(52,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens.','','TRANSFER undertaken mostly national meetings to promote the project to target groups and Goerudio portal:\n- website: information published at TRANSFER website (www.transfer.sk) - basic information and link to project portal\n\n- 1 Intenational Meetings: dissemination to relevant stakeholdrs from European organizations during partners meetings of LLABS in Ostrava, Cuech Republic (29.05.14)\n- 10 National meeting with state institutions and schools\n- 1 information email \n- Project Brochure, translated into slovak, promotional material handed in during meetings','slovak version of Goerudio brochure\n- 12 events uploaded at Goerudio portal','Progress satisfactory. Several channels used to disseminate.'),(53,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 8','The aim of WP 8 is the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period.\n\nEach partner have to provide:\n10 links made to the project Portal from relevant web sites;\n10 letters of participation in the project as associate partners;\n10 Associate Partners form filled in;\n1 progress and 1 final exploitation report.','','TRANSFER has started searching for associated partners  - we have to this time 2 schools as assocoieted partners and 4 links to the project portal','TRANSFER has started searching for associated partners  - we have to this time 2 schools as assocoieted partners and 4 links to the project portal','The work will be evaluated at a later stage.'),(54,'',67,47,'TRANSFER Slovensko, s.r.o.',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n- A total of 10 testimonials from the project end users.\n- 1 progress and 1 final evaluation questionnaire filled in.\n- 1 progress and 1 final national evaluation report.','','Under this WP TRANSFER has conducted the following activities: \n-  participated in the evaluation process during the first partnership meeting;\n- evaluate the first national workshop in Bratislava\n- set internal quality assurance procedures for the work, implemented under the project.\n\n\nTRANSFER contacted teachers, students, professionals working in education and staff members, providing them information on the project, presenting the project portal and inviting them to provide feedback related to the points of strength of the methods and results available on the project portal\n(http://goerudio.pixel-online.org/index.php).\nUp to now 5 testimonials have been filled in.\n\nTRANSFER collected information and worked for filling in the WP9.B - Guidelines for Writing the Evaluation Report form. \n\nEvaluation preparation for the interim report.','So far the results achieved under this WP are the following:\n- evaluation questionnaire for the first partnership meeting filled in;\n- internal quality assurance procedures set for all people, working under the project in TRANSFER.\n- writing and sending first 5 Testimonials','So far the work is considered satisfactory.'),(55,'',64,43,'Alqueria',20140101,20141231,'WP 1','The aim of the workpackage is to involve school teachers and students in a joint effort to share information about their experiences regarding the main obstacles that affect the performance of students studying scientific issues and the everyday solutions adopted and that demonstrated to be effective in answering to those barriers.\nActivities:\n– Creation of school network\n    School network (at least 5 schools, 10 teachers, 200 students)\n    School Participation Form for each school involved \n    School Participation Letter with each school\n\n- Teacher and students Experiences. Collection, by each partner, of:\n  50 teachers\\\' experiences \n  100 students experiences','','-Translation of the WP1.C - Role of the School and of the WP1.A, WP1.B, into Spanish.\n- L\\\'alqueria contacted various Spanish schools with information about the project for the purposes of involving them in the project activities. The contacts were made by the project manager and the project coordinator The contacts were made conducting face to face meetings with headmasters and teachers\n-L\\\'Alqueria involved in the project: 5 schools, 10 teachers and around 200 students. \n-51 teachers\\\' experiences have been collected and uploaded on the project portal\n-100 students\\\' experiences have been collected and uploaded on the project portal\n-translated the forms of describing teachers\\\' and students\\\' experiences in Spanish and in English and will upload them on the project portal.','School participation form and School participation letter:\n-IES Simarro Lacabra\n-IES Serpis\n-IES San Vicent Ferrer\n-IES Bernat Guinovart\n-IES José María Parra\nAll the schools are lower and high secundary schools.\nFor each school, 2 scientific teachers involved.\nFor each school, around 50 students involved\n\n-51 teachers\\\' experiences have been collected and uploaded on the project portal\n-100 students\\\' experiences have been collected and uploaded on the project portal','We have delayed uploading teachers\\\' experiences and students\\\' experiences on the portal project. Finally, all required experiences have been uploaded on the project portal.'),(56,'',64,43,'Alqueria',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','Under this WP L’alqueria has developed the following activities:\n- searched for project initiatives over the internet;\n- research of project compendiums from EU funded different programs;\n- contact with project promoters and coordinators.','L’alqueria has achieved the following resultsr:\n\n- 30 initiatives have been identified and forms of description are filled in and uploaded in the project portal','The activities have been carried out according to the project planning.'),(57,'',64,43,'Alqueria',20140101,20141231,'WP 3','The aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity to discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an inquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','L’alqueria  has conducted the following activities:\n- organized meetings with the principals ,teachers and teacher training centers to present the portal and to explain what is behind the idea of \\\"discuss and share knowledge and experiences\\\" among the community of teachers involved;\n- L’alqueria  has prepared presentation of the teachers\\\' experiences so far and translated some of the foreign experiences, for presenting the results of the project in the national meetings\n- together with the schools, plan future workshops with teachers to obtain comments and feedback for the activities carried out.\n-participation in the first virtual meeting organized under the project.','Teachers and principals are very interested in the project\nteachers\\\' comments posted on the portal','The work will be evaluated at a later stage'),(58,'',62,45,'Riga State Technical School',20140101,20141231,'WP 2','The aim of the workpackage is to involve students and teachers in reviewing existing projects and related results (e.g. teaching materials, methodological approaches etc.) dealing with the theme of teaching scientific issues in a more interactive and involving way and with the theme of experimenting teaching methods promoting an active role of the pupil in the own learning process.','','Databases of existing initiatives/projects were examined in order to collect initiatives from Baltic States and Finland.','30 initiatives have been identified and forms of description are filled in and uploaded in the project portal.\nThere are collected reviews from project partner, teachers and students on the initiatives.','There was challange in selection of initiatives where Baltic State countries and Finland are promoters or key partners. A lot of initiatives/projects are not provided with websyte therefore the information is not available for wide public.'),(59,'',62,45,'Riga State Technical School',20140101,20141231,'WP 3','The aim of the workpackage is to promote the creation of a learning community in which teachers and students, will have the opportunity discuss and share knowledge and experiences on the theme of how to make scientific issues more attractive for students and how to promote an enquiry based learning approach so to enhance pupils autonomy in managing their learning process.','','1.There is created and announced a permanent course of lectures and discussions about the Goerudio method.\n2. Teachers were introduced to other teachers\\\' experiences uploaded on project portal.\n3. Stakeholders of education are interested in Goerudio project and goerudio comprehension method thus there were organized reagional seminars.\n4. Collected comments on Teachers\\\' experiences.\n5. Participation in the virtual meeting on teaching and learning experiences.','1. Teachers uploades comments on Teachers\\\' experiences.\n2. Discussions and sharing of teaching and learning methods during regional seminars.\n3. Uploaded and available comments on the teachers\\\' esperiences on the project portal.\n4. Listed factors thar rise complications in teaching and learning process.','Large interest from teachers involved in project and spread infomation among other stakeholdes involved in Education system.'),(60,'',62,45,'Riga State Technical School',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','There were organized 2 national seminars in 2  cities where teachers, administrative personal and students from different reagional schools participate.','Seminar participants were introduced to Goerudio project and Goerudio comprehension method. In presentation were involved students who already use Goerudio comprehension method and shared their experience.','Satisfactory'),(61,'',62,45,'Riga State Technical School',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners.','','Riga State technical school has carried out following activities:\n- translated the information  of the portal in national language;\n- uploaded school participation forms on the portal;\n- uploaded information about the teachers involved in the project;\n- uploded teachers\\\' and students\\\' Experience Forms.\n- uploaded initiative forms\n- uploaded comments on Experiences\n- uploaded rewievs of initiatives/projects','There is information available in Latvian language.','Satisfactory'),(62,'',62,45,'Riga State Technical School',20140101,20141231,'WP 8','The aim of WP 8 is the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period.\n\nEach partner have to provide:\n10 links made to the project Portal from relevant web sites;\n10 letters of participation in the project as associate partners;\n10 Associate Partners form filled in;\n1 progress and 1 final exploitation report.','','Identified asociated partners and sent Letters of Interest to be signed.','Signed Letters of Interest with:\n - Riga English Grammer School as methodology based educational institution.\n- Latvian Education Fund as a provider of Goeruio comprehension method\n- Latvian Association of Printing Business\n- Institute of Wood Chemistry\n- Valga Country Vocational Training Centre','Evaluation will fallow on later stage'),(63,'',64,43,'Alqueria',20140101,20141231,'WP 4','The aim of the workpackage is to involve students and teachers in the participation into seminars during which they will present the results of the Goerudio project.\n\nProject partners have to organize 2 national seminars in order to ensure maximum diffusion of the results achieved within the Goerudio project and to foster a further reflection and knowledge sharing experience among school community on the theme of teaching scientific issues at school.','','L\\\'Alqueria is in contact with Teacher Training Center of Valencia to organize teachers seminars.','No outcomes yet','It is not possible to evaluate because the activities have just begun.'),(64,'',64,43,'Alqueria',20140101,20141231,'WP 5','The aim of the Workpackage is to create the project Portal to collect and make accessible all the project results. A section of the project portal is dedicated to the management of the project and it is mostly addressed to the project partners','','Under this WP L’alqueria has conducted the following activities:\n- translated the information that was currently available in the different sections of the portal;\n- uploaded school participation forms on the portal;\n- uploaded information about the teachers, involved in the project;\n- uploaded teachers\\\' and students\\\' experiences forms;\n- uploaded project initiatives forms.\n -uploaded 30 comments on teacher’s experiences','So far the following outcomes are achieved:\n- portal, available in Spanish;\n- uploaded school participation forms for all the schools, involved in the project;\n- uploaded teachers\\\' and students\\\' forms;\n- uploaded 50 teachers\\\' and 200 students\\\' experiences forms;\n- uploaded 30 project initiatives forms.\n- uploaded 30 comments on teacher’s experiences','The activities have been carried out according to the project planning with good results.'),(65,'',64,43,'Alqueria',20140101,20141231,'WP 6','The objective of this Work Package is to ensure the maximum involvement of each partner in the project and ensure that each partner can contribute to a good performance of project activities based on his own set of skills and experiences.\nIn the framework of WP6 each partner has to:\n- Upload Project Activities Report Forms in progress on the project\\\'s website;\n- Produce 1 Progress and 1 Final Project Financial Report.','','L’alqueria  has conducted the following activities:\n- participated in the first partnership meeting in Florence, Italy; \n- developed the necessary presentations for the first partnership meeting;\n- worked on administrative and contractual issues, with regard to signing the contract with the leading organization on behalf of L’alqueria;\n- developed the necessary presentation for the second partnership meeting and participated in the meeting;\n- filled in progress activity reports for the first 9 months of the project implementation;\n- activity, dissemination, evaluation and financial progress report are under preparation','- two representative of L’alqueria  participated in the two project partnership meetings;\n- contract signed;\n- activity reports filled in for the first 9 months of the project.','The work under this WP is considered satisfactory.'),(66,'',64,43,'Alqueria',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n- A total of 10 testimonials from the project end users.\n- 1 progress and 1 final evaluation questionnaire filled in.\n- 1 progress and 1 final national evaluation report.','','L\\\'Alqueria has conducted the following activity: \n- participated in the evaluation process during the first and second partnership meetings\n-- set internal quality assurance procedures for the work, implemented under the project.','The result achieved under this WP is the following:\n- Evaluation questionnaire for the first and second partnership meeting filled in.\n- Internal quality assurance procedures set for all people, working under the project\n- 10 testimonials','Satisfactory'),(67,'',62,45,'Riga State Technical School',20140101,20141231,'WP 9','The aim of the quality assurance and evaluation of the Project is to measure and ensure the quality of all the activities and items of the project: the planning, the management (operational and financial), the partnership, the activities, the results.\n\nEach partner will provide:\n- A total of 10 testimonials from the project end users.\n- 1 progress and 1 final evaluation questionnaire filled in.\n- 1 progress and 1 final national evaluation report.','','Under WP9 Riga State technical school has conducted the following activities:\n- participated in the evaluation process during the first partnership meeting In Florence;\n- collection of testimonials from project users;\n- production of progress evaluation report.','Filled in evaluation questionnaire.\nCollected 5 testimonials, sent filled forms.\nProduced Progress evaluation report.','Satisfactory'),(68,'',62,45,'Riga State Technical School',20140101,20141231,'WP 1','The aim is to select 5 schools for participation in the project and to involve 10 scientific teachers and 200 students in project activities.','','Riga State Technical school carried out the following activities:\n1. Schools were contacted via e-mail and telephone conversations.\n2. Management forms (WP1A, WP1C, WP1D and WP1E) were translated in national language.\n3. There were seminar organized for teachers involved in the project in order to inform about project activities and to introduce the Goerudio method.\n4. Selection of teaching and learning experiences from teachers and students.\n5. There were made discussions and analysis of teachers and students experiences.\n6. Collected commentaries from teachers on teaching experiences.\n7. Involved teachers in reviews of identified initiatives/projects.','1. Five schools were involved in the project.\n2. Ten teachers were involved in the project activities by signing the agreement.\n3. 200 students were involved in the project.\n4. At the moment teachers started to work on Goerudio teaching and learning method.\n5. There were organized seminars for teachers to introduce Goerudio method and to start wroking on new teaching method.\n6. Continued work on Goerudio comprehension method and model cratation and analysis by teachers and students involved in the project.\n7. Highlighted factors on teaching/learning difficulty of scientific subjects.\n8. Raised discussions about teaching and learning isues, exchange of views and R\\\\recommendations from other collegues.','So far the work is considered satisfactory.'),(69,'',16,1,'Connectis',20140101,20141231,'WP 5','Connectis, carries out the role of technical partner in the framework of the Goerudio project. The tasks carried out by Connectis during the various phases of the project during the first year can be sub-divided in the following way.','','A.	Phase 1: Development of technical material for the internal project website and portal \no	Portal http://goerudio.pixel-online.org/index.php\n\nB.	Phase 2: Publication &amp; Typography–creation of Brochures and posters\n\nC.	Phase 3: Development of material for the website and portal \no	Choice of Template\no	Specific conformities \n	W3C – HTML 4.01\n	W3C –  CSS\no	Creation, publication and management of the project website http://goerudio.pixel-online.org/info\no	Creation, publication and management of the project portal http://goerudio.pixel-online.org/index.php\no	Creation, publication and management of the News section of the portal (http://goerudio.pixel-online.org/news.php)\n\n\n\n\n\n\n\n\n2	Planned Activities \n2.1	Activity 1 – Graphics \nActivities include: \no	Definition of specifics \no	Graphic ideas\no	Creation of logo \n	Vectorial\n	Low quality for the web\n	High qualità for printing \no	Collection of logos \n	Partner\n	Other institutions\n•	EU Lifelong learning programme\no	Implementation for printing \no	Implementation for website \n	Website\n	Portal\no	Implementation of templates and instructions for publishing by the partners \n\nThe work has been carried out in the following phases:  \na.	Meetings to define the function of the graphics\nb.	Planning \nc.	Collection of  material \no	Images\no	Logos\no	Fonts\no	Contents\nd.	Creation of templates \ne.	Check and approval \nf.	Carrying out of modifications\ng.	Publication\n\n\nCompleted	To complete\n	\n100%	0%\n\n\n2.2	Activity 2 – Creation and management of the project website \nDevelopment of the project website at the following address: http://goerudio.pixel-online.org/info\nThis site is destined for the project partners and therefore the aim is to offer a valid work tool to be used throughout the project period. \n\nThere are 2 areas on the website, a public area and a reserved area. \n•	Public area\no	In the public area the general information about the project and the partners is supplied \no	In the Meeting section there is the possibility to see photos and read a brief description about each meeting that has taken place\no	There is also a Dissemination section which offers the possibility to visualise the various dissemination events carried out by each partner. \n•	Reserved Area\no	In the reserved area the minutes of the meetings can be viewed \n•	Administration Area\no	It is possible to modify the contents of the pages\no	It is possible to update the Meetings section\no	It is possible to update the dissemination section \no	It is possible to update the Work in progress area \n\nThe work has been carried out following these phases: \nAnalysis:\no	Analysis of the objectives\no	Analysis of the internal and external human resources \no	Analysis of software which could be used in the project \n \nCompleted	To complete\n	\n70%	30%\n\n\n\n\n\n\n•	Planning\no	Planning of the story-board (site map, menu, applied areas, functioning\no	Planning of the graphics \no	Planning of the formatting of texts\no	Planning of the dynamic modules \no	Planning of the MySql Database\nCompleted	To complete\n	\n80%	20%\n\n•	Development\no	Development of the Html template based on the graphics supplied \no	Planning of the formatting of the texts\no	Development of the new dynamic modules in php with access the MySql Database\no	Implementation of the html template with modules in php\no	Assembling of each module \no	Testing the local version\no	Publication and testing online\no	Maintenance \nCompleted	To complete\n	\n80%	20%\n\n•	Systems management\no	Systematic management of the web server \no	Management of the DNS\no	Implementation of MySQL\nCompleted	To complete\n	\n80%	20%\n\n•	Insertion contents\no	Insertion of the textual contents\no	Insertion of the Meeting and Dissemination\no	\nCompleted	To complete\n	\n70%	30%\n\n \n\n2.3	Activity 3 – Project Portal \n2.3.1	Definition of the structure of the GOERUDIO portal \n\nThe GOERUDIO portal has been developed and is visible at the following (url) address: \nhttp://goerudio.pixel-online.org/index.php\n\nThe project addresses the following four main issues which have a relevant impact on the study of scientific topics:\nThe Goerudio Portal provides access to:\nScience Teachers’ experiences\nScience Students’ experiences\nReviews of relevant initiatives in the field of science teaching\nNational workshop\n\nThe portal is divided in the following areas::\noHomepage\noExperiences\noPartnership\noSchools\noEvents\noPress Release\noDedicated Links\noNews\noContacts\n\nThe work has been carried out in the following phases: \nAnalysis:\no	analysis of the objectives, \no	analysis of the human internal and external \no	analysis  of software which could be used in the project \no	 \nCompleted	To complete\n	\n100%	0%\n\n•	Planning\n•	Planning of the story-board (map of portal,  menu, applied areas, functioning) \n•	Graphic planning \n•	Elaboration of the graphic drafts \n•	Proposal and approval \n•	Planning of the formatting of texts\n•	Planning of the dynamic modules \n•	Planning of the MySql Database\n\nCompleted	To complete\n	\n70%	30%\n\n\n2.3.2	Development of the structure of the GOERUDIO portal \nThe work follows the following phases  \n•	Development\no	Development of the Html template based on the graphics supplied \no	Planning of the formatting of the texts\no	Development of the new dynamic modules in php with access the MySql Database\no	Implementation of the html template with modules in php\no	Assembling of each module \no	Testing the local version\no	Publication and testing online\no	Maintenance \n•	Systems management\no	Systematic management of the web server \no	Management of the DNS\no	Implementation of MySQL\n\n•	Insertion of contents\no	Insertion of textual contents\n\n\nCompleted	To complete\n	\n70%	30%\n\nFrom this section it is possible to access:\nscience teachers’ experiences in adopting teaching methods to promote students’ interest towards scientific issues\nscience students’ experiences describing their difficulties and successes in learning science\n\n Each product is characterised by a descriptive form.\no	Definition of the Evaluation form \no	Definition of the function of the database \no	Identification of the administrative profiles of the database and its contents \no	Planning the database structure \no	Creation of Database \no	Creation of the user interface \no	Creation of the user interface  for the reserved area \no	Upload area\no	Needs analysis \no	ftp\no	http\no	Search engine\no	Creation of search interface \no	Visualisation of results \no	Detailed visualisation\nCompleted	To complete\n	\n100%	0%\n\n \n\n2.5	Activity 5 – Development of the Exploitation section \n2.5.1	Definition of the structure of the Exploitation section \nThe project partnership actively promoted the GOERUDIO project with the purpose to enhance its impact, foster its visibility and ensure its sustainability. \n\nAs a result of the exploitation activity:\n•	A number of associated partners officially joined the project in order to contribute to the improvement of the project impact on their target groups and to ensure the project sustainability by continuing using the project deliverables in the next years.\n•	A number of associated schools officially joined the project involving teachers, school directors, students and their parents in the creation of the database of case studies in and in the transnational discussion that took place on them\n•	Press releases were published providing information and contact details about the Embed project.\n•	Several educational web sites promoted the Embed project through a dedicated link on their web site.\n\n\nCompleted	To complete\n	\n70%	30%','The portal of the project is available at the URL http://goerudio.pixel-online.org/','Since now we experience a very good job and collaboration with all the partners involved in the project.\nAs technical partner our work is necessary to be done in the first months of the project to allow the other partners to work on the platform'),(70,'',16,1,'Connectis',20140101,20141231,'WP 6','The aim of the activities were:\nTo allow the partnership to use the portal with the aim to record the activities done, the dissemination events, the Exploitation and the translations.\nTo ensure a correct and effective organisation of the meetings in cooperation with all the partners.\nOn that purpose we have created some materials used during the meetings, to show the changes occurred to the portal.','','Organisation of the meetings in cooperation with Pixel\nFor this aim we created 5 different version of the logo of the project, to choose from. Mr Riccardo Rossi has partecipate effectively to the partner\\\'s meeting.\n\nIn this occasion has been presented the Beta version of the web site, and mr Rossi has explained to the other partners how the Dissemination, Work in progress, and Download sections works.\n\nFor the next meetings we have created some materials and presentations to show the changes incurred in the web platforms, and the databases used in this project.\n\nThe translation section is now available to allow all the partners to translate the main parts of the portal in their own language','The creation of the reserved area, with the following functions:\nRESERVED AREA\n\nSCHOOLS\nManage Schools\nInsert new Schools\n\nASSOCIATED PARTNERS\nManage Partners\nInsert new Partner\n\nTEACHERS EXPERIENCES\nManage T. Experiences\nInsert new T. Experience\n\nSTUDENT EXPERIENCES\nManage S. Experiences\nInsert new S. Experience\n\nTRANSLATE INTO','All the work done has flow in a very productive way.\nSo far the work under this WP is considered satisfactory - done with the necessary quality in the set deadlines.'),(71,'',64,43,'Alqueria',20140101,20151231,'WP 7','The objectives of the Dissemination Work Package are:\n- Making the Goerudio Portal accessible to the largest possible number of scientific school teachers, scientific experts, educational institutions, policy makers in the field in Europe.\n- Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of operators in the field of education\n-Sharing the Goerudio Portal and the results of the Goerudio project with the highest number of citizens.','','Under this L’alqueria  has conducted the following activities:\n- 24 dissemination events: 9 international meetings;  10 national meetings; 1 informative mailing; 5 attendances of international conferences;\n- uploading information about the dissemination events on the portal.','The outcomes under this WP are as follows:\n- 24 dissemination events conducted;\n- 24 dissemination report forms uploaded on the portal as of 30 October 2014.','Progress satisfactory.'),(72,'',64,43,'Alqueria',20140101,20151231,'WP 8','The aim of this WP  the promotion of the most appropriate impact of the project on each target group and the ensuring of the sustainability of the project after the end of the funding period.\n\nEach partner have to provide:\n10 links made to the project Portal from relevant web sites;\n10 letters of participation in the project as associate partners;\n10 Associate Partners form filled in;\n1 progress and 1 final exploitation report.','','Under this WP L’alqueria  made contacts and organized visits in organizations that are interested in the project ideas and results.','Outcomes\n5 letters of participation in the project as associate partners\n5 associate partners form filled in\n9 links made to the project portal form relevant web sites\nFill in the explotation report','Satisfactory');
