INSERT INTO `lang__en` VALUES (1,34,'main_text','<p>\r\n	This toolkit allows students to carry out a self-evaluation of their knowledge on 10 selected Math topics.</p>\r\n','',''),(2,35,'main_text','<p>\r\n	This toolkit provides teachers with the possibility to organize for their students an online test on 10 selected Math topics.</p>\r\n','',''),(3,36,'main_text','<p>\r\n	A collection of reviewed video lessons on several selected Math topics.</p>\r\n','',''),(4,37,'main_text','<p>\r\n	A collection of specifically created video lessons on 10 selected Math topics.</p>\r\n','',''),(5,18,'main_text','<p>\r\n	Acquisition of intercultural competences based on understanding human rights and non-discrimination values</p>\r\n','',''),(6,42,'main_text','<p>\r\n	A virtual place to exchange teaching and learning experiences between teachers and students</p>\r\n','',''),(7,17,'main_text','<p>\r\n	<strong>From this section it is possible to access to a description of each contractual partner of the MathE project. </strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	There are 7 contractual partners and they are based in 5 different European countries.</p>\r\n','',''),(8,43,'main_text','<p>\r\n	From this section it is possible to access to the information related to the lecturers involved in the MathE project in the 5 European partner countries</p>\r\n','',''),(9,5,'main_text','<p>\r\n	From this section it is possible to access to the information related to the students involved in the MathE project in the 5 European partner countries</p>\r\n','',''),(10,15,'main_text','<p>\r\n	<strong>As a result of the exploitation activity a number of associated partners officially joined the project in order to contribute to the improvement of the project impact on their target groups and to ensure the project sustainability by continuing using the project deliverables in the next years.</strong></p>\r\n<p>\r\n	The associate partners of the MathE project are organizations interested in scientific education.&nbsp; All associated partners share the project objectives and are willing to contribute to their achievement.<br />\r\n	<br />\r\n	Institutions and organisations interested in becoming associated partners of the MathE project can contact the <a href=\"./contacts.php\">national coordinators</a> of the project.</p>\r\n','',''),(11,3,'main_text','<p>\r\n	<strong>The project partners are available to provide you with any information you may need. Do not hesitate to contact us!</strong></p>\r\n','',''),(12,25,'main_text','<p>\r\n	The MathE project was presented in a number of events in order to report about the activities carried out and the results achieved.</p>\r\n','',''),(13,26,'main_text','<p>\r\n	<strong>The MathE project partnership made contacts with web sites focusing on the fields of education</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	The MathE project was presented to the web masters and a link to the MathE project portal was made so that those who will access the selected web sites can also access, through a direct link, the MathE portal.</p>\r\n','',''),(14,6,'main_text','<p>\r\n	<strong>This section presents the main information about the MathE project</strong></p>\r\n','',''),(15,8,'main_text','<p>\r\n	<strong>There are 7 partners from 5 European countries involved in the project. You can contact the transnational or the national coordinators to participate in the project. </strong></p>\r\n','',''),(16,7,'main_text','<p>\r\n	<strong>The section presents the complete list of project results.</strong></p>\r\n','',''),(17,9,'main_text','<p>\r\n	<strong>This section provides the access to the information about the transnational meetings and to all related documents.</strong></p>\r\n','',''),(18,10,'main_text','<p>\r\n	<strong>This section allows a constant communication and sharing of information among the project partners as far as the activities for the different intellectual outputs are concerned.</strong><br />\r\n	<br />\r\n	Each project partner upload this section of a three months basis.</p>\r\n','',''),(19,12,'main_text','<p>\r\n	<strong>This section is meant to facilitate the sharing of information among partners as far as the dissemination events carried out are concerned.</strong><br />\r\n	<br />\r\n	A description of the event, the number of people participating and the evaluation of the event are available for each dissemination event.</p>\r\n','',''),(20,13,'main_text','<p>\r\n	<strong>This section provides the access to all the documents for the project management and for the carrying out of the activities.</strong></p>\r\n','',''),(21,14,'main_text','<p>\r\n	<strong>The project partnership actively promoted the MathE project with the purpose to enhance its impact, foster its visibility and ensure its sustainability.</strong></p>\r\n','','');
/*!40000 ALTER TABLE `lang__en` ENABLE KEYS */;
UNLOCK TABLES;

