INSERT INTO `lang__pt` VALUES (1,34,'main_text','<p>\r\n	Este kit de ferramentas permite que os alunos realizem exames e se autoavaliem em 10 t&oacute;picos selecionados de Matem&aacute;tica.</p>\r\n','',''),(2,35,'main_text','<p>\r\n	Esta ferramenta permite que os professores disponibilizem exames online, para os seus alunos, em 10 t&oacute;picos de Matem&aacute;tica.</p>\r\n<p>\r\n	&nbsp;</p>\r\n','',''),(3,36,'main_text','<p>\r\n	Cole&ccedil;&atilde;o de aulas (video) acerca de v&aacute;rios t&oacute;picos de Matem&aacute;tica.</p>\r\n','',''),(4,37,'main_text','<p>\r\n	Uma cole&ccedil;&atilde;o de aulas em v&iacute;deo especificamente filmadas ou produzidas acerca de 10 t&oacute;picos selecionados de Matem&aacute;tica.</p>\r\n','',''),(5,18,'main_text','<p>\r\n	Aquisi&ccedil;&atilde;o de compet&ecirc;ncias interculturais baseadas na compreens&atilde;o dos direitos humanos e valores de n&atilde;o discrimina&ccedil;&atilde;o</p>\r\n','',''),(6,42,'main_text','<p>\r\n	Lugar virtual para trocar experi&ecirc;ncias de ensino e aprendizagem entre professores e alunos</p>\r\n','',''),(7,17,'main_text','<p>\r\n	A partir desta se&ccedil;&atilde;o, &eacute; poss&iacute;vel aceder a uma descri&ccedil;&atilde;o de cada parceiro contratual do projeto MathE.</p>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Existem 7 parceiros contratuais oriundos de 5 pa&iacute;ses europeus diferentes.</div>\r\n','',''),(8,43,'main_text','<p>\r\n	Nesta sec&ccedil;&atilde;o &eacute; poss&iacute;vel aceder &agrave; informa&ccedil;&atilde;o relacionada com os professores envolvidos no projeto MathE, dos 5 pa&iacute;ses parceiros europeus.</p>\r\n','',''),(9,5,'main_text','<p>\r\n	Nesta sec&ccedil;&atilde;o &eacute; poss&iacute;vel aceder &agrave; informa&ccedil;&atilde;o relacionada com os alunos envolvidos no projeto MathE, dos 5 pa&iacute;ses parceiros europeus</p>\r\n','',''),(10,15,'main_text','<p>\r\n	Como resultado da atividade de explora&ccedil;&atilde;o, v&aacute;rios parceiros associados juntaram-se oficialmente ao projeto para contribuir para a melhoria do impacto do projeto nos seus grupos-alvo e para garantir a sustentabilidade do projeto, continuando a usar as ferramentas elaboradas no futuro.</p>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Os parceiros associados do projeto MathE s&atilde;o organiza&ccedil;&otilde;es interessadas em educa&ccedil;&atilde;o cient&iacute;fica. Todos os parceiros associados compartilham os objetivos do projeto e est&atilde;o dispostos a contribuir para a sua realiza&ccedil;&atilde;o.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Institui&ccedil;&otilde;es e organiza&ccedil;&otilde;es interessadas em tornar-se parceiras associadas do projeto MathE podem contactar os coordenadores nacionais do projeto.</div>\r\n','',''),(11,3,'main_text','<p>\r\n	Os parceiros do projeto est&atilde;o dispon&iacute;veis para fornecer qualquer informa&ccedil;&atilde;o que voc&ecirc; possa necessitar. N&atilde;o hesite em contactar-nos!</p>\r\n','',''),(12,25,'main_text','<p>\r\n	O projeto MathE foi apresentado em v&aacute;rios eventos de forma a mostrar as atividades realizadas e os resultados alcan&ccedil;ados.</p>\r\n','',''),(13,26,'main_text','<p>\r\n	<strong>Os parceiros do projeto MathE estabeleceram contactos com sites da Web focados nos campos da educa&ccedil;&atilde;o</strong></p>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	O projeto MathE foi apresentado aos &quot;web masters&quot; e um link para o portal do projeto MathE foi feito para que aqueles que acedem aos sites selecionados tamb&eacute;m possam aceder, atrav&eacute;s de um link direto, ao portal MathE.&nbsp;</div>\r\n','',''),(14,6,'main_text','<p>\r\n	<strong>Nesta se&ccedil;&atilde;o apresentam-se as principais informa&ccedil;&otilde;es sobre o projeto MathE</strong></p>\r\n','',''),(15,7,'main_text','<p>\r\n	<strong>Nesta se&ccedil;&atilde;o apresenta-se a lista completa dos resultados do projeto.&nbsp;</strong></p>\r\n','',''),(16,8,'main_text','<p>\r\n	<strong>Existem 7 parceiros, oriundos de 7 pa&iacute;ses europeus, envolvidos neste projeto. Pode contactar os coordenadores nacionais ou transnacionais para participar no projeto.</strong></p>\r\n','',''),(17,9,'main_text','<p>\r\n	<strong>Nesta sec&ccedil;&atilde;o pode aceder &agrave; informa&ccedil;&atilde;o sobre as reuni&otilde;es transnacionais bem como a toda a documenta&ccedil;&atilde;o inerente &agrave;s reuni&otilde;es.</strong></p>\r\n','',''),(18,10,'main_text','<p>\r\n	<strong>Nesta sec&ccedil;&atilde;o privilegia-se uma comunica&ccedil;&atilde;o constante e partilha de informa&ccedil;&otilde;es entre os parceiros do projeto, no que diz respeito &agrave;s atividades para os diferentes produtos intelectuais.</strong></p>\r\n<p>\r\n	Cada parceiro do projeto atualiza esta sec&ccedil;&atilde;o de 3 em 3 meses.</p>\r\n','',''),(19,12,'main_text','<p>\r\n	<strong>Esta sec&ccedil;&atilde;o destina-se a facilitar a partilha de informa&ccedil;&atilde;o entre os parceiros no que diz respeito aos eventos de divulga&ccedil;&atilde;o realizados.</strong></p>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Uma descri&ccedil;&atilde;o do evento, o n&uacute;mero de participantes e a avalia&ccedil;&atilde;o do evento est&atilde;o dispon&iacute;veis para cada evento de dissemina&ccedil;&atilde;o.</div>\r\n','',''),(20,13,'main_text','<p>\r\n	<strong>Nesta se&ccedil;&atilde;o &eacute; poss&iacute;vel aceder a todos os documentos para gerir o &nbsp;projeto e para a execu&ccedil;&atilde;o das atividades.</strong></p>\r\n','',''),(21,14,'main_text','<p>\r\n	<strong>As entidades parceiras do projeto promovem ativamente o projecto MathE com o objetivo de aumentar o seu impacto, contribuir para a &nbsp;sua visibilidade e garantir sua sustentabilidade.</strong></p>\r\n','','');
/*!40000 ALTER TABLE `lang__pt` ENABLE KEYS */;
