INSERT INTO `members_apartners` VALUES (2,82,44,'Limerick Institute of Technology','EPI*STEM','EPI*STEM\nUniversity of Limerick\nLimerick V94 T9PX','Limerick','Ireland','https://epistem.ie/','Professor Merrilyn Goos','National Centre for STEM Education','','merrilyn.goos@ul.ie','EPI*STEM conducts an integrated program of research, teaching, and engagement that addresses national and international challenges in STEM education. The Centre achieves this goal by leveraging its distinctive connections between STEM education academics and STEM discipline academics, and by forging connections with policy makers, practitioners, industries, and community groups that have a stake in STEM education.','EPI*STEM will place a link to the MathE project on its website, and will share MathE resources with the Mathematics Learning Centre at the University of Limerick.'),(3,81,50,'Instituto Politécnico de Bragança','Science Centre of Bragança','Rua dos Beato Nicolao Dinis  |  5300-130 Bragança','Bragança, Portugal','Portugal','http://www.braganca.cienciaviva.pt/','Ivone Fachada','Science Museum','','ivonefachada@gmail.com\nifachada@braganca.cienciaviva.pt','The Science Centre of Bragança is a science museum devoted to promote scientific knowledge and scientific methods, using modern interactive technologies. It is part of a vast network of Portuguese Science Centres, all sharing the same main goals. The Centre opened in July 2007. It hosts permanent scientific exhibitions, mainly focused on the following areas of knowledge: environment, ecology, biology, geology, energy, physics and chemistry. It also offers a broad range of additional science activities, including science birthday parties, lectures, workshops, informal scientific cafés, scientific movie sessions, among others.','The Science Centre of Bragança maintains a permanent and close collaboration with the research teams of the Polytechnic Institute of Bragança (IPB). Both institutions have specifically collaborated in science celebration events such as scientific national weeks and European Researcher’s Night. Science Centre of Bragança is also connected to local primary and secondary schools through a broad range of regular activities. IPB is a formal member of the Science Centre. Therefore, it will be the ideal partner to promote the project and its results among their visitors and contacts.'),(4,81,50,'Instituto Politécnico de Bragança','Research Centre in Digitalization and Intelligent Robotics','Campus de Santa Apolonia  |  5300-271 Bragança','Bragança','Portugal','http://cedri.ipb.pt/','Paulo Leitão','Research Center','','pleitao@ipb.pt','The Research Centre in Digitalization and Intelligent Robotics (CeDRI) is an applied interdisciplinary research unit that clusters together active researchers from the fields of Electronics, Computer Science and Mathematics.','The Research Centre in Digitalization and Intelligent Robotics maintains a permanent and close collaboration with the research teams of the Polytechnic Institute of Bragança (IPB). This institution has connections with secondary schools through a broad range of regular activities to promote science and technology. Therefore, it will be the ideal partner to promote the project and its results among their visitors and contacts.'),(5,80,54,'Fundatia EuroEd','Liceul Teoretic de Informatica \'\'Grigore Moisil\'\'','nr. 9, Petre Andrei Str.','Iasi','Romania','http://www.liis.ro','Emil Juverdeanu','Highschool','','petre.juverdeanu@yahoo.com','Theoretical high school in Iasi. Has around 1000 students. Professional training in the field of IT.','For exploitation teachers will use in their classes exercises developed in Mathe project, and will present the project in all types of teachers meetings.'),(6,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Società Dante Alighieri','ul. Komuny Paryskiej 21','Wroclaw','Poland','www.dante.uni.wroc.pl/','Gianluca Olcese','Non academic institution','','dante.wroclaw@gmail.com','The Dante Alighieri Society (Italian: Società Dante Alighieri) is a society that promotes Italian culture and language around the world. Today this society is present in more than 60 countries.','Exchange of experience and expertise during and after the project Participation in the Dissemination of the project information. Contribution to the maintenance of the project results in the future.'),(7,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','MathFitness','Salita Santa Maria di Castello 1/4','Genoa','Italy','http://mathfitness.org','Giuseppe Rosolini','No-profit Association','','rosolini@dima.unige.it','MathFitness is a non-profit, private-law entity, which presents mathematics as a contact point among cultures. It supports the school methodology and aims at presenting activities from a playful perspective. It has collaborative projects with schools and other associations.','Produce mathematical activities which may be used in the project, disseminate the production of the project, support all the activities of the projects with its staff.'),(8,80,54,'Fundatia EuroEd','The Romanian Association for Quality Language Services QUEST Romania','','Cluj, Iasi, Târgu Mures','Romania','http://www.quest.ro/','Ovidiu Ursa','Association','','ovidiu@access.ro','The Romanian Association for Quality Language Services QUEST Romania was created in May 1996, its aim being to promote and guarantee the provision in Romania of language teaching and other language services of the highest possible quality standards through the establishment of a quality assurance scheme. Founder members of QUEST are seven Language Centres, as well as the British Council Romania.\nQUEST is actively involved in supporting the activity of the Language Centres - full and associate members - and promotes networking and the exchange of expertise amongst education institutions. It also seeks links with other national and international organisations with similar aims.','Exchange of experience and expertise during and after the project\nParticipation in the Dissemination of the project information\nPromotion of the information about the project to our network of contacts\nContribution to exploitation and sustainability of the project results'),(9,80,54,'Fundatia EuroEd','Liceul Teoretic Vasile Alecsandri','Str. C.Negri no.50','Iasi','Romania','https://www.lvais.ro','Mihaela Ionescu','High School','','','The Vasile Alecsandri Theoretical high school is an educational institution that wants to progress by understanding the interdependence of all the actors involved in education, offering a set of values that will allow to reach the maximum potential for each student and efficiently managing all the resources available to him. The theoretical high school Vasile Alecsandri takes into account the ideals and demands of the direct and indirect beneficiaries, promoting dynamic strategies for the creative potential of the students and teachers, ensuring a democratic educational framework, based on team spirit, professionalism, interculturality and ability to adapt to ever changing realities. .','•	Exchange of experience and expertise during and after the project\n•	Participation in the Dissemination of the project information\n•	Promotion of the information about the project to our network of contacts\n•	Contribution to exploitation and sustainability of the project results'),(10,82,44,'Limerick Institute of Technology','University of Limerick Mathematics Learning Centre','Castletroy, Limerick','Limerick','Irealnd','https://ulsites.ul.ie/mlc/#','Olivia Fitzmaurice','University','','Olivia.Fitzmaurice@ul.ie','The purpose of the MLC is to provide mathematics learning support to all students studying mathematics in the university in a supportive, non-threatening environment. The drop-in centre provides one to one support on a daily basis for 20 hours a week, in addition to support tutorials and examination preparation.','We will facilitate the dissemination of the project resources by providing links to the project on our website.'),(11,78,42,'Kauno technologijos universitetas','VšĮ \"eMundus\"','Saulės 22-17','Kaunas','Lithuania','www.emundus.eu','Neringa Kelpšaitė','Public institution','','neringa@emundus.lt','Public institution “eMundus” was established in 2009 in order to streamline research and implementation activities in the area of education and the use and adaptation of information and communication technologies in different spheres. Since the beginning of 2012 the vision was supplemented taking very important aspect for the society development - cultural and healthy lifestyle promotion.','Institution maintains a lot of relationship with universities, schools, pre-schools, VET institutions, as well educational networks, also we develop educational projects with Universities, therefore we have all possibilities to disseminate project’s results in the way:\n- During the meetings with Universities\n- Seminars, conferences\n- International meetings\n- Articles on website, facebook'),(12,78,42,'Kauno technologijos universitetas','Lithuanian Association of Distance and e-Learning (LieDM Association)','K. Donelaičio g. 58','Kaunas','Lithuania','http://liedm.net/','Vida Drąsutė','Association','','vida@liedm.net','Lithuanian Association of Distance and e-Learning (LieDM association) is a volunteer organization which unites all Lithuanian science, study, and education institutions which implement distance teaching and learning. It was created in January 2010 based on agreements of the member institutions. The association maintains and develops the activities of LieDM network, makes use of its possibilities and services that are implemented centrally. According to the statute of LieDM association, the members of the association could be:\n- Lithuanian science, study and education institutions;\n- other institutions, implementing distance and e. learning in their practice.\nAt the moment (01/2019) LieDM association consists of 49 institutions.','- It will promote the project aims, activities, results for schools involved (via email, during the face-to-face meetings)\n- It will spread information about project events in its network\n- It will share online information about project in liedm.net website'),(13,80,54,'Fundatia EuroEd','Alexandru Ioan Cuza University of Iasi','Str. Toma Cozma, nr. 3, 700554, Iaşi, jud. Iaşi, România','Iasi','Romania','https://www.uaic.ro/','Maunela Miron','University','','mironmanuela@yahoo.com','Alexandru Ioan Cuza University of Iaşi is the oldest higher education institution in Romania. Since 1860, the university has been carrying on a tradition of excellence and innovation in the fields of education and research. With over 24.000 students and 700 academic staff, the university enjoys high prestige at national and international level and cooperates with 500 universities world-wide.\nThe Faculty of Mathematics has been functioning since 1860, when Alexandru Ioan Cuza University of Iasi was founded. Initially, it was a department within the Faculty of Philosophy, then within the Faculty of Sciences, and afterwards it became an independent faculty.','Exchange of experience and expertise during and after the project\nParticipation in the Dissemination of the project information\nPromotion of the information about the project to our network of contacts\nContribution to exploitation and sustainability of the project results'),(14,80,54,'Fundatia EuroEd','Colegiul National de Arta “Octav Bancila”, Iasi','România, Judeţ Iaşi, Cuza Voda street, no 29','Iaşi','România','http://cnaob.org/','Gheorghe Gheorghita-Vornicu','Public school','','cnaob.is@gmail.com','Public school \nCreating a positive climate of relationship between students-teachers-family-community through actions aimed at:\n• highlighting the initiative\n• developing the creative potential\n• achieving harmony at the personality level\n• combining theoretical and artistic training','•	Exchange of experience and expertise during and after the project\n•	Participation in the Dissemination of the project information\n•	Promotion of the information about the project to our network of contacts\n•	Contribution to exploitation and sustainability of the project results'),(15,80,54,'Fundatia EuroEd','Ion Ionescu de la Brad University of Agricultural Sciences and Veterinary Medicine from Iasi','ALEEA MIHAIL SADOVEANU 3','Iasi','Romania','www.uaiasi.ro','Liviu Miron','Higher education institution (tertiary level)','','livmiron@yahoo.com','University of Agricultural Sciences and Veterinary Medicine Iaşi is a governmental agricultural and medical veterinary university, certified IQNet and SRAC for implementing and maintaining a quality management system which fulfils the requirements of the ISO 9001:2008 standard. The University of Agricultural Sciences and Veterinary Medicine Iaşi is a specialized instituton of superior agronomic and veterinary medicine training, financed by the state and having as fundamental mission the formation of agricultural, horticultural and animal husbandry engineers, economic engineers in agriculture and veterinary surgeons. \nOur university represents a serious partner, recognized by many European universities and instances in the field of activity. Our university has 159 persons representing teaching staff and researchers; they teach almost 4200 students.','Support the objectives of the project\nGet part of the project network of EU institutions\nOffer input/feedback/strategies as examples of best practices\nSupport the dissemination of the project'),(16,82,44,'Limerick Institute of Technology','University of Chemistry and Technology Prague','Technicka 5, Prague 6, CZ-16628','Prague','Czeck Republic','www.vscht.cz','PetrHolzhauser','University','','petr.holzhauser@vscht.cz','The University of Chemistry and Technology Prague is a natural centre of first-rate study and research in the area of chemistry in Czechia and is one of the country\'s largest educational and research institutions focused on technical chemistry, chemical and biochemical technologies, material and chemical engineering, food chemistry and environmental studies. UCT Prague has also long tradition of organisation of training for pre-service and in-service secondary school science teachers.','UCT Prague would like to act as an associated partner of the MathE project, mainly by disseminating the ideas and outputs of the project.'),(17,78,42,'Kauno technologijos universitetas','VšĮ \"Trakų švietimo centras\"','Birutės g.46, Trakai','Trakai','Lithuania','http://trakaisc.lt','Danutė Vizmanaitė','Educational centre','','centras.trakai@gmail.com','The main area of activity of the institution is education.\n\nThe vision of the center is to become a flexible, modern, learning institution, able to understand the needs and expectations of each person, young or senior, experienced and inexperienced, and to help the community of the region to search, create, learn and improve together.\n\nThe mission of the center is to meet the needs of teachers and other professions of Trakai district and Vilnius region for qualification improvement, non-formal education, to promote the development of learning communities and implementation of educational priorities and innovations in institutions, to disseminate good practice and meet cognitive needs.\n\nThe aim of the activity is to satisfy the public interest through education, training and cultural activities, strengthening of healthy lifestyle skills, environmental protection, provision of social and legal assistance and other activities beneficial to the society.','Will share the results of the project during the seminars, online. \nWill help to reach wider auditorium for dissemination.'),(18,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Liceo Statale “E. Amaldi”','Via Mameli, 9 – 15067 NOVI LIGURE (AL)','Novi Ligure   (AL)','Italy','www.amaldinovi.gov.it','Daniela Novelli','High School','','novellid@hotmail.it','Liceo Statale “E. Amaldi”  is a High School with  different curricula: Scientific, Applied Sciences, Sport, Classic, Linguistic, Human Sciences. There are around 300 students, age 14-19. The School Director is Giampoalo Bovone.','The students of the last year can use the mathE Platform to test their preparation towards the University'),(19,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Liceo Scientifico Enrico Fermi - Genova','Via Ulanowski 56, 16151 Genova','Genova','Italy','http://www.fermi.edu.it','Michele Lattarulo','High School','','dirigente@fermi.edu.it','Liceo Statale “E. Fermii”  is a High School with  different curricula: Scientific and Biomedical. There are around 300 students, age 14-19. The School Director is Michele Lattarulo.','The students of the last year can use the mathE Platform to test their preparation towards the University'),(20,82,44,'Limerick Institute of Technology','Athlone Institute of Technology','Dublin Road, Athlone, Co. Westmeath, Ireland, N37 HD68','Athlone','Ireland','http://www.ait.ie','Michelle McKeon-Bennett','Third Level Higher Educational Institute','','mmckeonbennett@ait.ie','Athlone Institute of Technology (AIT) is an award-winning, research led, higher education institution located in the heart of Ireland and is committed to academic excellence in teaching and research. AIT is Ireland\'s top-ranked institute of technology and has been named Institute of Technology of the Year in 2018 &amp; 2020 and is the top ranked Institute of Technology in Ireland in 2021 (The Sunday Times, Good University Guide). AIT is the leader in the Institute of Technology sector in innovation, applied teaching and student welfare with our strength coming from identifying areas of skills shortage and working with businesses to improve links between enterprise and academia.\nAIT has recently submitted an application for Technological University Status, along with our partner institute Limerick Institute of Technology and hope to transition to this status on September 1st 2021. AIT is also a partner institute in the new European University designated as RUN-EU with seven other European partner institutes enabling greater staff and student mobility as well as greater regional development through innovation and research across a European Network.\nThe Institute is home to nearly 7,000 students from 84 nations around the globe who are undertaking a broad range of programmes in the domains of business, data analytics, management, entrepreneurship, hospitality, tourism, engineering, informatics, science, health, social science and design. The Institute’s global focus is also evident in the 230 partnerships and agreements it has signed with universities and research institutions around the world.','We will encourage our lecturers and students to register on the project portal and join the Community of Practice - to enhance the teaching and learning of mathematics using the project resources. The Teaching and Learning Unit within AIT will engage with this Community of Practice to co-ordinate and encourage staff and student engagement in a structured format with measurable outputs to the Project Team.'),(21,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Liceo M.L.King','via Sturla 63','Genova','Italy','https://liceoking.it','Sara Zaccaria','Classic, Scientific and Sport High School','','zaccaria@liceoking.it','Liceo King is an High school with different curricula” Classic, scientific, Sport with some  classes specialised in Digital aspects and Scientific Labs. There are about 950 students are aged 14-19.  The School Director is Gianfranco Spaccini.','The activity of MathE can be used by the teachers of the students of the last year. In the web page of the  School link to the results go the Project will be published.'),(22,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Liceo Nicoloso Da Vigo','Via Don Giovanni Minzoni, 1 - 16035 Rapallo (Genova)','Recco, Rapallo','Italy','https://www.davigonicoloso.edu.it','','Scientific, Classic, Linguistic High school','','','',''),(23,82,44,'Limerick Institute of Technology','Waterford Institute of Technology','Main Campus. Cork Road, Waterford','Waterford','Ireland','https://www.wit.ie','Dr Ken Thomas','Higher Education and Research','','kthomas@wit.ie','WIT is the major provider of higher education in the South-east region of Ireland and one of the largest Institutes of Technology in the country. The Institute\'s range and scope reflect the changing needs of the South-East as well as the country as a whole. The range of academic programmes is exceptionally extensive, ranging from Higher Certificate right through to postdoctoral research, and covering the Humanities, Health and Nursing, Science and Informatics, engineering and Architecture and Business Education.','Providing a caring and supportive learning environment for its students is central to WIT\'s ethos. The range and quality of student support services is excellent. Examples include the Student Life and Learning Unit and their Maths Learning Centre that is used extensively by our Engineering, Science and Computing students. We plan to provide access to the MathE project resources via this Maths Learning Centre. We will also share the materials directly with all our Maths and Applied Maths lecturers, particularly those involved with Year 1 and Year 2 students .'),(24,82,44,'Limerick Institute of Technology','Institute of Technology Carlow','Kilkenny Road, Co. Carlow R93V960','Carlow','Ireland','www.itcarlow.ie','Dr. Gina Noonan, Head of Centre for Teaching and Learning','Higher Education Institute','','Gina.noonan@itcarlow.ie','IT Carlow is an established higher education institution based in the South East of Ireland comprising over 10,000 students. It is dedicated to excellence in undergraduate and postgraduate education and to creating long-term national and international partnerships in a manner consistent with our stated strategic goals. A national leader in Life Long Learning, the Institute is  partnering with Waterford Institute of Technology to form the first Technological University in the South East, www.tusei.ie','Institute of Technology Carlow has an excellent Teaching &amp; Learning centre that works with academic staff to improve the student learning experience with training, workshops, seminars and resources. This will be a conduit for the dissemination of project results, which will also be made available on the T&amp;L website. The centre supports learners through its dedicated Maths Support Centre, where resources and project findings can be disseminated across the Institute.\nIT Carlow - Teaching &amp; Learning Centre'),(25,77,55,'Gheorghe Asachi Technical University of Iasi','Faculty of Economics and Business Administration, Iasi','22, Carol I Boulevard, Iaşi RO – 700505','Iasi','Romania','https://www.uaic.ro/en/studies/faculties/faculty-economics-business-administration/','Teodora Roman','Education','','teodoraroman@gmail.com','The Faculty of Economics and Business Administration (FEBA) of Alexandru Ioan Cuza University of Iași is one of the most dynamic faculties in terms of educational  programmes, number of students, academic staff qualification and quality of facilities.\nThrough its 11 undergraduate degree  programmes, the Faculty of Economics and Business Administration offers its students good opportunities to acquire knowledge and skills in a large number of professions in economics, business administration and public administration. The faculty also offers a  large number of both full-time and part-time professional master’s degree  programmes, as well as doctoral programmes in economics and business administration.','The students from the Faculty of Economics and Business Administration of Iasi will use MathE platform for self-assessment and final-assessment and the Library of MathE for improving the learning process.'),(26,77,55,'Gheorghe Asachi Technical University of Iasi','Faculty of Mathematics','11, Carol I Boulevard, Iaşi RO – 700506','Iasi','Romania','https://www.uaic.ro/en/studies/faculties/faculty-mathematics/','Razvan-Dinu Litcanu','Education','','litcanu@uaic.ro','The Faculty of Mathematics has been functioning since 1860, when Alexandru Ioan Cuza University of Iasi was founded. Initially, it was a department within the Faculty of Philosophy, then within the Faculty of Sciences, and afterwards it became an independent faculty.\nThroughout the years, the great tradition maintained by the Faculty of Mathematics of Iași has contributed to new research directions initiated by famous personalities (A. Myller, O. Mayer, C. Popovici, S. Sanielevici, M. Haimovici, A. Haimovici, D. Mangeron). The mathematicians of the school of Iași, who were also outstanding professors, have placed the faculty amongst the most prestigious in the country.','The students from the Faculty of Mathematics of Iasi will use MathE platform for self-assessment and final-assessment and the Library of MathE for improving the learning process.');
