INSERT INTO `news` VALUES (40,'The MathE project','<p>\r\n	The MathE project has been funded, by the&nbsp;<a href=\"http://eacea.ec.europa.eu/erasmus-plus_en\" target=\"_blank\">European Commission</a>&nbsp;through the&nbsp;<a href=\"https://erasmusmais.pt/\" target=\"_blank\">Portuguese National Agency for the Erasmus+ Programme</a>, with the aim of enhancing the quality of teaching and improving pedagogies and assessment methods. The project is based on the assumption that students of scientific and economics subjects at higher education level often lack the basic math skills to effectively follow their lectures. The project aims at: Facilitating the identification of students&rsquo; gaps in Math; Providing Math teachers with appropriate digital sources; Enhancing transnational sharing of innovative teaching sources.</p>\r\n','2018-10-29 12:24:00'),(42,'New Perspectives in Science Education','<p>\r\n	The MathE project was presented in the framework of the eight edition of the <a href=\"https://conference.pixel-online.net/NPSE/virtual_presentation_scheda.php?id_abs=3810\">New Perspectives in Science Education </a>conference held in Florence on 21 - 22 March 2019.</p>\r\n','2019-03-25 17:03:00'),(43,'Kick-off meeting','<p>\r\n	The Kick-off meeting took place in Florence on 29 &ndash; 30 October 2018. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the project and the activities to be carried out. The meeting was also an opportunity for the partners to get to know each other and to discuss all details related to the project&#39;s activities. The partners presented the institutions involved. At the end of the meeting all the partners had a clear view of the future project&#39;s implementation, the financial rules and the next activity which is the development of the assessment tools.</p>\r\n','2018-11-02 17:30:00'),(44,'Lecturers Involvement','<p>\r\n	<a href=\"http://localhost/mathe/www/PRTN_lecturers.php\">Lecturers </a>are currently being involved in the 4 European countries. They will:<br />\r\n	- Participate in the creation of the questions for the assessment tools<br />\r\n	- Test the assessment tools<br />\r\n	- Contribute to the creation of the contents of the MathE library:<br />\r\n	- Test with students the contents of the MathE library<br />\r\n	- Participate in the Community of Practice</p>\r\n','2018-12-12 17:36:00'),(45,'Students Involvement','<p>\r\n	Paediatric Students are currently being involved in the 5 European countries. They will:<br />\r\n	- Test the Need Assessment Tool<br />\r\n	- Be assessed trough the Student Assessment Tool<br />\r\n	- Make use of the contents of the MathE library:<br />\r\n	- Participate in the Community of Practice</p>\r\n','2019-01-16 17:40:00'),(46,'Self Need Assessment','<p>\r\n	The self need assessment tool is currently under development. Students will have the possibility to test their knowledge related to:&nbsp;Manipulation of algebraic expressions;&nbsp;Real Functions of a single variable;&nbsp;Integration;&nbsp;Matrix and determinats;&nbsp;Linear systems;&nbsp;Graphs;&nbsp;Optimization;&nbsp;Statistics;&nbsp;Real Functions of several variables;&nbsp;Differential equations.</p>\r\n','2019-02-21 17:53:00'),(47,'Second Partners\' Meeting','<p>\n	The second meeting took place in Kaunas on 23 – 24 May 2019. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the Self Need Assessment and Final Assessment Tools in order to assess them and to make the final adjustments. The meeting was also the opportunity for the partners to discuss the next activity which is the development of the MathE library.</p>','2019-06-06 17:36:00'),(48,'Third Partners\' Meeting','<p>\n	The third meeting took place in Limerick on 2 – 3 December 2019. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the current situation for Self-Need Assessment and Final Assessment Tools. The meeting was also the opportunity for the partners to discuss the review of the video lesson and to plan the creation of new video lessons.</p>','2019-12-05 15:07:00'),(49,'Final Assessment','<p>\r\n	The Final Assessments&nbsp;allows teachers to elaborate exams for their students on the topics they wish to evaluate.&nbsp;</p>\r\n','2019-09-19 15:11:00'),(50,'Video Reviews','<p>\r\n	Project partners started working on the creation of the collection of <a href=\"http://localhost/mathe/www/MALI_VC.php\">video lessons</a> on the selected Math topics. The already existing video lessons are reviewed and linked to the questions of the self-assessment tool. The aim is to provide university students with a specific support when they fail the test.</p>\r\n','2019-11-06 15:16:00'),(51,'Fourth Partners\' Meeting (Online)','<p>\r\n	The fourth meeting took place online on 25 June 2020. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the current situation for Self-Need Assessment, Final Assessment Tools and video Library. The meeting was also the opportunity for the partners to present the Community of Practice.</p>\r\n','2020-06-25 10:06:00'),(52,'Fifth Partners\' Meeting (Online)','<p>\r\n	The fifth meeting took place online on 21 December 2020. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the current situation for Self-Need Assessment, Final Assessment Tools and video Library. The meeting was also the opportunity for the partners to present the Community of Practice and to define the related calendar of activities.</p>\r\n','2020-12-21 10:24:00'),(53,'Sixth Partners\' Meeting (Online)','<p>\n	The sixth meeting took place online on 23 June 2021. Ana Pereira from IPB (PT) and Lorenzo Martellini from Pixel (IT) presented to the partners the current situation for the intellectual outputs. The three of them are completed and available for the target groups on the project website. The meeting was also to discuss and present the impact of COVID on project activities and related impact on the project budget.</p>','2021-06-23 10:30:00'),(54,'Video Lessons','<p>\r\n	Thanks to their experience project partners were able to identify the math topics on which students&#39; have difficulties. Based on this information project partners are now enriching the collection of <a href=\"http://localhost/mathe/www/MALI_VC.php\">video lessons</a> with the lessons they specifically created for the project.</p>\r\n','2020-01-21 11:19:00'),(55,'Definite integrals envolving trigonometric functions','<p>\r\n	The video lesson &quot;&nbsp;Definite integrals involving trigonometric functions&quot; is available on the project portal and on the <a href=\"https://youtu.be/_EFIgUfKwLo\">YouTube channel</a> of the project.&nbsp;In this video lesson, an exercise about definite integrals with trigonometric functions (tangent and secant) is solved.</p>\r\n','2020-02-01 11:35:00'),(56,'Resolution of a linear system with parameters','<p>\n	The video lesson \"Resolution of a linear system with parameters\" is available on the project portal and on the <a href=\"https://www.youtube.com/embed/ysSBLLYM5DA\">YouTube channel</a> of the project. In this video we show how to use the Gauss method to solve a linear system with one or more parameters</p>','2020-03-01 11:41:00'),(57,'Statistics - Stem and leaf diagram vs histogram','<p>\n	The video lesson \"Statistics - Stem and leaf diagram vs histogram\" is available on the project portal and on the <a href=\"https://www.youtube.com/embed/9P27VrdiyIM\">YouTube channel</a> of the project. The video explains how to visualise the data distribution, using the stem and leaf diagram or the histogram</p>','2020-04-24 11:47:00'),(58,'Math is the hidden secret to understanding the world','<p>\n	The video lesson \"<a href=\"http://localhost/mathe/www/MALI_VC.php\">Math is the hidden secret to understanding the world</a>\" is available on the project portal of the project by searching for statistics video lessons.Unlock the mysteries and inner workings of the world through one of the most imaginative art forms ever -- mathematics -- with Roger Antonsen, as he explains how a slight change in perspective can reveal patterns, numbers and formulas as the gateways to empathy and understanding.</p>','2020-05-14 11:57:00'),(59,'Teaching Material','<p>\r\n	The <a href=\"http://localhost/mathe/www/MALI_TM.php\">teaching material </a>section is available on the project portal. The section provides the university students with a complete set of tools to reinforce their knowledge about the specific math topics addressed by the MathE project. The tools include Article, Blog, Diagrams and graphs, Exercises, Multiple choice questionnaire, Podcasts, Problem Based Activity, and Slides.</p>\r\n','2020-07-23 12:24:00'),(60,'Lecturers\' Community','<p>\r\n	The online Lecturers&#39; Community of Practice is available on the project portal. The aim is to foster the exchange of teaching experiences among math teachers. All lecturers registered on the portal have the possibility to participate in the online discussions and share their ideas with the other colleagues.</p>\r\n','2021-01-20 12:34:00'),(61,'Students\' Online Comunity','<p>\n	The online <a href=\"http://localhost/mathe/student-forum/public/">Students\' Community of Practice</a> is available on the project portal. The aim is to foster the exchange of experiences among math students registered on the platform and have a direct contact with the lecturers to receive guidance and suggestions.</p>','2021-02-09 12:46:00');
