INSERT INTO `platform__SFA__assquestions` VALUES (14,26,3,0.00,'',25,0,'Consider in the three-dimensional cartesian system the points $A=(1, -2, 2)$, $B=(3, 0, 1)$, $C=(2, 1, 2)$ and $D=(3, -2, 0)$. \r\nThe point $P$ of intersection of the line $AB$ with the perpendicular bisector of the line segment $[CD]$ has cartesian coordinates: ','Advanced','$\\bigg(2, -1, \\dfrac{3}{2}\\bigg)$','$(4, -2, 3)$','$\\bigg(\\dfrac{5}{2}, -\\dfrac{1}{2}, 1\\bigg)$','$(2, 2, -1)$ ','',''),(15,26,3,0.00,'',25,0,'Consider the vectors $u=(2, 0, 1)$ and $v=(3, -1, 1)$ of $\\mathbb{R}^3$. The vectors of magnitude $6$ that are orthogonal to the vectors $u$ and $v$ are:','Advanced','$(\\sqrt{6}, \\sqrt{6}, -2\\sqrt{6})$ and $(-\\sqrt{6}, - \\sqrt{6}, 2\\sqrt{6})$','$(6, -6, -12)$ and $(-6, 6, 12)$ ','$(3, 3, -6)$ and $(-3, -3, 6)$','$(\\sqrt{6}, \\sqrt{6}, -2\\sqrt{6})$','',''),(16,26,3,0.00,'',10,0,'Simplify the expression\r\n\r\n$\\dfrac{1+i}{1-i}-(1+2i)(2+2i)+\\dfrac{3-i}{1+i}$.','Advanced','$3-7i$','$3+7i$','$-3+7i$','$-3-7i$','',''),(17,26,3,0.00,'',16,0,'Find the general solution of the differential equation:\r\n\r\n$x\'\'\'-3x\'\' +7x\'-5x=\\operatorname{e}^{t}\\cos( 2t)+t\\operatorname{e}^{t}$','Advanced','$x(t)=C_{1}\\operatorname{e}^{t}+C_{2}\\operatorname{e}^{t}\\cos (2t)+C_{3}\\operatorname{e}^{t}\\sin (2t)+\\frac{1}{8}t^{2}\\operatorname{e}^{t}-\\frac{1}{8}t\\operatorname{e}^{t}\\cos (2t),\\,C_{1}, C_{2}, C_{3}\\in \\mathbb{R}$','$x(t)=C_{1}\\operatorname{e}^{t}+C_{2}\\operatorname{e}^{t}\\cos (2t)+C_{3}\\operatorname{e}^{t}\\sin (2t)+\\frac{1}{8}\\operatorname{e}^{t}-\\frac{1}{8}t\\operatorname{e}^{t}\\cos (2t),\\,C_{1}, C_{2}, C_{3}\\in \\mathbb{R}$','$x(t)=C_{1}\\operatorname{e}^{t}+C_{2}\\operatorname{e}^{t}\\cos (2t)+C_{3}\\operatorname{e}^{t}\\sin (2t)+t^{2}\\operatorname{e}^{t}-\\frac{1}{8}t\\operatorname{e}^{t}\\cos (2t),\\,C_{1}, C_{2}, C_{3}\\in \\mathbb{R}$','$x(t)=C_{1}e^{t}+C_{2}t\\operatorname{e}^{t}\\cos (2t)+C_{3}t\\operatorname{e}^{t}\\sin (2t)+t^{2}\\operatorname{e}^{t}-t\\operatorname{e}^{t}\\cos (2t),\\,C_{1}, C_{2}, C_{3}\\in \\mathbb{R}$','',''),(18,26,3,0.00,'',5,0,'Find $\\displaystyle\\int_{}\\int_D 3x+4y^2 dA$ in the upper half of the plane ($\\displaystyle y \\geq 0$) and between the curves $\\displaystyle x^2+y^2=1$ and $\\displaystyle x^2+y^2=4$','Advanced','$\\displaystyle \\frac{15\\pi}{2}$ \r\n','$\\displaystyle \\frac{22\\pi}{3}$ \r\n','$\\displaystyle \\frac{16\\pi}{2}$\r\n','$\\displaystyle \\pi$','',''),(20,26,3,0.00,'',5,0,'Change the order of integration of $\\displaystyle \\int_{0}^{1}\\int_{-\\sqrt{1-y^2}}^{1-y}x^2+y^2\\, dx dy$. ','Advanced','$\\displaystyle \\int_{-1}^{0}\\int_{0}^{\\sqrt{1-x^2}}x^2+y^2\\, dy dx + \\int_{0}^{1}\\int_{0}^{-x+1}x^2+y^2 \\, dy dx$ \r\n','$\\displaystyle \\int_{0}^{1}\\int_{-\\sqrt{1-y^2}}^{1-y}x^2+y^2\\, dy dx$ \r\n','$\\displaystyle \\int_{-1}^{0}\\int_{0}^{\\sqrt{1-x^2}}x^2+y^2\\, dy dx$\r\n','$\\displaystyle \\int_{0}^{\\sqrt{1-x^2}}\\int_{-1}^{0}x^2+y^2\\, dy dx + \\int_{0}^{-x+1}\\int_{0}^{1}x^2+y^2\\, dy dx$','',''),(21,26,3,0.00,'',17,0,'The figure displays an irrigation system for a small flowerbed. A, B and C are water sprinklers. Assume that, for water to get from X to Y, it can go either through A and B, or through C, or both ways. Water can only get through if the sprinklers are working, according to the following probabilities: $P(A)=95\\%$, $P(B)=95\\%$, $P(C)=90\\%$. Calculate the probability of water getting through from X to Y.','Advanced','0.990\r\n','0.088\r\n','0.090\r\n','0.010','irrigation.jpeg','jpeg'),(22,26,3,0.00,'',14,0,'Given the sample data: \r\n\\begin{array}{ |r|c|c|} \r\n \\hline\r\n  &\\text{ Group I}& \\text{ Group II}\\\\   \\hline\r\n\\text{Sample size}&90&85\\\\\r\n\\text{Mean}&70&60\\\\\r\n\\text{Standard deviation}&8&8 \\\\   \\hline\r\n\\end{array}\r\nWhich hypothesis should be tested for verifying if the group I has a higher mean score than the group II?\r\n','Advanced','$H_0: \\mu_I = \\mu_{II}$ v.s. $H_a:  \\mu_I >  \\mu_{II}$.','$H_0: \\sigma^2_I =\\sigma^2_{II}$ v.s. $H_a: \\sigma^2_I >\\sigma^2_{II}$.','$H_0: \\mu_I > \\mu_{II}$ v.s. $H_a:  \\mu_I \\leq \\mu_{II}$.','$H_0: \\mu_I = \\mu_{II}$ v.s. $H_a:  \\mu_I \\neq \\mu_{II}$.','',''),(23,26,3,0.00,'',3,0,'Calculate\r\n\\[\r\n\\lim_{x\\to+\\infty} \\frac{\\cos (x+[x]) - \\sin(x-[x])}{x+[x]},\r\n\\]\r\nwhere $[x]=\\max\\{n\\in\\mathbb{Z}:n\\le x\\}$ denotes the integer part of $x$.','Advanced','$0$','$+\\infty$','$-\\infty$','the limit does not exist','',''),(24,26,3,0.00,'',18,0,'Indicate which of the following set of vectors is a spanning set of $\\mathbb{R}^2$.','Basic','$\\left\\{(1,2),(0,1),(2,2)\\right\\}$','$\\left\\{(1,1),(-2,-2),(3,3)\\right\\}$','$\\left\\{(3,0)\\right\\}$','$\\left\\{(-1,3),(3,-9)\\right\\}$','',''),(25,37,6,1.00,'',7,0,'Find the root of $f(x) = 8x^2-4x+2$.','Basic','Impossible to solve in R.','$x= 0.18 V x=-0,68$','All wrong','$x= 0.31 V x=-0.81$','',''),(26,37,6,2.00,'',7,0,'Find the root of $f(x)=4x-12$.','Basic','$x=3$','$x=-3$','$x=4$','$x=16$','',''),(27,37,4,2.00,'',7,0,'Find the root of $f(x) = 8x^2-4x+2$.','Basic','Impossible to solve in R.','$x= 0.18 V x=-0,68$','All wrong','$x= 0.31 V x=-0.81$','',''),(28,37,4,1.00,'',7,0,'Find the root of $f(x)=4x-12$.','Basic','$x=3$','$x=-3$','$x=4$','$x=16$','',''),(29,37,7,0.00,'',7,0,'Find the root of $f(x)=4x-12$.','Basic','$x=3$','$x=-3$','$x=4$','$x=16$','',''),(30,37,8,1.00,'',7,0,'Find the root of $f(x)=4x-12$.','Basic','$x=3$','$x=-3$','$x=4$','$x=16$','',''),(31,52,12,2.00,'',18,0,'Find all the values of $x$ so that the matrix $A=\\left( \\begin{array}{rrrr}  \r\n1  & x & 0 & 0 \\\\ \r\n0 & -1 & 0 & 2\\\\\r\n0 & 0 & 2 & x\\\\\r\n0  & 1 & x & 0\\end{array}\r\n\\right)$ \r\nis a singular matrix.','Basic','$2$ and $-2$ ',' $0$',' $1$',' $-1$','',''),(32,52,12,2.00,'',18,0,'The value of determinant changes the sign when','Basic','two rows are interchanged','a multiple of one row is added to another row','a row is multiplied by $k>0$','a matrix is mul