INSERT INTO `platform__SFA__questions` VALUES (1,37,'',7,2,'Find the root of $f(x)=4x-12$.','Basic','$x=3$','$x=-3$','$x=4$','$x=16$',NULL,NULL,'2019-09-17 16:42:48',0,NULL,NULL),(2,41,'',14,0,' The Statistical Department reported that all the persons that emigrated from the country in a given year, $25 \\%$ were not more than 30 years old. What does this statement mean?','Basic','The lower quartile is 30 years.','The upper quartile is 30 years.','The median is 30 years',' The mean is 30 years.',NULL,NULL,'2019-09-18 11:30:52',1,'2019-11-27 13:19:15',38),(3,41,'',14,0,'In the recent study, 10 households were asked about their monthly spending (in euros) on heating, which are: \r\n100, 80, 55, 91, 40,85, 60, 76, 58, 94. What is the average monthly spending?','Basic','73.90.','78.','74.','80.',NULL,NULL,'2019-09-18 11:33:45',1,'2019-11-27 13:20:39',38),(4,41,'',14,0,'The children\'s therapist  wants to know the average weight of newborns in their country. The sample of 100 newborns was randomly chosen from the database of 5 hospitals. What is the variable of interest in this study?','Basic','The weight of a newborn baby.','5 hospitals of the country.','All the newborns in the country.','100 newborns.',NULL,NULL,'2019-09-18 11:37:13',1,'2019-11-27 13:21:06',38),(5,41,'',14,0,'There were 1000 participants in the Christmas Marathon Run. A cardiologist measured the heart rate of 50 randomly chosen participants after the run. The mean heart rate was 90 and the standard deviation was 15. Choose the correct statement.','Basic','The sample is 50 runners, the population is 1000 runners.','The sample is 1000 runners, the population  is 50 runners.','The sample is 1050 runners.','The population is 1050 runners.',NULL,NULL,'2019-09-18 11:39:45',1,'2019-11-27 13:21:49',38),(6,41,'',14,0,'A class of 50 students  was taking a 100 points test for Statistics, English, Physics  and  Information Technology subjects. The following information was obtained:\r\n\\begin{array}{ |r|c| c| c|}