-axis). $R$ is bounded by the curves:\r\n\\begin{align*}\r\n   \\displaystyle y =x^2 ;\\qquad y=0 ;\\qquad  x=3\r\n\\end{align*}','Basic','$\\dfrac{243\\pi}{5}$ cubic units','$\\dfrac{150\\pi}{7}$ cubic units','$\\dfrac{333\\pi}{4}$ cubic units','$\\dfrac{200\\pi}{3}$ cubic units',NULL,NULL,'2020-10-10 12:43:26',1,'2020-11-23 20:22:04',38),(519,1666,'',5,44,'Find the volume of the revolution solid (obtained from the rotation of the region $R$ around around the $y$-axis). $R$ is bounded by the curves:\r\n\\begin{align*}\r\n   \\displaystyle y =2-x ;\\qquad x=y ;\\qquad x=0\r\n\\end{align*}','Advanced','$\\dfrac{2\\pi}{3}$ cubic units','$\\dfrac{\\pi}{6}$ cubic units','$\\dfrac{\\pi}{7}$ cubic units','$\\dfrac{\\pi}{2}$ cubic units',NULL,NULL,'2020-10-10 12:44:29',1,'2020-11-23 20:22:09',38),(520,1666,'',5,44,'Find the volume of the revolution solid (obtained from the rotation of the region $R$ around around the $y$-axis). $R$ is bounded by the curves:\r\n\\begin{align*}\r\n   \\displaystyle x=\\sqrt{y} ;\\qquad y=2 ;\\qquad y=6 ;\\qquad x=0\r\n\\end{align*}','Basic','$16\\pi$ cubic units','$10\\pi$ cubic units','$20\\pi$ cubic units','$5\\pi$ cubic units',NULL,NULL,'2020-10-10 12:45:18',1,'2020-11-23 20:22:14',38),(521,38,'',5,44,'Find the area of the planar region given by\r\n$y\\geq x^2$ and $y\\geq 4$ and $y\\leq 9$ and $x\\geq 0$','Basic','$\\displaystyle \\frac{38}{3}$u.a.','$\\displaystyle \\frac{22}{3}$u.a.','$\\displaystyle 22 $u.a.','All the other answers are wrong',NULL,NULL,'2020-11-23 20:39:21',1,'2020-11-23 20:41:58',38),(522,38,'',18,7,'Considera as seguintes matrizes: $A_{2\\times 4}$, $B_{2\\times 3}$ e $C_{4\\times 3}$.\r\n\r\nEscolha a verdadeira:','Basic','As seguintes operações são possíveis: $A-B\\times C^T$.','As seguintes operações são possíveis: $A^T\\times  B + C^T$.','As seguintes operações são possíveis: $A\\times B\\times C$.','As seguintes operações são possíveis: $A-B^T\\times C$.',NULL,NULL,'2020-12-28 18:17:05',0,NULL,NULL),(523,38,'',