 properties, including the irrationality of the Euler\'s number e and the definitions in the complex plane.','','key_2_','key_','key_39_37_','key_190_182_','key_83_85_86_673_674_676_677_678_679_680_681_682_689_692_693_694_918_983_984_','LA FUNZIONE ESPONENZIALE.pdf','pdf','2020-05-20 11:58:49',1,'2020-06-17 16:15:58',64),(12,42,'The trigonometric functions','Simone Di Marino','key_9_','In this note we define the trigonometric functions (sine, cosine, tangent and cotangent) and discuss their basic properties and identities, including the product-to-sum and sum-to-product formulas.','','key_1_','key_','key_39_','key_196_190_195_189_','key_86_675_676_683_919_923_925_926_927_928_','trigonometric functions.pdf','pdf','2020-05-25 18:44:21',1,'2020-06-17 16:17:19',64),(13,42,'Functions','Simone Di Marino','key_9_','In this note we define the concept of function between two sets. We also discuss domain, codomain, range, image, counter-image and injectivity, surjectivity and bijectivity.','','key_1_','key_','key_39_','key_192_191_193_189_','key_83_675_676_677_918_922_923_925_926_927_','functions.pdf','pdf','2020-05-25 18:51:48',1,'2020-06-17 16:18:35',64),(14,42,'The definition of limit','Simone Di Marino','key_9_','In this note we discuss the definition of limit of a real-valued function in all its forms.','','key_1_','key_','key_37_','key_182_','key_87_670_671_672_673_678_679_680_681_682_685_686_687_688_693_694_981_982_983_984_','limit definition.pdf','pdf','2020-05-25 18:54:33',1,'2020-06-17 16:19:45',64),(15,42,'The real numbers','Simone Di Marino','key_9_','In this note we introduce the real numbers and discuss their main algebraic properties, as well as the ordering and the completeness.','','key_1_','key_','key_39_','key_189_','key_684_','real numbers.pdf','pdf','2020-05-25 18:57:34',1,'2020-11-09 22:29:38',37),(16,42,'Functions and graphs','Simone Di Marino','key_9_','The focus of this note is the graph of a function. After revising the concepts of injective and surjective functions and the trigonometric functions, the basic transformations of graphs are discussed.','','key_1_','key_','key_39_','key_190_194_197_','key_86_675_676_677_919_923_925_926_927_928_','graph of functions.PDF','PDF','2020-05-25 22:14:28',1,'2020-06-17 16:25:01',64),(17,42,'Basic Exponential and Logarithmic Functions','Simone Di Marino','key_9_','In this note, the exponential and logarithmic functions are introduced and their basic properties are discussed.','no link','key_1_','key_','key_39_','key_190_189_','key_83_86_676_677_918_919_921_922_927_','exponentials and logarithms.pdf','pdf','2020-05-25 22:16:55',1,'2020-06-17 16:26:53',64),(18,42,'Elementary properties of sets','Simone Di Marino','key_9_','In this note we discuss some of the basic operations on sets, including union, intersection, difference, power and cartesian product.','No link.','key_1_','key_','key_39_','key_191_189_','key_83_86_675_676_677_','elementary properties of sets.pdf','pdf','2020-05-25 22:23:45',1,'2020-06-17 16:28:12',64),(19,42,'The real numbers','Giancarlo Mauceri','key_9_','The focus of this note is the set of the real numbers. The main aspects of such set are discussed, including the algebraic and analytical properties.','No link.','key_2_','key_','key_39_','key_191_189_','key_83_675_676_677_683_684_918_922_','NUMERI REALI.pdf','pdf','2020-05-25 22:27:36',1,'2020-06-17 16:30:36',64),(20,38,'Change to polar coordinates in double integration','IPB','key_2_9_','Some notes about the polar coordinates and double integration.',' ','key_1_','key_','key_6_','key_109_','key_609_654_','change_of_variables.pdf','pdf','2020-05-29 23:47:15',1,'2020-06-17 13:38:49',38),(21,67,'Notes on Introduction to The Product Rule ','Dr Rita Scully','key_9_','The notes on Introduction to The Product Rule explain the development of the product rule and how it is used. It includes 2 worked examples. These explanations are of particular use for students who may be finding differentiation or the product