INSERT INTO `platform__lecturers` VALUES (6,26,'info@pinzani.it','Theoretical Physic','Space and Time','None','Nerd, nerder... nerdest!','18','Physic','Cyprus','Florence','Arcetri','str_top25_top10_top16_top4_sub4|3_sub4|42_sub4|4_top7_sub7|1_sub7|2_top22_top5_sub5|44_sub5|6_sub5|5_sub5|43_top18_sub18|8_sub18|9_sub18|11_sub18|7_sub18|10_top26_top12_sub12|12_sub12|13_top17_top3_sub3|39_sub3|37_top15_sub15|41_top27_top14_'),(8,28,'lorenzo@pixel-online.net','Education','Blended Learning','20','Left one is better','11','Blended Learning','Italy','Firenze','Via Luigi Lanzi 12','str_top25_top10_top16_top4_sub4|3_sub4|42_sub4|4_top7_sub7|1_sub7|2_top22_top5_sub5|6_sub5|5_top18_sub18|8_sub18|9_sub18|11_sub18|7_sub18|10_top12_sub12|12_sub12|13_top17_top3_sub3|39_sub3|37_top15_sub15|41_top14_'),(9,37,'apereira@ipb.pt','Optimization. Mathematical Modelling. Learning Innovative Tools ','Calculus. Algebra. Numerical Methods. Applied Math','22','Ana Isabel Pinheiro Nunes Pereira, Coordinator Professor at the Department of Mathematics at Polytechnic Institute of Bragança, is vice-coordinator of Research Centre in Digitalization and Intelligent Robotics (CeDRI) - Polytechnic Institute of Bragança - and member of Algorithm Research Centre – Minho University - in the Systems Engineering and Operational Research (SEOR) R&D group. She is also Coordinator Member of Bragança “Ciência Viva” Science Centre.\r\n\r\nAna I. Pereira got her PhD from Minho University (2006) in ‘Numerical Optimization’ area. She is the author, or co-author, of more than eighty journal papers, book chapters and conference proceedings. She participated in more than ten research projects in the areas of robotics, optimization and innovating tools in teaching. In particularly she was the IPB coordinator of the following projects: Strategic Partnerships Erasmus + KA2  “MathE - Improve Math Skills in Higher Education\" with the aim to promote math in higher education (2018-2021), \"E-Learning from Nature” with the aim of promoting science among secondary students (2015-2017), “Games Laboratory”, financed by Agência Ciência Viva (2013-2015), “Braganca@Science”, financed by Agência Ciência Viva (2013-2016) and “Eureka – Mathematical Games” also financed by Agência Ciência Viva (2006-2008).\r\n\r\nhttps://www.researchgate.net/profile/Ana_Pereira26\r\nResearcherID: F-3168-2010\r\nScopus Author ID: 15071961600\r\nCiência ID: 0716-B7C2-93E4\r\n','1','Mathematics department','','Bragança','Campus de Sta Apolónia',NULL),(10,38,'fflor@ipb.pt','Optimization and applications in industry','Calculus, Linear Algebra, Numerical Methods','20','Professora Adjunta at Instituto Politécnico de Bragança and member of the Research Centre in Digitalization and Intelligent Robotics (CeDRI). She obtained her PhD in Mathematics by University of Minho. Her major research is on Optimization area as well as its application in industry, and in the science communication in the Mathematics area. In this way, she collaborated in some financed projects, for example: Eureka – Mathematical Games (www.eurekit.ipb.pt), Games Laboratory, Braganza@Science and E-learning from nature (enature.pixel-online.org) . \r\n','1','Department of Mathematics','','Bragança','','str_top25_top10_top16_top4_sub4|3_sub4|42_sub4|4_top7_sub7|1_sub7|2_top22_top5_sub5|44_sub5|6_sub5|5_sub5|43_top18_sub18|8_sub18|9_sub18|11_sub18|7_sub18|10_top26_top12_sub12|12_sub12|13_top17_top3_sub3|39_sub3|37_top15_sub15|41_top27_top14_'),(11,39,'rita.scully@lit.ie','','Maths, Measurement, Project Cost Management, Interior Surveying and Quantification','','','2','Built Environment','','','',NULL),(12,41,'lina.dindiene@ktu.lt','Probability theory and statistics','Statistics','7','','4','Faculty of Mathematics and Natural Sciences/Department of Applied Mathematics','','Kaunas','Studentų g. 50','str_sub5|5_top17_sub3|39_sub3|37_'),(13,42,'alberti@dima.unige.it','','Mathematical analysis','','','3','Department of Mathematics','','','','str_top25_top10_sub1