INSERT INTO `pm__dissemination` VALUES (2,8,8,'Pixel','Elisabetta Delle Donne',20181008,0,'Training Seminar','','During the opening day of the  European Project Management international seminar, held in Florence (IT) on 08/10/2018, Elisabetta Delle Donne presented Pixel’s activities and, among these, MathE project. The project’s aims and results were fully explained and it was examined if there was the possibility of further collaboration.','key_3_6_14_','15','Florence',110,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(3,8,8,'Pixel','Andrea Anzanello',20181002,20181002,'Transnational Meetings','','During the transnational meeting of the E-Classes project, held in Sofia (BG) on 02 and 03 October 2018, Andrea Anzanello presented Pixel’s activities and, among these, the Mathe project. The project’s aims and results were fully explained and it was examined if there was the possibility of further collaboration.','key_3_6_10_','13','Sofia',35,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(4,8,8,'Pixel','Antonio Giordano',20181008,0,'Transnational Meetings','','During the transnational meeting of the DC4LT project, held in Trondheim (NO) on 8 October 2018, Antonio Giordano presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_5_14_','12','Trondheim',166,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(8,8,8,'Pixel','Andrea Peraldo',20181004,0,'Transnational Meetings','','During the transnational meeting of the WBL 2.0 project, held in Valencia (ES) on 04 and 05 October 2018, Andrea Peraldo presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_15_','12','Valencia',209,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(6,8,8,'Pixel','Lorenzo Martellini',20181018,0,'Transnational Meetings','','During the transnational meeting of the IWBLabs project, held in Teramo (IT) on 18 October 2018, Lorenzo Martellini presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_3_5_14_','8','Teramo',110,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(7,8,8,'Pixel','Andrea Anzanello',20181022,0,'Training Seminar','','During the Joint Staff Training Event of the GoScience project, held in Vidin (BG) on 22/10/2018, Andrea Anzanello presented Pixel’s activities and, among these, the MathE project. \nThe project’s aims and results were fully explained and it was examined if there was the possibility of further collaboration.','key_5_6_8_14_15_','32','Vidin',35,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(9,8,8,'Pixel','Elisabetta Delle Donne',20181008,0,'Training Seminar','','During the opening day of the  European Project Management international seminar, held in Florence (IT) on 08/10/2018, Elisabetta Delle Donne presented Pixel’s activities and, among these, the name of MathE project. The project’s aims and results were fully explained and it was examined if there was the possibility of further collaboration. \nThe brochure of the project have been distributed to the Participants','key_6_14_','15','Florence',110,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(10,82,44,'Limerick Institute of Technology','Marie Walsh',20181106,20190106,'Other','Face to face discussion','The MathE project and proposed work packages were described to potential lecturers','key_4_','5','Limerick',107,'Five potential lecturers expressed interest in the project.\nA further meeting was planned.',NULL),(11,82,44,'Limerick Institute of Technology','Marie Walsh',20181206,20181206,'Other','Face to face discussion','Lecturers who expressed an interest in the event were given a presentation about the project and the web portal.\nThe planned activities were discussed.','key_4_8_','5','Limerick',107,'Three lecturers decided to take part in the project and also to consult with colleagues who might also join the research group.',NULL),(12,8,8,'Pixel','Elisabetta Delle Donne',20181108,0,'Conference or Fair','','During the 11th edition of the Innovation in Language Learning international conference, held in Florence (IT), on 08/11/2018, some brochures of the name of the Mathe project were distributed to the conference participants. Elisabetta Delle Donne had the opportunity to talk about the project aims and activities and some of the participants asked to be kept informed.','key_1_2_3_4_5_6_7_8_10_14_15_','165','Florence',110,'The project was presented to the participants of the Innovation in Language Learning international conference. The participants of the conference are potential target groups of the project activities.',NULL),(13,8,8,'Pixel','Andrea Anzanello',20181113,0,'Transnational Meetings','','During the transnational meeting of the DELTA project, held in Berlin (DE) on 13 November 2018, Andrea Anzanello presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_5_6_8_','8','Berlin',83,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(14,8,8,'Pixel','Lorenzo Martellini',20181115,0,'Transnational Meetings','','During the transnational meeting of the Pathway through Religions project, held in Paris (FR) on 15 November 2018 2018, Lorenzo Martellini presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_5_6_8_14_15_','20','Paris',76,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(15,8,8,'Pixel','Andrea Anzanello',20181126,0,'Training Seminar','','During the Short staff Training Event of the E-Classes project, held in Madrid (ES) on 26 November 2018, Andrea Anzanello presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration','key_3_6_10_','21','Madrid',209,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(16,8,8,'Pixel','Elisabetta Delle Donne',20181128,0,'Transnational Meetings','','During the transnational meeting of the Fiction project, held in Florence (IT) on 28 November 2018, Elisabetta Delle Donne presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_5_6_8_14_','11','Florence',110,'Participants to the meeting showed interest and asked to be kept informed',NULL),(17,8,8,'Pixel','Elisabetta Delle Donne',20181204,0,'Transnational Meetings','','During the transnational meeting of the Parsifal project, held in Florence (IT) on 4 December 2018, Elisabetta Delle Donne presented Pixel’s activities and, among these, the MathE project. The project’s brochure was shown to explain project’s aims and results and contact details provided to explore the possibility of further collaboration.','key_5_6_8_','11','Florence',110,'Participants to the meeting showed interest and asked to be kept informed.',NULL),(18,8,8,'Pixel','Elisabetta Delle Donne',20181206,0,'Transnational Meetings','','During the transnationa