base and tools and show to teachers how  to create and use the resources engaging students into interactive Math learning process.','key_7_8_14_','22','Kaunas',129,'The attendees of the event was introduced with the math resources online, teachers who participate in the project shared their experience. Project website link was shared. Leaflets were distributed.',NULL),(339,81,50,'Instituto Politécnico de Bragança','Maria de Fátima Pacheco',20210727,20210727,'Transnational Meetings','Meeting with KTU Teachers','Meeting with teachers of KTU and Vice-Dean of Faculty of Mathematics and Natural Sciences.','key_4_7_8_','100','Kaunas',129,'Brochures were left at KTU in order to be collected by students.',NULL),(340,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Emanuela De Negri',20210215,20210315,'Other','Divulgative Seminar','The event \"I mestieri dello statistico\" is organised by the Department of Mathematics of the University of Genova to explain to students and teachers of the High Schools what is Statistics and what people working with Statistics really do in their job. During this event the project was presented.','key_7_8_','135','Online',110,'Some of the teachers and of the students were very interesting',NULL),(341,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Francesca Morselli, arvid Perego',20210327,20210327,'Training Seminar','','The Italian Association of Research in Didactics of Mathematics has organized a series of seminar for teachers of all schools order. This is, on arguing ad reasining in mathematics has title\" COLTIVARE L’ARGOMENTAZIONE\" and \nis held by D. Di Girolamo, M. A. Mariotti, F. Morselli, I. Rebella.\n\nAt the end of the meeting the project was presented.','key_6_8_10_14_','60','Onlibe',110,'Some teachers  showed strong interest.',NULL),(342,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Emanuela De Negri',20210723,20210727,'Transnational Meetings','','The 26th International Conference on Applications of Computer Algebra (ACA 2021) was held  Online. Many researchers attended it, in particular in the session S1 Emanuela de negri gave a talk, and had the occasion to present the Project to the participants to that session.','key_4_10_14_','35','Online',86,'The professors showed strong interest',NULL),(343,79,51,'Università degli Studi di Genova, Dipartimento di Matematica','Emanuela De Negri, Giovanni Alberti',20210608,20210608,'National Meeting','','The  PLS (Piano Lauree Scientifiche) national meeting was held to discuss on the Laboratories activities carried on in the last year in the Schools by  the different Italian universities. During the meeting the project was presented.','key_4_10_14_','45','Online',110,'Many colleagues were very interested in the Project',NULL),(344,80,54,'Fundatia EuroEd','Andreea Ionel',20210827,20210827,'Conference or Fair','','Participation in the Job Fair for the diaspora, and not only, organized in Iasi, Romania. Street event with the involvement of the Local Council, Iasi City Hall, Local and County Employment Agency.\nThe event involved the participation of over 40 local agents, from various fields of activity, with a very high exposure to an audience of over 200 people.\nDissemination of the project by distributing leaflets and information about the project and its results.','key_1_2_3_5_8_10_15_','200','Iasi',182,'over 200 people reached',NULL),(345,77,55,'Gheorghe Asachi Technical University of Iasi','Marcel Roman',20210715,20210715,'Conference or Fair','','The Multiplier Event gathered 40 local participants from outside the MathE project partnership. \n\nThe aim of the event, concerning the involvement of target group, was to bring together staff members from the academic sector, universities, to share their experiences in working in European projects, and to transfer to the pre-university sector. \nAll the participants are working in the education sector and their registrations for participation in the MathE Multiplier event, have been accepted based on their interest in increasing their knowledge and competences in developing Erasmus+ projects. In this context, the MathE project has been presented as an example.','key_4_5_6_7_8_10_14_15_','40','Iasi',182,'40 participants\nMathE project folders\nMathE project pens\nMathE project flyers',NULL),(346,80,54,'Fundatia EuroEd','Cristian Timofticiuc',20210330,20210330,'Training Seminar','','Online Training with teachers. Cristian Timofticiuc presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_6_8_10_','20','Online',0,'PrintScreen',NULL),(347,80,54,'Fundatia EuroEd','Andreea Ionel',20210409,20210409,'Training Seminar','','The event took place at the headquarters of the EuroEd Foundation and brought together people from various fields of activity (teachers, project managers, people who work in the hotel industry, etc.) and who follow the foreign language courses offered by EuroEd (English, German, French). MathE project was presented along with it\'s aim and objectives.','key_2_4_5_6_8_10_14_15_','54','Iasi',182,'Participants List',NULL),(348,80,54,'Fundatia EuroEd','Alina Ailincai and Andreea Ionel',20210419,20210420,'Transnational Meetings','','Cave Project Kick-off meeting. Alina Ailincai presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_4_6_8_10_14_15_','15','Online',0,'PrintScreens',NULL),(349,80,54,'Fundatia EuroEd','Anca Constantin',20210420,20210420,'Training Seminar','','Teacher\'s training. Anca Constantin presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_8_','14','Iasi',182,'Pictures',NULL),(350,80,54,'Fundatia EuroEd','Anca Constantin',20210423,20210423,'Transnational Meetings','','Di2Learn Kick-off Meeting. Anca Constantin presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_4_5_6_8_10_14_15_','12','Online',0,'PrintScreens',NULL),(351,80,54,'Fundatia EuroEd','Cristian Timofticiuc and Andreea Ionel',20210604,20210604,'Transnational Meetings','','ACDC Kick off Meeting. Cristian Timofticiuc presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_1_4_5_10_15_','15','Online',0,'PrintScreen',NULL),(352,80,54,'Fundatia EuroEd','Cristian Timofticiuc',20210629,20210629,'Training Seminar','','Trainig with Teachers. Cristian Timofticiuc presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_6_8_','30','Online',0,'PrintScreen',NULL),(353,80,54,'Fundatia EuroEd','Anca Constantin and Anca Colibaba',20210901,20210901,'Conference or Fair','','Anca Constantin presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_8_','30','Iasi',182,'Pictures',NULL),(354,80,54,'Fundatia EuroEd','Anca Constantin and Anca Colibaba',20210911,20210911,'Conference or Fair','','EuroEd Open Doors Day. Formal dissemination of all euroed projects in implementation with the meeting participants','key_2_','300','Iasi',182,'Pictures',NULL),(355,80,54,'Fundatia EuroEd','Cristian Timofticiuc',20210916,20210917,'Transnational Meetings','','ACDC Meeting in Valencia. Cristian Timofticiuc presented EuroEd’s activities and, among these, the MathE project. The project’s aims and results were presented and contact details provided to explore the possibility of further collaboration.','key_4_8_10_15_','10','Valencia',209,'Pictures',NULL),(356,8,8,'Pixel','Lorenzo Martellini',20211007,20211008,'Transnational Meetings','','During the transnational meeting of the Quill project, held in Cordoba (ES) on 7-8/10/2021, Lorenzo Martellini distributed the brochure of the MathE project','key_14_','10','Cordoba',209,'Project partners representatives involved in the meeting were interested in the project and expressed their willingness to be informed about its achievements',NULL),(357,78,42,'Kauno technologijos universitetas','Vida Drąsutė',20210927,20210928,'Transnational Meetings','','During the trasnnational Erasmus+ project \"International cooperation in the field of higher education for developing software talents - SoftAware\" partner meeting, project Mathe was presented to the meeting participants in chats during the breaks.','key_4_14_','12','Kaunas',129,'Meeting participants learned about the project and created educational resources for teachers and students.',NULL),(358,78,42,'Kauno technologijos universitetas','Vida Drąsutė',20211025,20211026,'Transnational Meetings','','Project Mathe was presented to the participants of the project partners meeting in the framework of Erasmus+ project \"DIGITAL TUTORS: FACING THE NEW GENERATION AND CHALLENGES\"','key_6_8_10_','14','Valencia',209,'Participants showed interest in project activites for teachers in schools with the students. Project leaflets were used to explain activities in more details, project website link was shared.',NULL);
