INSERT INTO `pm__workinprogress` VALUES (3,'',8,8,'Pixel',20180901,20210831,'PM','The project management is carried out throughout the project period and ensures the correct development of the project activities and the achievements of the expected results.\nIt is diveided into 4 main activities:\n- Coordination of the activities\n- Dissemination\n- Exploitation\n- Evaluation\n\nCoordination of the activities\nIt includes:\n• Planning of all the activities of the project for the 30 months project life\n• Participation in and organisaiton of 4 transnational meetings of the steering committee\n• Creation and update of the project website \n• In progress reporting activities and delivery of yearly reports at progress and final stage\n• Constant sharing of solutions and circulation of information through e-mails and skype meetings\n• Check of the project state of art and of the respecting of the deadlines\n\nDissemination\nIn includes:\n- Making the Project Portal accessible to the largest possible number of university lecturers, students and policy makers in charge of education policy definition\n- Sharing the project results with the highest number of operators in the field of education and with the highest number of citizens\n- Spreading the project activities and results on the most popular Social Network (Facebook and Twitter)\n\nIn the framework of this activityPixel has to carry out the following activities:\n- Creation of Facebook project page\n- Creation of the forms to be used by the partnerships\n- Contribution to the Project brochure in English, to be translated by partners in National languages\n- Dissemination activities\n- Creation of the dissemination reports\n- Creation of the transnational dissemination report\n\nExploitation\nIt aims to promote the project sustainability. The actions to be carried out are:\n• Promote the Portal through the exchange links with Portals addressing similar issues (e.g. Portals providing educational materials for math lecturers; portals on scientific subjects, etc.)\n• Promote the among public authorities and key policy makers in order to gain institutional consensus and promoting the insertion of project results in policies for Education.\n• Involve new members as associated partners\n\nEvaluation\nThe aim of evaluation is to measure and ensure the quality of all the activities and of the project intellectual output. Both project partners and end users are involved and will have to fill in ad hoc questionnaires.','','Coordination of the activities\nPixel, in cooperation with the project scientific coordinator, produced all the material for the kick-off, second and third partners meeting. Pixel organized, hosted and managed the kick-off partners\' meeting, in cooperation with KTU and LIT, organized the second and third one. In particular:\n1. The venue of the partner meeting has been prepared\n2. The accommodation was given to all the partners attending the meeting\n3. Information was given about the meeting practicalities and the city by preparing documentation.\n4. The meeting folder was developed and the folder was then printed and distributed to the partners.\n5. The project presentation was created using MS PowerPoint and was introduced during the meeting.\n6. Inside the meeting folder was added a Calendar of Activities, an instrument for all partners to have a complete and resumed view over the activities of the project in all its length.\n7. After the meeting, detailed minutes were prepared about what has been said and decided. A full list of annexes was also produced, some updating the drafts presented during the meeting while others were started from scratch.\n8. The minutes and the annexes were then sent to the partners via email and uploaded on the web site.\n\nThe forth, fifth and sixth meetings were organized online and took place on a virtual platform provided by Pixel.\n\nPixel took care of the transnational co-ordination and supervision of each activity to be carried by the partners, by creating a calendar of activities with established deadlines and mailing lists to manage each time period. Pixel produced and contributed to the production of forms to be used for the project activities and project management. For every activity Pixel sent the project partners the needed material, reminded the deadlines, answered the questions over any kind of issue, collected the produced material and sent it to technical partner.\n\nDissemination\nPixel created the dissemination form and organized several dissemination events.\nPixel contributed to the creation of the project’s brochure in English and coordinated the partners for the translation in their national languages.\n\nExploitation\nPixel created the templates and forms to be used by the partners for carrying out the exploitation activities.\nThe partners are currently involving the associated partners and collecting exploitation links.\nPixel is also in charge of the collection of the exploitation material produced by the partners and of its uploading on the project portal\n\nEvaluation\nThe internal evaluation of the project’s activities is carried out according to an evaluation model developed by Pixel.\nAccording to the evaluation model adopted, for every single project stage, an ad hoc “Evaluation Questionnaire” has been created, to be filled in by the project’s partners as far as the management activities; information systems; meeting organization etc. are concerned.\nPixel collected all partners’ evaluation questionnaires related to the partners\' meeting.\nPixel also created the evaluation questionnaires to be used by the end-users for the evaluation of the project intellectual outputs.\nPixel is in charge of the production of the transnational evaluation report.','Coordination of the activities\n1. Organisation of kick off and second partners\' meeting \n2. Meeting Folders and Partners book\n3. Project presentations\n4. Calendar of Activities\n5. Calendar of Deadlines\n6. Partners\' role\n7. Forms to be used for the dissemination\n8. Form to be used for tri-monthly activity reports\n9.Form to be used for tri-monthly dissemination report\n10.Guidelines for the writing of best practice dissemination report\n11. Forms for the associate partners\' involvement\n12. Forms for the collection of exploitation links\n13. The first issue of the quality plan\n14. Evaluation of partners\' meeting\n15. Organisation and coordination of the work of all partners, reminders of deadlines\n16. Creation of the project portal\n\nDissemination\nA total number of 94 dissemination events have been carried out so far.',''),(5,'',81,50,'Instituto Politécnico de Bragança',20180901,20210622,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform:\n\n- Collect the lectures information to participate in the MathE Project\n- Collect the questions for self-assessment and for final assessment for MathE Project','','30 October 2018: IPB took note of the forms and participation documents and have distributed them to potential participants:\nIO1.A - Assessment tools.docx\nPM1.A - Student Information.docx\nPM1.B - Lecturer Information.docx\n\n16 November 2018: Meeting with IPB lectures to promote the MathE project. The meeting has the participation of 10 IPB lectures that teach Math unit courses at IPB. \n\n22 November 2018: Coordination meeting (Ana, Florbela and Fátima)\n\n22 January 2019: Meeting with IPB lecturers to talk about the shared file in \"overleaf\" to fill with questions related with  the topic they are searching for.\n\nIO1.3) Definition of the math topics taking into account that they must have:\n-	20 questions/answer, for each topic, for the Student Need Assessment Tool (Self evaluation)\n-	10 questions/answer, for each topic, for the Student Assessment Tool\nuntill 30 March.\n\n\nThe topics choosen by IPB lecturers are: Probability, eigenvalues and eigenvectors, linear optimization, nonlinear optimization, integration techniques, graphs theory, elementary geometry, linear transformations, analytical geometry, vectorial spaces, complex numbers.\n\n31 March: the 30 question, per topic, are in the overleaf file.\n\n\nDuring April and May: teachers put the question from ovearleaf to the MathE platform and review the questions assigned to each one.\n\nJune/July: the teachers add to the platform the remaining part of the 40 questions in each topic (the last 10 questions);\n\n30 November: colect, upload and review questions  to the platform, to the final assessment;\n\n1 December to 29 February 2020:  continue to upload and review questions  to the platform;\n\n1 March to 31 May: checking the student assesment part (to verify if everything is ok).\n\n31 May 20: at least 2 topics with 40 questions in SNA and 20 questions in SFA were done. IPB uploaded questions for more topics.','The activity is being carried out according to the time schedule.\n\n31 March - 30 question done per topic.\n\n30 April -  The available questions were reviewed.\n\nApril/May - Questions written in MathE platform (at the end of May IPB has submitted 364 quastions to the self-need assesment).\n\nJune/july: IPB has submitted in 9 topics all the questions (more 10 questions in each topic).\n\nJuly/September:The reviewing part is almost complete.\n\nOctober /November:The self need assessment is complete and there are already questions in the final assessment;\n\n31 May 20: the self need assessment and the final assessment is finished.\n\nThis activity is finalized.',''),(6,'',81,50,'Instituto Politécnico de Bragança',20180901,20210622,'PM','The main activities were:\n- Organize all project documentation.\n- Produce the MathE logo\n- Produce the MathE brochure \n- Produce the MathE brochure in the different tongues\n- Produce an ovearleaf document to share the 30 question per partner and per topic.\n- Produce a technical document to help the teachers to upload the questions do the platform.\n- Produce 40 + 20 question per topic (40 to the SNA + 20 to the SFA)\n- Produce a template form to the videos link part, together with Pixel\n- Produce a template form to the videos lessons part, together with Pixel\n- 3 associated partners were enrolled to the project and 3 exploitation links','','During all time, it is necessary to organize all documentation associated with the project, named, contracts, partners information, financial procedures, among others.\n\n30 November 2018: Elaborate the MathE logo and distribute to the partners. \n\n29, 30 October 2018: Kick-off meeting in Florence.\n\n15 November 2018: Produce the MathE brochure and distribute to the partners.\n\nNovember/December 2018: Recruit lecturers to take part in the research.\n\nDecember 2018/ January/February 2019: Recruit students to take part in the research.\n\nDecember 2018: Produce an Ovearleaf document to be shared by all partners.\n\nMarch 2019: Update information on the portal about lecturers and students.\n\nOn-going dissemination activities (6 activities between October and March)\n\n8 May 2019: meeting with the students recruited to the project to listen their opinion about the platform\n\n23, 24 May 2019: \n- Second meeting in Kaunas (reenforcing the deadlines to all the questions).\n- Pixel and IPB produced the templates for Review of Existing Video Lessons and Video lessons.\n\nSeptember/October and November: enrollement of associated partners\n\n31 May 2020:\n4th Online meeting due to COVID-19 desease.\n\nTill 22 june:\n- preparation of the training program\n- Preparation of the final reports (dissemination and evaluation)','The main results are:\n- MathE logo.\n- MathE brochure in five different tongues.\n- Lecturers and students recruited and information uploaded into the portal.\n- The first 30 questions to the student self assment tool already done, per topic.\n- Produce a template form to the videos link and related information.\n- On-going dissemination activities (12 done untill the end of May).\n- The last 10 question were alredy submitted in 9 topics, by IPB\n- On-going dissemination activities (22 done untill the end of July).\n- 2 associated partners and 3 exploitation links enrolled\n-  5 dissemination were performed between June 20 and November 20.\n\n- June 2021:\nThe final dissemination report is already finished and  the Evaluation report is still under construction\nThe Training Program was performed during the week between 14 june to 18 june with participants from all the educational institutions of the consortium.',''),(7,'',8,8,'Pixel',20180901,20210831,'IO1','This phase is devoted to to identify the areas where the students\' maths entry skills need to be improved. It foresees a section for the students to self-assess their knowledge and a section to provide teachers with final tests to assess students’ knowledge','','Pixel, in cooperation with IPB, produced a detailed calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities. Pixel also contributed to the development of the following template:\n- IO1.A – Assessment Tools\nThe form has been presented and approved during the kick-off meeting.\n\nPixel also defined the structure of the platform identifying the different users\' typologies (admin, lecturer, students) and related privileges and roles on the platform.\nPixel also implemented the following sections on the project portal:\n- registration section for lecturers and students\n- panel for questions creation\n- panel for organisations\' administration\n- panel for lecturers\' administration\n- panel for final assessment creation\n- panel for final assessment\n\nPixel continuously monitored and supported the work of the partners for the development of the intellectual output.','The results are excellent. The platform already provides access to more than 1100 questions for the students\' self-assessment and almost 500 for the final assessment.',''),(8,'',8,8,'Pixel',20180901,20210831,'IO2','This phase is dedicated to the creation of a section to offer students and teachers of higher education institutions video based teaching and learning sources to reinforce specific mathematical topics','','Pixel, in cooperation with IPB (PT), produced a detailed calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\n\nThe following templates have been produced, presented, discussed and approved during the second partners\' meeting:\n- IO2.A - Review of Existing Video Lessons\n- IO2.B - Video lessons\n\nPixel also implemented the following sections on the project portal:\n- panel for video reviews\n- panel for video reviews validation\n- panel for video lessons\n- panel for video lessons validation\n\nPixel continuously monitored and supported the work of the partners for the development of the intellectual output.','The activity is completed and carried out according to the calendar of activities.\nThere are available:\n- 165 video reviews\n- 60 video lessons\n- 198 teaching resources',''),(9,'',8,8,'Pixel',20180901,20210831,'IO3','This phase is dedicated to the creation of a community of practice allowing Math teachers in higher education institutions to share and compare teaching sources, tools and strategies','','Pixel, in cooperation with IPB:\n- produced a detailed calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\n- defined the structure of the Community of practice\n- defined the main topics to be discussed on the platform\n- organized the virtual space to host the Communities of Practice\n- produced the guidelines to use participate in the virtual platform\n\nThe platform has been created and it has been presented to the partners during the 4th partners\' meeting.','The 2 communities for lecturers and students are available online on the MathE portal and all registered users can immediately access to it.\nLecturers\' Community: http://localhost/mathe/teacher-forum/public/\nStudents\' Community: http://localhost/mathe/student-forum/public//\n\nThe 2 platforms are organized in discussions each one of them categorized with tags.',''),(10,'',82,44,'Limerick Institute of Technology',20180901,20210831,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform:\n\n- Describe the proposed work package for Intellectual Output 1 to engage lecturers to take part in the project.\n- Collect the questions for self-assessment and for final assessment for MathE Project\n- Review questions designated.','','LIT took note of the forms and participation documents and have distributed them to potential participants:\nIO1.A - Assessment tools.docx\nPM1.A - Student Information.docx\nPM1.B - Lecturer Information.docx\n\nNovember 2018: Face to face presentation s to LIT lecturers to promote the MathE project.\nA total of 9 lecturers approached.\n\nNovember 2018: compilation of summaries of the project by Marie Walsh\n\nDecember 6th 2018: Meeting with lecturers who agreed to sign up to take part in the project. Lecturer forms distributed on December 7th.\n\nDecember 28th: testing Overleaf and other components of platform.\n\n2019:\nJanuary 14th: Meeting with MathE lecturers to discuss the project and the topics.\n\nJanuary 19th: uploading information about lecturers to MathE web portal\n\nFebruary 4th: Sample questions on Graphs sent to Ana for review.\n\nFebruary 6th: Sample questions on Graphs deemed off topic. Ana sent link to a different type of graphing with which we have little experience and not relevant to our students. \n\nFebruary 11th: After some discussion decided to change topic. Notified Ana and on the 16th she confirmed that it was okay for us to change from Graphs to Differentiation.\n\nMarch 4th: Ana confirmed that sample questions on Manipulation of Alegbraic formulae were suitable. \n\nThroughout March: Lecturers continued working on samples and started to upload them to the platform. Some lecturers had difficulty registering because LIT webmail didn\'t allow use of LIT mail addresses.\n\nLIT lecturers divided assigned topics between them and started compiling questions and submitting them to the MathE portal.\n\nLIT lecturers started the review of questions by other partners.\n\nLIT lecturers met to discuss the work and validated questions as requires. This work is on-going.\n\nLIT lecturers uploaded questions for self assessment and final assessment and completed validation of designated questions from other partners.\n\nFull set of questions for self assessment and final assessment on designated topics was compiled and uploaded.\nAll reviews of questions by other partners were divided among researchers for completion.\nThe researchers continued to test and review the assessment questions.\n\nThe researchers and lecturers are continuing to encourage students, colleagues and associates to use the question banks and test the assessments.','The project has been promoted to the lecturers and follow-up meetings planned to put the team in place but also to start the work of compiling the questions and answers.\n\nThe lecturers have been working on the sample questions and uploading same to platform within the timelines of the project.\n\nQuestions for the self assessment of the topics Differentiation and Manipulation of Algebraic expressions submitted to the platform. \n\nValidation of some topics has taken place.\n\nValidation of topics continues. The lecturers are also preparing questions for the final assessment.\n\nQuestions for self assessment uploaded and final assessment questions ready for testing.\n\nValidation of partners questions completed.\n\nFull set of questions for topics were tested and uploaded. The questions from other partners were checked and validated as necessary.\n\nA set of assessment questions has been compiled and is being utilised by students and lecturers.\n\nThis question bank will be available for future use by members of the Community of Practice for the MathE project.',''),(11,'',78,42,'Kauno technologijos universitetas',20181101,20210831,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform:\n\n- Chose the 2 topics out the 10 available.\n- Meeting with lecturers for introduction of the MathE project.\n- Collect the questions for self-assessment and for final assessment for MathE Project.','','Up to the 22nd of January 2019, KTU selected 2 topics out of the 10 possible in the project: Matrix and determinats and Statistics. For the selected topics, KTU has met the lecturers in order to promote the MathE project and to set a timeline for the activities to be carried out. i.e. Delivery of the questions needed for the creation of the Student‘s assessment toolkit.\n\nFor each topic, KTU has already identified and collected 80 questions: 40 (Matrix and determinats) + 40 (Statistics) questions for the Student Need Assessment Tool (Self evaluation)\nThe lecturers involved in the project activities have structured work and researched on the materials to be used in order to produce the Assessment Tool and created 20+20 questions for the Student Assessment Tool (Final evaluation).\n\nThe available questions were reviewed.\nThe activity is being carried out according to the time schedule.\nActivity is finalized.','The activity is being carried out according to the time schedule.\n\nBy 30th of May 2019 KTU made available results for both assessment tools submitted (84 submitted, 10 evaluated, 70 approved)\n\nKTU team checked Probability topic (prepared by IPB) 30 questions (discussion was on Overleaf and after bilateral agreement approval was made).\nOur topic (Statistics) were checked by IPB 40 questions.\nIntegration techniques (prepared by IPB)  31 questions were checked by KTU. \nOur topic (Matrix and determinations) checked by LIT (41 questions provided, 41 checked by LIT)\nLimits and Continuity (by UniGe) provided 21, checked by KTU 21\nDomain, image and graphics (UniGe) 7 provided, 7 checked by KTU\nReal functions of single variables (UniGe) 2 provided, 2 checked by KTU\n\nWe worked on assessment tool:\nIntegration techniques (prepared by IPB)  + 9 questions were checked by KTU. \nOur topic (Matrix and determinations) checked by LIT (41 questions provided, 30 checked by LIT in first period, and 11 in second period). Feedback was provided.\nLimits and Continuity (by UniGe) provided 21, checked by KTU +2 in this period (19 last period (November 2020)\nDomain, image and graphics (UniGe) 7 provided, 7 checked by KTU\nReal functions of single variables (UniGe) 2 provided, 2 checked by KTU',''),(12,'',82,44,'Limerick Institute of Technology',20180901,20210831,'PM','From the start of the project, it was necessary to organize all documentation associated with the project, contracts, partners information, financial procedures, in consultation with LIT Management.\n\nUpdate information to portal as required.\n\nBuild awareness of project and contribute to Community of Practice.\n\nCo-ordinate communications with partners and LIT team.','','The main activities carried out were:\n- Liaise with Research Development and Innovation Office for approval to participate in the project.\n- Organize all project documentation.\n- Prepare for kick-off meeting in Florence.\n- 29, 30 October 2018: Kick-off meeting in Florence.\n- Recruit lecturers to take part in research.\n- Proof read the English version of the MathE brochure \n- Prepare contracts for participants from LIT.\n- Organise meetings with lecturers.\n- Collect lecturer information and upload to portal.\n- Liaise with partners regarding topics.\n- Recruit technical assistance.\n- Update information on the portal.\n- On-going dissemination activities.\n- Attendance at second partners\' meeting.\n- Ongoing liaison with researchers.\n- Initiation of student recruitment.\n- Agree timeline for activities with researchers.\n- on-going information to students and lecturers.\n- collate and compete financial report.\n\n- Meet virtually with researchers and communicate by email to ensure on-going participation in the project. \n- Dissemination activities and approaches to potential associate partners.\n\nThis work will be completed as required by the project guidelines.','LIT represented at kick-off meeting in Florence.\nLIT researchers and technical assistance recruited.\nContracts prepared and distributed.\nMeetings organised to liaise with researchers working on Intellectual Output 1.\n\nInterim Financial report prepared. Documents collected and collated. Updates to be put in place.\n\nLIT represented at Project Meeting in Kaunas Lithuania.\nWork at that meeting reported back to the researchers.\nNew deadlines set for submission of materials to the portal.\nMonitoring submission and evaluation of IO1.\n\nNew semester started and meeting to organise the MathE research imminent.\n\nLIT lecturers working on intellectual outputs as scheduled.\nStudents have been recruited and have registered autonomously on the platform.\nAssociated partners and potential associated partners have been identified.\nExploitation links have been recorded.\nDissemination activities on-going.\n\nLIT hosted partner meeting in Limerick.\n\nMore students and lecturers have joined the Community of Practice.\n\nLIT attended on-line meetings with partners.\n\nAll necessary documentation being filed.\n\nThe project outputs have been managed as required by the project protocols.',''),(13,'',80,54,'Fundatia EuroEd',20180901,20210831,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform.','','EuroEd, in collaboration with ‘Gheorghe Asachi’ Technical University of Iasi, planned and discussed the calendar of activities in order to identify their roles and responsabilities. The teachers involved in the project have been informed about IO1 – Students’ Assessment Toolkit , and about the Assessment Tools to be developed by ‘Gheorghe Asachi’ Technical University of Iasi, in collaboration with EuroEd, Iasi. \nParticipation in project meetings with the professors from ‘Gheorghe Asachi’ Technical University of Iasi involved in the project activities, discussing the tasks in the project and planning the organization of the next actions.\nParticipation in the internal project meeting, discussing the tasks in the project and planning the organization of the next actions.\nThe teachers involved in the project activities have structured work and researched on the materials to be used in order to produce the Assessment Tool.\nTechnical support in registering on the project portal the students from the Romanian University. Permanent track of the system of autonomously registration of the lecturers and students.  \nSupport offered to the other Romanian partner in the creation of the assessment toolkit.\nSupport in production of the 114questions/answer for the Student Need Assessment Tool on the topics of Differential equations (42 Questions) and Real functions of several variables (54 questions). Permanent feedback and support in uploading contents and provision of reviews by the lecturers. \nSupport in production of the 71 questions/answer for the Student Assessment Tool – final assessment. Permanent feedback and support in uploading contents and provision of reviews by the lecturers.\nEuroEd staff members worked in collaboration with TUIASI to revise the questions uploaded, work with the lecturers to check the contents and upload the final versions of the final assessments on the project portal. Permanent check of the platform and of the tools uploaded and revised at overall project stage.','Support in uploading/evaluating 114 self-assessment questionnaires \n114 questions/answer for the Student Need Assessment Tool on the topics of Differential equations (42 Questions), Non-Linear Optimization (18 Questions) and Real functions of several variables (54 questions).\nSupport in uploading 67 questions/answer for the Student Assessment Tool – final assessment\nRevision of all the questions/tests uploaded. \nThe activity is being carried out according to the time schedule.',''),(14,'',80,54,'Fundatia EuroEd',20180901,20210831,'IO2','The objective of this intellectual output is to create a section to offer students and professors of higher education institutions a video with teaching and learning sources to reinforce specific mathematical topics.','','EuroEd, in cooperation with ‘Gheorghe Asachi’ Technical University of Iasi produced a calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\nDuring the first meeting of the project the partners discussed the template of the video and planned the strategies to use the result of the project.\nEuroEd monitored the internal meeting involving the other Romanian partner, with the focus on planning the production of the Online MathE Library of Video Lessons and Teaching Materials. During the meeting the lecturers to be filmed were planned and the math topics to be reached. \nEuroEd provided the support in organizing the production of the video lessons as teaching materials, taking the responsibility to film, assist on the lessons and provide feedback, edit the videos, work with subtitles and upload the videos on the project YouTube channel. \nIn a 1st stage, EuroEd filmed 2 lessons with the staff from TUIasi – 2 different lectures and 2 different topics. \nOne of the videos have been already edited and produced according to the planned instructions and uploaded on project YouTube Channel. \nEuroEd was also involved in the research and selection of 16 existing videos for each of the assigned topics or subtopics. Support also for the lecturers in the review production.\nEuroEd worked in revision of the existing videos uploaded by all partners on the project portal, checking the topics and the validation status. Collaborated with the staff members from TUIASI to provide support in the research and production of the revision of the existing videos to be proposed on the project platform.\nEuroEd supported TUIASI in filming the new video lessons with the Math lecturers, discussed with the team on options to edit the videos and how to create the final version of the lessons. EuroEd worked in editing tasks related to production of the videos. EuroEd worked in editing and uploading on the portal, a total of  11 video lessons. \nEuroEd offered support and feedback on collection of available teaching resources.','2 filming lessons as drafts\n1 video lesson as test : MathE Video lesson on Linear Differential equations - https://youtu.be/pWCtAAZ2rD4 \n15 existing videos for each of the assigned topics or subtopics (11 approved) \n12 video lessons produced and uploaded on the portal \n19 teaching resources (17 approved)',''),(15,'',80,54,'Fundatia EuroEd',20180901,20210831,'IO3','The objective of this intellectual output is to create a community of practice which will allow Math professors in higher education institutions to share and compare different teaching resources, tools and strategies to support specific mathematical topics.','','EuroEd, in cooperation with ‘Gheorghe Asachi’ Technical University of Iasi produced a calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\nDuring the first meeting of the project the partners discussed the template and planned the strategies to use the result of the project.\nDuring the next meetings in the project, EuroEd received the feedback from the coordinator and from the partners on how to produce the project Guide. The IO3 proposed structure includes: Active Community of Practice; Identification of good practices; Online guidebook of good practices. \nRoles allocated: Technical Issues about the Platform – EuroED partner; Case Studies Using MathE Platform (&gt;=2 per partner) – All HEI partners; Book edition – EuroED partner\nEuroEd role was to produce the Guidebook. \nEuroEd worked in production of the table of contents for the Guidebook:\nIntroduction	\nAbout the MathE project (aims, partnership, educational resources)	\nAbout the Guidebook of good practices	\nBenefits for the teachers and students joining the MathE Community of Practices	\nPart 1: MathE usability	\n1.1 Presentation of the MathE Platform	\n1.2 Teachers using the MathE Platform	\n1.2.1 Teacher registration	\n1.2.2 Addition of questions to the self-assessment database	\n1.2.3 Elaboration of a final assessment	\n1.2.4 Inserting teaching resources (videos, lessons and other resources)	\n1.3 Students using the MathE Platform	\n1.3.1 Student registration	\n1.3.2 Student assessment Toolkit	\n1.3.3 Student final assessment	\n1.4 MathE Library	\n1.5 Community of Practice	\nPart 2: MathE experimentation	\n2.1 Case Studies Using MathE Platform in Portugal	\n2.2 Case Studies Using MathE Platform in Ireland	\n2.3 Case Studies Using MathE Platform in Italy	\n2.4 Case Studies Using MathE Platform in Lithuania	\n2.5 Case Studies Using MathE Platform in Romania	\nGuide availability and MathE contacts	\nThe proposed table of contents has been discussed with the coordinator, adaptations have been done according to the feedback received.\nEuroEd staff worked in production of the chapters:\nIntroduction	\nAbout the MathE project (aims, partnership, educational resources)	\nAbout the Guidebook of good practices	\nBenefits for the teachers and students joining the MathE Community of Practices	\nPart 1: MathE usability\nGuide availability and MathE contacts\nThe contents created are clear, describe efficiently the MathE project needs, the usability and applicability of the project platform and easy and friendly matters on how to access various parts of the project portal. The Guide includes visual elements – print screens of the steps to be followed, but also video tutorials.','IO3.4 Production of the online guidebook of good practices structure and essential contents\nIO3.4 Production of the online guidebook of good practices table of contents\nIO3.4 Guidebook of good practices - MathE teachers and students Community of Practices\nVideo tutorials for registration stages',''),(16,'',80,54,'Fundatia EuroEd',20180901,20210831,'PM','The main activities were:\n1. Organize all project documentation.\n2. Produce the MathE logo\n3. Produce the MathE brochure \n4. Produce the MathE brochure in the project partners’ languages\n5. Proofread the MathE brochure\n6. Offer support to ‘Gheorghe Asachi’ Technical University of Iasi, in order to produce an ovearleaf document to share the 30 questions per topic\n7. Organise meetings with lecturers.\n8. On-going dissemination activities.','','EuroEd is constant involved in both internal meetings within EuroEd, but local also involving the other Romanian partner; to discuss the status of the project and check the calendar of activities and the quality of production of the results. \nEuroEd support the entire Romanian team in terms of administration and financial reporting actions. \nEuroEd checked and supported the production in Romanian of the PM1.1) Creation of all the templates for carrying out the activities. \nEuroEd supported the Univ to deal with the task of involving target group within the project: 8 lecturers and 42 students. \nEuroEd supported the fill in of the documents: Template: PM1.A – Student Information; Template: PM1.B – Lecturer Information; Template: PM1.C – Role of the target groups. EuroEd dealt with uploading on the project portal of the related information.\nProduction and Uploading of Project Activities Report Forms. EuroEd dealt with all the reporting actions necessary. Production of PM1.D – In progress activities reports. \nProduction of Project Financial Report. EuroEd followed the PM1.E – Financial Manual and PM1.F – Financial Forms. \nIn terms of dissemination, EuroEd did the translation into Romanian of the project brochure. Involve in proofreading tasks related to dissemination materials. EuroEd is on-going involved in dissemination activities. Evidences have been uploaded on the project portal. \nIn terms of exploitation, EuroEd have been involved in different actions to promote the project and to attract potential interest stakeholders. EuroEd dealt with PM3.2) Involvement in the project of 6 organizations operating in the field of education, who will join the project as associated partner filling in the Associate partner form. They were inserted as Associate Partners on the project portal. EuroEd dealt also with PM3.3) Publication of announcements on 8 portals or websites addressed to teachers.','- Online Database of Target Groups: 8 lecturers and 43 students\n-	In progress Project Activities Report – every reporting period\n-	Project Financial Report\n-	Project brochure in Romanian\n-	On-going dissemination events\n-	MathE_Partners Dissemination Report\n-	6 letters of participation in the project as associate partners \n-	8 exploitation links\n-       27 evaluation questionnaires collected\n-	PM4.F – Evaluation report on testing activity_RO',''),(17,'',79,51,'Università degli Studi di Genova, Dipartimento di Matematica',20180901,20210831,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform, in particular:\n\n-  engage lecturers to take part in the project.\n-  collect the questions for self-assessment and for final assessment for MathE Project','','November 2018: presentation to a group of 15 lecturers Of University of Genova of the MathE project.\n4 lecturers  have been involved in the project.\n\nDecember 2018: meeting with lecturers to test Overleaf and organise the work on IO1\n\nJanuary 2019: Meeting with MathE lecturers to discuss the first questions prepared by the lecturers, for self-assessment\n\nThroughout February and March 2019: lecturers continued working on samples and upload some of them to Overleaf and some to the platform.\n\nJune 2019: lecturers concluded the upload of 40 questions on Linear Systems and 40 questions on Functions of One Variable to the platform for the Students Self-Need Assessment, and started to review and validate questions on Complex Numbers, Analytic Geometry and Vector Spaces uploaded by other partners.\n\nJuly to September 2019: lecturers concluded the revision and validation process of 40 questions on Complex Numbers, 40 questions on Analytic Geometry and 40 questions on Vector Spaces uploaded by other partners for the Students Self-Need Assessment, and started to upload questions for the Students Final Assessment.\n\nThroughout October and November 2019: lecturers concluded to upload 20 questions on Linear Systems and 20 questions on Functions of One Variable to the platform for the Student Final Assessment.\n\nDecember 2019 to May 2020: final checks of the last uploads of the questions for the Student Self Assessment','Questions uploaded on Overleaf and on MathE Platform as required.\n40 questions on Linear Systems and 40 questions on Functions of One Variable uploaded on MathE Platform, in the Self-Need Assessment.\nQuestions validated on Complex Numbers, Vector Spaces and Analytic Geometry, in the Self-Need Assessment.\n20 questions on Linear Systems and 20 questions on Functions of One Variable uploaded on MathE Platform, in the Final Assessment.',''),(18,'',82,44,'Limerick Institute of Technology',20180901,20210831,'IO2','The objective of this intellectual output is to create a resource depository to offer students and teachers of higher education institutions teaching and learning sources to reinforce specific mathematical topics.\nThese resources will be multimedia and offer opportunities to develop skills in various mathematical topics.','','This Intellectual Output has been described to researchers working in LIT.\nA local depository has been created using our Moodle system.\nAny useful resources/sources will be placed on the Moodle platform for evaluation before being submitted to the MathE platform.\nThe researchers will identify materials during the summer vacation and submit to our Moodle VLE.\nThe Moodle page is being populated with suggested resources.\nOne lecturer has recorded a MathE presentation and is updating with suggested start and end frames.\n\nVideos from existing sources identified on YouTube. Review completed and uploads done to video library.\n\nOn-going identification of useful resources.\n\nThe videos by the lecturers have been added to the reviewed videos.\n\nA set of resources and videos has been compiled and tested.','This activity has now started and resources are being collected and collated.\n\nTen videos have been identified and reviewed and information related to them uploaded to MathE portal.\n\nThe library has been populated with videos and teaching resources.\n\nThe teaching resources and videos have been validated. Those of other partners have been tested, reviewed and validated.\n\nThe resource collection offers opportunities for students to complete guided practice to learn about mathematical concepts. It also gives them the possibility of revising and reviewing topics.',''),(19,'',79,51,'Università degli Studi di Genova, Dipartimento di Matematica',20180901,20210831,'IO2','The objective of this intellectual output is to create a resource depository to offer students and teachers of higher education institutions teaching and learning sources to reinforce specific mathematical topics.','','This phase has been explicated to researchers working in UNIGE.\nA local repository has been created using our Moodle environment (the right of admission is reserved).\nAny useful resources/sources will be placed on the Moodle platform for evaluation before being submitted to the MathE platform.\n\nJuly 2019: meeting with MathE lecturers to discuss the collection of existing video lessons to upload to the MathE Platform.\n\nSeptember 2019: lecturers started to search and collect existing video lessons to upload to the MathE Platform.\n\nOctober 2019: meeting with MathE lecturers to discuss the creation of the first video lesson, and to discuss about the collected existing video lessons.\n\nNovember 2019: lecturers uploaded 5 existing videos about Linear Systems and 5 existing video lessons about Functions of One Variable to the MathE Platform, and create the first video lesson about Linear Systems.\n\nDecember 2019 to January 2020: lectures checked the first video lesson about Linear System and uploaded it on the YouTube channel and on the webpage of the project.\n\nFebruary 2020: meetings to discuss how to produce new video lessons, contact with UniGenova to have the material and the know-how to produce high quality video lessons.\n\nMarch 2020 to November  2020: lecturers produced 4 video lessons on Linear Systems and 5 video lessons on Functions of One Variable, that were uploaded on the YouTube channel and on the webpage of the project.\nMoreover they produced 10 teaching materials on Linear Systems and 10 teaching materials on Functions of One Variable, that were uploaded  on the webpage of the project.\nRevision of the material uploaded before have been performed following the remarks made by IPB.','Ten existing videos uploaded on the MathE Platform as required.\nTen video lectures produced and uploaded on the YouTube Channel and on the MathE Platform.\n20 Teaching materials produced and uploaded on the MathE Platform.',''),(20,'',79,51,'Università degli Studi di Genova, Dipartimento di Matematica',20180901,20210831,'IO3','This Intellectual Output aims at creating a community of practice of Math teachers in higher education in order to share and compare teaching sources, tools and strategies.','','- the topics  of the community of Practice have been decided together with the partners\n- the topics to be animated by UNIGE her been selected \n- we reached out to potential members of the Community of Practice by e-mails and talks \n- some colleagues have been involved and we explained the Project to them\n- we all participated to the Forum discussion','- topics of the Forum  chosen\n- some UNIGE lecturers have joined the Community of Practice.\n- discussion in the Forum have started on various topics.',''),(21,'',79,51,'Università degli Studi di Genova, Dipartimento di Matematica',20180901,20210831,'PM','The first of our project management steps is to organize all documentation associated with the project, contracts, partners information, financial procedures, in consultation with DIMA-UNIGE financial offices.\n\nUpdate information to portal as required.\n\nBuild awareness of project and contribute to Community of Practice.','','- Organize all project documentation.\n- Coordinate with UNIGE International Relation Office for approval to participate in the project.\n- Prepare the participation at the kick-off meeting in Florence.\n- Translate the English version of the MathE brochure in the Italian language\n- Recruit high skilled lecturers and technicians to take part in the research.\n- Organise meetings with lecturers.\n- Prepare an instance in the UNIGE Moodle platform to exchange material between UNIGE researchers\n- Update information on the Mathe portal.\n- Organise and implement dissemination activities.\n- Involve students in the use of MathE Platform.\n- Involve lecturers in the Community of Practice\n- Contribuite to the Lecturer Forum','Agreement signed.\nDIMA-UNIGE participated at the meetings in Florence, Kaunas and Limerick and online at the 4th meeting.\nDIMA-UNIGE  researchers and technical assistance recruited.\nMeetings organised to liaise with researchers working on Intellectual Outputs.\nDissemination activities organised and implemented.\nDIMA-UNIGE participated at the second meeting in Kaunas.\nStudents involved in the use of the MathE Platform.\nDIMA-UNIGE participated at the third meeting in Limerick.\nThe Forum is active.\nDIMA-UNIGE participated at the fourth meeting online.',''),(22,'',78,42,'Kauno technologijos universitetas',20180901,20210831,'IO2','The objective of this intellectual output is to create a resource repository to offer students and teachers of higher education institutions teaching and learning sources to reinforce specific mathematical topics.','','This Intellectual Output has been described to researchers working in KTU.\nAll useful resources for evaluation submitted to the MathE platform.\nThe researchers identified materials needed for Math Library (7 youtube videos), and uploaded in MathE repository\nPreparation process for recording lectures started November, 2020.\nTopic Matrix - 6 youtube lessons (video reviews) were found and uploaded  into the portal (by Kristina Šutienė) + 5 recorded lessons\nTopic Statistics - 7 youtube lessons (video reviews) were found and uploaded into the portal (by Kristina Šutienė) 5 recorded lessons (Daiva Petkevičiūtė-Gerlach and Lina Dindienė) \nTeaching material was selected and suggested: 10 resources (topic Matrix), 10 resources (topic Statistics).','All useful resources for evaluation submitted to the MathE platform.\nRecorded 10 MathE lessons\n7 youtube resources shared\nSearch and adaptation of teaching material, uploading to MathE portal.\nVideo lesson \"Linear independence\" (5min37s): preparation and recording, uploading to Youtube channel and then to MathE portal.\nVideo lesson \"Determinant, its Properties and Elementary Row Operations\" (5min18s): preparation and recording, uploading to Youtube channel and then to MathE portal.\nVideo lesson \"Some useful properties of determinant\" (4min08s): preparation and recording, uploading to Youtube channel and then to MathE portal.\nVideo lesson \"Matrix polynomial\" (4min20s): preparation and recording, uploading to Youtube channel and then to MathE portal\nTopic Matrix - 6 youtube lessons (video reviews) were found and uploaded  into the portal (by Kristina Šutienė) + 5 recorded lessons\nTopic Statistics - 7 youtube lessons (video reviews) were found and uploaded into the portal (by Kristina Šutienė) 5 recorded lessons (Daiva Petkevičiūtė-Gerlach and Lina Dindienė) \nTeaching material was selected and suggested: 10 resources (topic Matrix), 10 resources (topic Statistics).',''),(23,'',78,42,'Kauno technologijos universitetas',20180901,20210831,'PM','The project management is carried out throughout the project period and ensures the correct development of the project activities and the achievements of the expected results.\nIt is divided into 5 main activities:\n- Coordination of the activities\n- Dissemination\n- Exploitation\n- Evaluation\n- Participation in project meetings (online and face to face)','','- Activities and budget are coordinated within institution\n- Monitoring activities and deadlines\n- Dissemination activities and its registration online\n- KTU team participated in all meetings which were organized within the project period (online and face to face)\n- KTU team organized one of the meetings.','- Activities and budget are coordinated within institution\n- Monitoring activities and deadlines\n- Dissemination activities and its registration online (more than 40 events)\n- Interim reports (Activity Report, Financial Report)\n- We participated in all partners meetings, evaluated them\n- Dissemination Report and Evaluation Report was prepared at the end of the project\n- KTU team participated in all meetings which were organized within the project period (online and face to face)\n- KTU team organized one of the meetings.',''),(24,'',81,50,'Instituto Politécnico de Bragança',20180901,20210622,'IO2','The objective of this intellectual output is to create a resource depository to offer students and teachers of higher education institutions teaching and learning sources to reinforce specific mathematical topics.','','This Intellectual Output has been described to researchers during the 2nd meeting (May 2019).\n\nPixel, in cooperation with IPB (PT), produced a detailed calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\n\nThe following templates have been produced, presented, discussed and approved during the second partners\' meeting:\n- IO2.A - Review of Existing Video Lessons\n- IO2.B - Video lessons\n\nSeptember/October/November:\n- The teachers collect videos links and upload the information to the MathE portal.\n- The videos uploaded are reviewed by IPB\n\nFrom November 2020 teachers are developing the ideas to perform the original video lessons.','- From July until November 2019:\n- IPB already uploaded 20 videos links\n- IPB reviewed 71 videos\n- IPB uploaded 1 video lesson to the mathE chanel (YouTube)\n\nFrom November 2019 until May 2020:\n- IPB reviewed more video links from the partners.\n- IPB is developing more video lessons.\n- IPB checks the platform to validate if it works well.\n\nFrom May 2020 until November 2020:\n- IPB reviewed more video links from the partners\n- IPB reviewed 10 video lessons from each partner\n- IPB uploaded 45 teaching materials related to 2 topics\n- IPB uploaded the video lessons related with 2 subtopics (10 video lessons)\n\nFrom November 2020 until June 2021:\n- IPB reviewed 20 teaching materials from each partner\n- IPB uploaded more 68 teaching materials\n- IPB uploaded more 8 video lessons and 17 more from IPB are in the process review.',''),(25,'',77,55,'Gheorghe Asachi Technical University of Iasi',20180901,20210831,'IO1','The first intellectual output has the aim to develop and make available math questions for self and final assessment for students at MathE Platform:\n- Collect the lectures information to participate in the MathE Project\n- Collect the questions for self-assessment and for final assessment for MathE Project','','‘Gheorghe Asachi’ Technical University of Iasi planned and discussed the calendar of activities in order to identify their roles and responsibilities. The teachers involved in the project have been informed about IO1 – Students’ Assessment Toolkit , and about the Assessment Tools to be developed by ‘Gheorghe Asachi’ Technical University of Iasi, in collaboration with EuroEd, Iasi. \nParticipation in project meetings with the professors from ‘Gheorghe Asachi’ Technical University of Iasi involved in the project activities, discussing the tasks in the project and planning the organization of the next actions.\nThe teachers involved in the project activities have structured work and researched on the materials to be used in order to produce the Assessment Tool.\nTUIASI dealt with\nActivity IO1.3\nDefinition of 2 math topics - Differential equations and Real functions of several variables\n- 20 questions/answer, for each topic, for the Student Need Assessment Tool (Self evaluation)\n- 10 questions/answer, for each topic, for the Student Assessment Tool\nActivity IO1.4\nDefinition of further:\n- 20 questions/answer, for each topic, for the Student Need Assessment Tool (Self evaluation)\n- 10 questions/answer, for each topic, for the Student Final Assessment Tool\nTUIASI has been involved in reviewing questions from other partners and solving issues.\n71 questions for the final assessment submitted','60 questions/answer for the Student Need Assessment Tool on the topics of Differential equations (42 Questions) and Real functions of several variables (18 questions).\n20 questions/answer for the Student Assessment Tool – final assessment\nThe available questions were reviewed \n114 questions for self assessment approved\n67 questions for the final assessment approved\nThe activity is being carried out according to the time schedule.',''),(26,'',77,55,'Gheorghe Asachi Technical University of Iasi',20180901,20210831,'IO2','The objective of this intellectual output is to create a resource depository to offer students and teachers of higher education institutions teaching and learning sources to reinforce specific mathematical topics.','','‘Gheorghe Asachi’ Technical University of Iasi produced a calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\nDuring the first meeting of the project the partners discussed the template of the video and planned the strategies to use the result of the project.\nParticipation in internal meeting involving the other Romanian partner, with the focus on planning the production of the Online MathE Library of Video Lessons and Teaching Materials. During the meeting the lecturers to be filmed were planned and the math topics to be reached. \nTUIASI provided the support in organizing the production of the video lessons as teaching materials, taking the responsibility to set-up the scripts of the lessons, selecting the topics and math problems to be taught. TUIASI also will provide support in finalizing the final videos. \nAt a first stage 2 lessons have been filmed – 2 different lectures and 2 different topics. \nOne of the videos have been already edited and produced according to the planned instructions and uploaded on project YouTube Channel, by EuroEd. The TUIASI revised the video and discussed on issues related to timing. \nAt the moment 12 video lessons were created by the TUIASI, on different topics. \nTUIASI was also involved in the research and selection of 16 existing videos for each of the assigned topics or subtopics. The lecturers were involved in the review production.\nResearch of 10 Teaching materials for each of the assigned topics, different formats (to be uploaded on the project portal).','2 filming lessons\n1 video lesson as test : MathE Video lesson on Linear Differential equations - https://youtu.be/pWCtAAZ2rD4 \n15 existing videos for each of the assigned topics or subtopics (11 approved) \n12 video lessons produced and uploaded on the portal \n19 teaching resources (17 approved)',''),(27,'',77,55,'Gheorghe Asachi Technical University of Iasi',20180901,20210831,'IO3','The objective of this intellectual output is to create a community of practice which will allow Math professors in higher education institutions to share and compare different teaching resources, tools and strategies to support specific mathematical topics.','','‘Gheorghe Asachi’ Technical University of Iasi produced a calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.\nDuring the first meeting of the project the partners discussed the template and planned the strategies to use the result of the project.\nDuring the next meetings in the project, TUIASI cooperated with EuroEd and received the feedback from the coordinator and from the partners on how to produce the project Guide. The IO3 proposed structure includes Active Community of Practice; Identification of good practices; Online guidebook of good practices. \nRoles allocated: Technical Issues about the Platform – EuroED partner; Case Studies Using MathE Platform (&gt;=2 per partner) – All HEI partners; Book edition – EuroED partner\nTUIASI role was to support EuroEd to produce the Guidebook, especially related to the mathematics applicability.\nTUIASI supported EuroEd in production of the table of contents for the Guidebook. Also offered content support production for the chapters related to the usability and applicability/needs of the MathE patform resources to the 2 target groups – lecturers and students. \nTUIASI got involved in production of the template for production of the Case Studies Using MathE Platform in each of the project countries.\nTUIASI leader of Discussions For Lecturers’ Community - Motivational tips in Math Subjects','Support in IO3.4 Production of the online guidebook of good practices structure and essential contents\nSupport in IO3.4 Production of the online guidebook of good practices table of contents\nSupport in creation of the IO3.4 Guidebook of good practices - MathE teachers and students Community of Practices\nDiscussions For Lecturers’ Community - Motivational tips in Math Subjects (4 discussions, 11 posts)',''),(28,'',77,55,'Gheorghe Asachi Technical University of Iasi',20180901,20210831,'PM','From the start of the project, it was necessary to organize all documentation associated with the project, contracts, partners information, financial procedures, in consultation with TUIASI Management.','','The main activities carried out were:\nLiaise with Research Development and Innovation Office for approval to participate in the project.\nOrganize all project documentation. Recruit lecturers to take part in research. Prepare contracts for participants from TUIASI.\nSupport the development, monitor, supervise, and approve allocation of resources under IO1 – Student\'s Assessment Toolkit. \nSupport the development, monitor, supervise, and approve allocation of resources under IO2 - Guidelines for Teachers on Inclusive Education.\nSupport and monitor the implementation of the project and the PM – Project Management, Exploitation, Quality and Monitory Plan.\nProduction of the in progress Project Activities Report. Production of Project Financial Report. Working for development of the monthly activity reports\nParticipation in transnational partners meetings. Review of the MathE_meetings minutes\nReview of the Annex 18 - Partners\' Role_TUIasi and monitor the project implementation. \nPermanent monitor of the Annex 2 - Calendar of activities, monitoring the implementation of the project at local level. Providing support with the management of project implementation distributing tasks to the national project team according to the activities planned in the project calendar.\nPermanent collaboration and communication with the team on monitoring the project progress\nTUIASI dealt with the task of involving target group within the project: 5 lecturers and 40 students. \nIn terms of dissemination, TUIASI is on-going involved in dissemination activities. Evidences have been uploaded on the project portal. \nIn terms of exploitation, TUIASI have been involved in different actions to promote the project and to attract potential interest stakeholders. TUIASI dealt with PM3.2) Involvement in the project to organizations operating in the field of education, who will join the project as associated partner filling in the Associate partner form. \nTUIASI dealt also with PM3.3) Publication of announcements on 5 portals or websites addressed to teachers.','- Online Database of Target Groups: 8 lecturers and 43 students\n-	In progress Project Activities Report – every reporting period\n-	Project Financial Report\n-	On-going dissemination events\n-	MathE_Partners Dissemination Report\n-	2 exploitation links\n-	27 evaluation questionnaires collected\n-	PM4.F – Evaluation report on testing activity_RO',''),(29,'',82,44,'Limerick Institute of Technology',20181101,20210831,'IO3','This Intellectual Output is on-going.\n\nThe Community of Practice is developing.\n\nTo make links for collaboration between international partners - students and lecturers.\n\nIt is hoped that the community of practice will continue and will encourage more users of the portal.','','Lecturers, students and associated partners being identified.\n\nInformation emails and drop-in talks to potential members of the Community of Practice.\n\nON-going dissemination activities to try to include more partners in the Community of Practice.\n\nContributions have been made by lecturers and researchers to the community of practice. Various discussion threads have developed. Students are being encouraged to also contribute to the discussions in the student community.','Lecturers and students identified on project portal.\n\nA number of LIT students and lecturers have joined the Community of Practice.\n\nWe have contacted other potential associates and invited them to become associated with the project and to join the Community of Practice.\n\nThe discussions have started on various topics in the Community of Practice. This work is on-going. It is hoped to continue with this element of the project to sustain further project use.',''),(30,'',81,50,'Instituto Politécnico de Bragança',20180901,20210622,'IO3','This phase is dedicated to the creation of a community of practice allowing Math teachers in higher education institutions to share and compare teaching sources, tools and strategies','','IPB, in cooperation with Pixel, produced a detailed calendar of activities in order to identify the different partners\' roles, deadlines and responsibilities.','A global map is produced to visualize the universities that take part of the MathE portal.\nThe community of practice topics were defined in Ireland meeting.\nOctober/November 2020:\n- IPB checked the platform searching for problems related to the community of practice.\nFrom January 2021 till the end of the project:\n- IPB is responsible to answer some topics in the communties of practices (lecturers and students) and it is engaged to spread these communities around teachers and students.',''),(31,'',78,42,'Kauno technologijos universitetas',20180901,20210831,'IO3','This Intellectual Output aims at creating a community of practice of Math teachers in higher education in order to share and compare teaching sources, tools and strategies.','','We had online meeting with students (which was organized during one of the lectures) to show them community of practice, as well asked to participate in it.\nAlso we, as teachers, participated in the community of practice. \nWe suggested and were involved into topic we moderated \'Math Activities using Active Based Learning\', as well provided the answers for users (moderated the discussion) in these topics.','Participation into discussions\nmoderation of Topic \"Math Activities using Active Based Learning\" and comments for sub-topics: \nActivities for Remote Teaching\nThe Best game for Best teaching you have ever had\nDo you use self-assesment testing for Math teaching?\nInvolvement of students and lecturers for partners initiated discussions','');
