INSERT INTO `press` VALUES (22,'Pixel','<p>\r\n	Pixel is partner in the MathE&nbsp;project. Pixel website provides information about the project together with a direct link to the Portal. Users from Universities, Associations, Public bodies, Training Agencies, Schools, participants in the International Conferences on Education and people interested in the seminars/masters visit Pixel website (estimated visits are around 12.000 users each year). They may now learn about and benefit from the MathE&nbsp;project</p>','https://www.pixel-online.net/PRJ__projects_form.php?id_prj=144&id_area=&id_ben='),(23,'KTU - Faculty of Informatics','<p>\n	KTU - Faculty of Informatics, is partner in the MathE project. KTU website provides information about the project together with a direct link to the Portal. There are many users of KTU website that may now learn about and benefit from the MathE project.</p>','https://en.ktu.edu/projects/?firstLevel=6996&amp;secondLevel=6997&amp;thirdLevel=&amp;year-range=2016+-+2020'),(24,'LieDM association - English','<p>\r\n	Lithuanian Association of Distance and e-Learning (LieDM) &ndash; is a volunteer organization which unites all Lithuanian science, study, and education institutions which implement distance teaching and learning. The association&#39;s website provides information about the project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','http://liedm.net/en/projects/'),(25,'VšĮ Emundus','<p>\r\n	Public institution &ldquo;eMundus&rdquo; was established in 2009 in order to streamline research and implementation activities in the area of education and the use and adaptation of information and communication technologies in different spheres. Since the beginning of 2012 the vision was supplemented taking very important aspect for the society development - cultural and healthy lifestyle promotion. The eMundus&#39; website provides information about the project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','https://www.emundus.lt/veikla/projektai-kuriuose-emundus-asocijuotas-partneris/'),(26,'KTU - Faculty of Mathematics','<p>\n	KTU - Faculty of Mathematics, is partner in the MathE project. KTU website provides information about the project together with a direct link to the Portal. There are many users of KTU website that may now learn about and benefit from the MathE project.</p>','https://mgmf.ktu.edu/projects/mathe-matematikos-igudziu-gerinimas-aukstojo-mokslo-srityje/'),(27,'LieDM association - Lithuanian','<p>\r\n	Lithuanian Association of Distance and e-Learning (LieDM) &ndash; is a volunteer organization which unites all Lithuanian science, study, and educational institutions which implement distance teaching and learning.&nbsp;The association&#39;s website provides information about the project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','http://liedm.net/projektai/'),(28,'Kaunas University of Technology','<p>\n	Kaunas University of Technology is partner in the MathE project. KTU website provides information about the project together with a direct link to the Portal. There are many users of KTU website that may now learn about and benefit from the MathE project.</p>','https://en.ktu.edu/projects/mathe-improve-math-skills-in-higher-education/'),(29,'Fiction  - Functional ICT Instruction On the Net','<p>\n	The <a href=\"https://fiction.pixel-online.org/index.php\">Fiction project</a> is funded by the European Commission through the Swedish Council for Higher Education with the aim of enhancing teachers\' knowledge to teach students to use digital tools for their own understanding of science.</p>','https://fiction.pixel-online.org/index.php'),(30,'SMiLD Project - Focus on Students with Mathematics Learning Disabilities','<p>\r\n	The <a href=\"https://smild.pixel-online.org/index.php\">SMiLD project</a> is funded by the European Commission through the Italian National Agency for the Erasmus+ Programme. The assumption is that learning difficulties in mathematics do not often occur with clarity and simplicity. They manifest themselves differently in different people, and are often left undiagnosed. Therefore the project aims at promoting the acquisition of skills and key competences with a specific focus on addressing underachievement in maths.&nbsp;The project website provides information about the MathE project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','https://smild.pixel-online.org/index.php'),(31,'Do Well Science Project','<p>\r\n	The <a href=\"https://www.dowellscience.eu/project/index.php\">Do Well Science project </a>is funded by the European Commission through the Italian National Agency for the Erasmus+ Programme with the aims to increase secondary students&rsquo; achievements in science subjects.&nbsp;The project website provides information about the MathE project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','https://www.dowellscience.eu/project/index.php'),(32,'LIT Development Website','<p>\n	LIT is partner in the MathE project. LIT Development Unit website provides information about the project together with a direct link to the Portal. There are many users of The Development Unit website that may now learn about and benefit from the MathE project.</p>','http://www.lit.ie/RDI/Development/Technology/MathE/default.aspx'),(33,'Research Centre in Digitalization and Intelligent Robotics (CeDRI)','<p>\r\n	The Research Centre in Digitalization and Intelligent Robotics (CeDRI) is an applied inter-disciplinar research unit that clusters together active researchers from the fields of Electronics, Computer Science and Mathematics. There are many users of the CeDRI&rsquo;s website that may now learn about and benefit from the MathE project.&nbsp;</p>','http://cedri.ipb.pt/r&d_projects_international.html'),(34,'EureKit – Mathematical Games project','<p>\r\n	The EureKit &ndash; Mathematical Games project mission is to promote Mathematics in an entertaining and attractive way. Its Facebook page, which counts almost 300 followers, provides information about the project and contains a direct link to the MathE project&rsquo;s website&nbsp;then all the users may now learn about and benefit from the MathE project.</p>','https://www.facebook.com/eurekit.ipb/'),(35,'Instituto Politécnico de Bragança','<p>\r\n	Instituto Polit&eacute;cnico de Bragan&ccedil;a is the coordinator of the MathE project. The website provides information about the project together with a direct link to the Portal. There are many users of the IPB&#39;s website (students, lecturers and all the website&#39;s visitors) that may now learn about and benefit from the MathE project.&nbsp;</p>','http://portal3.ipb.pt/index.php/pt/gri/outros-programas-e-projectos'),(36,'LIT News Website','<p>\r\n	LIT is partner in the MathE project. LIT The news website provides information about the project together with a direct link to the Portal. There are many users of The News website and its archive that may now learn about and benefit from the MathE project.</p>','http://www.lit.ie/News/Item/LIT_MathE.aspx'),(37,'EuroEd website','<p>\r\n	EuroEd is a partner in the MathE project. The EuroEd website provides information about the project together with a direct link to the Portal. There are many users of EuroEd&rsquo;s website that may now learn about and benefit from the MathE project</p>','s'),(38,'EuroEd Facebook page','<p>\r\n	EuroEd Facebook Page is an online community of over 2500 permanent viewers.</p>\r\n<p>\r\n	The people interested in the activities carried out by EuroEd can access the institutional Facebook page and can read about the projects, including MathE project (info about the project, news, events, photos from the activities, etc.). Also, on the official EuroEd Facebook Page, visitors can find a direct link to the project portal, photo album dedicated to the MathE project, share ideas about the project and connect with others to ensure the visibility of the project and to collect feedback and suggestions from other countries</p>','s'),(39,'EuroEd Twitter account','<p>\r\n	Twitter is an online social networking service and microblogging service that enables its users to send and read text-based messages on various subjects. Creating a very complex network, you can use Twitter for sharing and disseminating projects. The MathE project have been shared ensuring this way its visibility also to other countries. On the Social Media page (which counts around 150 followers) of the instituion is available a link to the project portal then all the users may now learn about and benefit from the MathE&nbsp;project.</p>','s'),(40,'EuroEd LinkedIn profile','<p>\r\n	LinkedIn Corporation is a social networking website for people in professional occupations. Founded in December 2002 and launched on May 5, 2003 it is mainly used for professional networking. LinkedIn reports more than 200 million acquired users in more than 200 countries and territories. &nbsp;On the EuroEd account, the MathE project has been distributed among the network. On the Social Media page of the instituion is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>','d'),(41,'MathE YouTube account','<p>\r\n	The biggest and world spread video platform, YouTube, includes an account dedicated to the MathE project , where video materials created within the projects are uploaded. The video uploaded includes also a link to the project portal, this way the Youtube subscribers and viewers can interconnect and&nbsp;earn about and benefit from the MathE project.&nbsp;</p>','ds'),(42,'Cattedra UNESCO in “Anthropology of Health. Biosphere and healing systems','<p>\r\n	The Cattedra UNESCO in &ldquo;Anthropology of Health. Biosphere and healing systems&rdquo; is partner in the MATHE project. The Cattedra UNESCO website provides direct link to the MATHE portal. All website visitors from around the world may now learn about the MATHE project.</p>','ds'),(43,'Società Dante Alighieri Wroclaw Poland','<p>\r\n	The Societ&agrave; Dante Alighieri Wroclaw Poland website provides direct link to the MATHE portal. There are many users of Dante&rsquo;s website that may now learn about and benefit from the MathE project.</p>','d'),(44,'University of Genoa','<p>\r\n	The University of Genoa is one of the most valuable cultural and scientific heritage of the Mediterranean and the Italian north-western area. It is deeply interconnected with the city of Genoa and its economic framework.&nbsp;A link to the MathE project is available on the website of University of Genova. Many students and lecturers visit daily the web site then all the users who visit the university website may now learn about and benefit from the MathE project.&nbsp;</p>','d'),(45,'GoScience','<p>\r\n	The aim of the GoScience project is to promote studetns&#39; creativity with the aim of making scientific knowledge better understandable and increase their functional literacy in STEM subjects.&nbsp;On the web page of the instituion is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>','https://www.goscience.eu/exploitation_info.php'),(46,'Teachers Closed Group on Facebook','<p>\r\n	Teachers group on Facebook has over 38.000 members all over the world. It is a safe place for teachers where they can share ideas and experiences. The MathE project has been distributed among the teachers&rsquo; network.</p>\r\n<p>\r\n	On the FB group of the association is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>\r\n<p>\r\n	&nbsp;</p>','www.google.it'),(47,'Mathematics ++ @maths.everyday','<p>\r\n	Facebook Community about Mathematics. 29.299 people are following the Community posts.&nbsp;On the Social Media page is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>','https://www.facebook.com/maths.everyday/'),(48,'Mathematics','<p>\r\n	Facebook Community about Mathematics. 338.093 people are following the Community posts. On the Social Media page is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>','https://www.facebook.com/Mathematics-766203246743307/'),(49,'University of Genova - Emanuela De Negri','<p>\r\n	A direct link to the project portal is available from Emanuela De Negri&#39;s web page on the web site of the University of Genova.&nbsp;She works in the University of Genova and in her personal section she has a direct link to the Fiction project portal. All students, teachers and staff of the university, and all users who visit the university website may now learn about and benefit from the MathE project.&nbsp;</p>','https://www.dima.unige.it/~denegri/'),(50,'Liceo Scientifico Enrico Fermi','<p>\n	Liceo Scientifico Enrico Fermi is partner in the MathE project. Liceo Scientifico Enrico Fermi website provides information about the project together with a direct link to the Portal. There are many users of the website that may now learn about and benefit from the MathE project.</p>','http://www.fermi.edu.it/'),(51,'LIT Applied Science Facebook page','<p>\n	LIT is partner in the MathE project. The Facebook page provides information about the project together with a direct link to the Portal. There are over 700 followers of the Applied Science Facebook page and its archive that may now learn about and benefit from the MathE project.</p>','s'),(52,'LIT Development Unit','<p>\r\n	LIT is partner in the MathE project. The Development Unit has a dedicated page to the MathE project.&nbsp;The Development Unit website provides information about the project together with a direct link to the Portal. There are many external users of LIT&rsquo;s Development Unit website.</p>','https://lit.ie/Research-Development/Development/Technology/MathE-(1)'),(53,'LIT Development Unit Facebook page','<p>\r\n	LIT is partner in the MathE project. The Development Unit has a Facebook link to the MathE project. Itaround 150 followers) of the institution is available a link to the project portal then all the users may now learn about and benefit from the MathE project.</p>','https://www.facebook.com/RDIatLIT'),(54,'Liceo Armaldi Novi Ligure','<p>\r\n	Liceo Scientifico Statale of Novi Ligure, established in the 1968/69 school year as a detached section of the Liceo Scientifico Statale &quot;G. Galilei&quot; of Alessandria, obtained administrative autonomy in the 1972/73 school year. In 1994 it was named after Edoardo Amaldi.&nbsp;On the web page of the instituion is available a link to the project portal. All the students, the teachers, the staff of the school, and the users who visit the school website may now learn about and benefit from the MathE project.&nbsp;</p>','https://www.amaldinovi.edu.it'),(55,'DIMA','<p>\r\n	DIMA is the departmen of mathemtatics and statiscs of the University of Genova. DIMA offers two bachelor&#39;s degree programs (in mathematics and statistics), one master&#39;s degree program and two doctoral programs.&nbsp;On the web page of the instituion is available a link to the project portal so all students, teachers, staff of the university, and all users who visit the university website may now learn about and benefit from the MathE project.&nbsp;</p>','https://www2.dima.unige.it/ricerca/progetti_int'),(56,'Liceo Classico Scientifico & Sportivo Statale “M. L. King”','<div>\r\n	The Liceo was born in the sixties as the &quot;Third Scientific High School&quot;. In the school year 69/70</div>\r\n<div>\r\n	was transformed into an autonomous high school, assuming the name of 3rd State Scientific High School and in the 70/71 school year it changed its name to Liceo Scientifico Martin Luther King.</div>\r\n<div>\r\n	Luther King.&nbsp;On the web page of the instituion is available a link to the project portal. All the students, the teachers, the staff of the school, and the users who visit the school website may now learn about and benefit from the MathE project.&nbsp;</div>','https://www.liceoking.it/Progetti_Europei.php'),(57,'TUIASI-Dept.of Mathematics and Informatics website','<p>\n	Department of Mathematics and Informatics from  “Gheorghe Asachi” Technical University is partner in the MathE project. The website of Dept.of Mathematics and Informatics provides information about the project together with the direct link to the Portal for academic community.</p>','http://math.etti.tuiasi.ro/?page_id=701'),(58,'Differential Geometry and Its Applications – Facebook group','<p>\n	This is a group of mathematician’s community focused on the applications and theory of differential geometry. The Facebook Page is an online community of over 9500 permanent viewers. The members can access information about MathE project (news, events, photos from the activities, etc.).</p>','https://www.facebook.com/groups/170501143878'),(59,'Faculty of Electronics, Telecommunications and Information Technology website','<p>\n	The Faculty of Electronics, Telecommunications and Information Technology, Technical University \"Gheorghe Asachi\" of Iasi promoting science and technology, through dissemination, generation and preserving the most advanced knowledge in the fields of electronics and telecommunications, as well as in the interdisciplinary fields, including Mathematics. MathE project and the link of the MathE platform is presented.</p>','https://etti.tuiasi.ro/cercetare/granturi/'),(60,'MathE YouTube','<p>\n	The video platform YouTube, includes an account dedicated to the MathE project where video materials created within the projects are uploaded. The video uploaded includes also a link to the project portal.</p>','https://www.youtube.com/watch?v=Vy_aq8CRqT8'),(61,'Facultatea de Electronică, Telecomunicații și Tehnologia Informației, Iași -Facebook Group','<p>\n	This is the Facebook group of students and teachers from the Faculty of Electronics, Telecommunications and Information Technology, Technical University \"Gheorghe Asachi\" of Iasi. The group on Facebook has over 2000 active members. The MathE project has been distributed among the students and teachers network.</p>','https://www.facebook.com/groups/399112556347/?multi_permalinks=10158902589096348&amp;notif_id=1625135336278060&amp;notif_t=feedback_reaction_generic&amp;ref=notif'),(62,'Faculty of Electrical Engineering - website','The Faculty of Electrical Engineering, Technical University \"Gheorghe Asachi\" of Iasi, is a prestigious faculty that was founded in 1910. With an employment rate of over 90%,  with solid accumulated knowledge in the field of information technology, strong or weak currents, as well as economic management, the graduated students are required in industry and research throughout the European Union.The details of MathE project and the link of the MathE platform are presented.','https://ieeia.tuiasi.ro/mathe-improve-math-skills-in-higher-education/'),(63,'Scholars-Mathematics for All – Facebook group','<p>\n	The group Scholars-Mathematics for All provides a platform for young mathematicians to discuss their mathematical problems, to explore new books, to know upcoming projects, conferences and workshops. It has more than 1900 viewers. And in this journey, the learning and teaching mathematics is pursued. So, the MathE project is for interest for this group.</p>','https://www.facebook.com/groups/196718864918598'),(64,'Pixel\'s twitter profile','<p>\r\n	During the 11th edition of the Future of Education, International Conference held online (on a highly interactive e-Platform) on 1-2 July 2021, Elisabetta Delle Donne presented the MathE project describing the project aims and activities.&nbsp;The tweet provides a direct link to the project portal then all the users (partners, lecturers, associated partners and people interested in the project) may now learn about and benefit from the MathE project.</p>','https://twitter.com/PixelFirenze/status/1412760501470248964?s=20');
